(305, 1, 10, 'reviews', 'reviews', 'The citing entity reviews statements, ideas or conclusions presented in the cited entity.'),
(306, 1, 10, 'ridicules', 'ridicules', 'The citing entity ridicules the cited entity or aspects of its contents.'),
(307, 1, 10, 'sharesPublicationVenueWith', 'shares publication venue with', 'The citing and cited bibliographic resources are published in same publication venue.'),
(308, 1, 10, 'speculatesOn', 'speculates on', 'The citing entity speculates on something within or related to the cited entity, without firm evidence.'),
(309, 1, 10, 'supports', 'supports', 'The citing entity provides intellectual or factual support for statements, ideas or conclusions presented in the cited entity.'),
(310, 1, 10, 'updates', 'updates', 'The citing entity updates statements, ideas, hypotheses or understanding presented in the cited entity.'),
(311, 1, 10, 'usesConclusionsFrom', 'uses conclusions from', 'The citing entity describes work that uses conclusions presented in the cited entity.'),
(312, 1, 10, 'usesDataFrom', 'uses data from', 'The citing entity describes work that uses data presented in the cited entity.'),
(313, 1, 10, 'usesMethodIn', 'uses method in', 'The citing entity describes work that uses a method detailed in the cited entity.'),
(314, 1, 10, 'cites', 'cites', 'The citing entity cites the cited entity, either directly and explicitly (as in the reference list of a journal article), indirectly (e.g. by citing a more recent paper by the same group on the same topic), or implicitly (e.g. as in artistic quotations or parodies, or in cases of plagiarism).'),
(315, 1, 10, 'isCitedBy', 'is cited by', 'The cited entity (the subject of the RDF triple) is cited by the citing entity (the object of the triple).'),
(316, 1, 10, 'hasCitationCreationDate', 'has citation creation date', 'The date on which the citation was created. This has the same numerical value as the publication date of the citing bibliographic resource, but is a property of the citation itself.  When combined with the citation time span, it permits that citation to be located in history.'),
(317, 1, 10, 'hasCitationTimeSpan', 'has citation time span', 'The temporal characteristic of a citation, namely the interval between the publication date of the cited entity and the publication date of the citing entity. Note that when one or both of the publication dates is given as just \'year\', then the citation time span is rounded to the nearest year, and when one or both of the publication dates is given as just \'year and month\', then the citation time span is rounded to the nearest month, with the inherent inaccuracies that such rounding involves.'),
(318, 1, 10, 'hasCoAuthorshipCitationLevel', 'has co-authorship citation level', 'This property specifies the minimal distance that one of the authors of the citing entity has with regards to one of the authors of the cited entity, according to their co-authorship network.\n\nFor instance, a citation has a co-authorship citation level equal to 1 if at least one author of the citing entity has previously published as co-author with one of the authors of the cited entity. Similarly, we say that a citation has a co-authorship citation level equal to 2 if at least one author of the citing entity has previously published as co-author with someone who him/herself has previously published as co-author with one of the authors of the cited entity. And so on.'),
