(338, 1, 12, 'annotationService', 'annotationService', 'The object of the relationship is the end point of a service that conforms to the annotation-protocol, and it may be associated with any resource.  The expectation of asserting the relationship is that the object is the preferred service for maintaining annotations about the subject resource, according to the publisher of the relationship.\n\n  This relationship is intended to be used both within Linked Data descriptions and as the  rel  type of a Link, via HTTP Link Headers rfc5988 for binary resources and in HTML <link> elements.  For more information about these, please see the Annotation Protocol specification annotation-protocol.\n  '),
(339, 1, 12, 'bodyValue', 'bodyValue', 'The object of the predicate is a plain text string to be used as the content of the body of the Annotation.  The value MUST be an  xsd:string  and that data type MUST NOT be expressed in the serialization. Note that language MUST NOT be associated with the value either as a language tag, as that is only available for  rdf:langString .\n  '),
(340, 1, 12, 'cachedSource', 'cachedSource', 'A object of the relationship is a copy of the Source resource\'s representation, appropriate for the Annotation.'),
(341, 1, 12, 'canonical', 'canonical', 'A object of the relationship is the canonical IRI that can always be used to deduplicate the Annotation, regardless of the current IRI used to access the representation.'),
(342, 1, 12, 'end', 'end', 'The end property is used to convey the 0-based index of the end position of a range of content.'),
(343, 1, 12, 'exact', 'exact', 'The object of the predicate is a copy of the text which is being selected, after normalization.'),
(344, 1, 12, 'hasBody', 'hasBody', 'The object of the relationship is a resource that is a body of the Annotation.'),
(345, 1, 12, 'hasEndSelector', 'hasEndSelector', 'The relationship between a RangeSelector and the Selector that describes the end position of the range. '),
(346, 1, 12, 'hasPurpose', 'hasPurpose', 'The purpose served by the resource in the Annotation.'),
(347, 1, 12, 'hasScope', 'hasScope', 'The scope or context in which the resource is used within the Annotation.'),
(348, 1, 12, 'hasSelector', 'hasSelector', 'The object of the relationship is a Selector that describes the segment or region of interest within the source resource.  Please note that the domain ( oa:ResourceSelection ) is not used directly in the Web Annotation model.'),
(349, 1, 12, 'hasSource', 'hasSource', 'The resource that the ResourceSelection, or its subclass SpecificResource, is refined from, or more specific than. Please note that the domain ( oa:ResourceSelection ) is not used directly in the Web Annotation model.'),
(350, 1, 12, 'hasStartSelector', 'hasStartSelector', 'The relationship between a RangeSelector and the Selector that describes the start position of the range. '),
(351, 1, 12, 'hasState', 'hasState', 'The relationship between the ResourceSelection, or its subclass SpecificResource, and a State resource. Please note that the domain ( oa:ResourceSelection ) is not used directly in the Web Annotation model.'),
(352, 1, 12, 'hasTarget', 'hasTarget', 'The relationship between an Annotation and its Target.'),
(353, 1, 12, 'motivatedBy', 'motivatedBy', 'The relationship between an Annotation and a Motivation that describes the reason for the Annotation\'s creation.'),
(354, 1, 12, 'prefix', 'prefix', 'The object of the property is a snippet of content that occurs immediately before the content which is being selected by the Selector.'),
(355, 1, 12, 'processingLanguage', 'processingLanguage', 'The object of the property is the language that should be used for textual processing algorithms when dealing with the content of the resource, including hyphenation, line breaking, which font to use for rendering and so forth.  The value must follow the recommendations of BCP47.'),
(356, 1, 12, 'refinedBy', 'refinedBy', 'The relationship between a Selector and another Selector or a State and a Selector or State that should be applied to the results of the first to refine the processing of the source resource. '),
(357, 1, 12, 'renderedVia', 'renderedVia', 'A system that was used by the application that created the Annotation to render the resource.'),
(358, 1, 12, 'sourceDate', 'sourceDate', 'The timestamp at which the Source resource should be interpreted as being applicable to the Annotation.'),
(359, 1, 12, 'sourceDateEnd', 'sourceDateEnd', 'The end timestamp of the interval over which the Source resource should be interpreted as being applicable to the Annotation.'),
(360, 1, 12, 'sourceDateStart', 'sourceDateStart', 'The start timestamp of the interval over which the Source resource should be interpreted as being applicable to the Annotation.'),
(361, 1, 12, 'start', 'start', 'The start position in a 0-based index at which a range of content is selected from the data in the source resource.'),
(362, 1, 12, 'styleClass', 'styleClass', 'The name of the class used in the CSS description referenced from the Annotation that should be applied to the Specific Resource.'),
(363, 1, 12, 'styledBy', 'styledBy', 'A reference to a Stylesheet that should be used to apply styles to the Annotation rendering.'),
(364, 1, 12, 'suffix', 'suffix', 'The snippet of text that occurs immediately after the text which is being selected.'),
(365, 1, 12, 'textDirection', 'textDirection', 'The direction of the text of the subject resource. There MUST only be one text direction associated with any given resource.'),
(366, 1, 12, 'via', 'via', 'A object of the relationship is a resource from which the source resource was retrieved by the providing system.'),
(367, 1, 13, 'type', 'type', 'The subject is an instance of a class.'),
(368, 1, 13, 'subject', 'subject', 'The subject of the subject RDF statement.'),
(369, 1, 13, 'predicate', 'predicate', 'The predicate of the subject RDF statement.'),
(370, 1, 13, 'object', 'object', 'The object of the subject RDF statement.'),
(371, 1, 13, 'value', 'value', 'Idiomatic property used for structured values.'),
(372, 1, 13, 'first', 'first', 'The first item in the subject RDF list.'),
(373, 1, 13, 'rest', 'rest', 'The rest of the subject RDF list after the first item.'),
(374, 1, 14, 'abridged', 'abridged', 'Indicates whether the book is an abridged edition.'),
(375, 1, 14, 'abstract', 'abstract', 'An abstract is a short description that summarizes a [[CreativeWork]].'),
(376, 1, 14, 'accelerationTime', 'accelerationTime', 'The time needed to accelerate the vehicle from a given start velocity to a given target velocity.\\\n\\\nTypical unit code(s): SEC for seconds\\\n\\\n* Note: There are unfortunately no standard unit codes for seconds/0..100 km/h or seconds/0..60 mph. Simply use \"SEC\" for seconds and indicate the velocities in the [[name]] of the [[QuantitativeValue]], or use [[valueReference]] with a [[QuantitativeValue]] of 0..60 mph or 0..100 km/h to specify the reference speeds.'),
(377, 1, 14, 'acceptedAnswer', 'acceptedAnswer', 'The answer(s) that has been accepted as best, typically on a Question/Answer site. Sites vary in their selection mechanisms, e.g. drawing on community opinion and/or the view of the Question author.'),
(378, 1, 14, 'acceptedOffer', 'acceptedOffer', 'The offer(s) -- e.g., product, quantity and price combinations -- included in the order.'),
(379, 1, 14, 'acceptedPaymentMethod', 'acceptedPaymentMethod', 'The payment method(s) accepted by seller for this offer.'),
(380, 1, 14, 'acceptsReservations', 'acceptsReservations', 'Indicates whether a FoodEstablishment accepts reservations. Values can be Boolean, an URL at which reservations can be made or (for backwards compatibility) the strings ```Yes``` or ```No```.'),
(381, 1, 14, 'accessCode', 'accessCode', 'Password, PIN, or access code needed for delivery (e.g. from a locker).'),
(382, 1, 14, 'accessMode', 'accessMode', 'The human sensory perceptual system or cognitive faculty through which a person may process or perceive information. Expected values include: auditory, tactile, textual, visual, colorDependent, chartOnVisual, chemOnVisual, diagramOnVisual, mathOnVisual, musicOnVisual, textOnVisual.\n      '),
(383, 1, 14, 'accessModeSufficient', 'accessModeSufficient', 'A list of single or combined accessModes that are sufficient to understand all the intellectual content of a resource. Expected values include:  auditory, tactile, textual, visual.\n      '),
(384, 1, 14, 'accessibilityAPI', 'accessibilityAPI', 'Indicates that the resource is compatible with the referenced accessibility API ([WebSchemas wiki lists possible values](http://www.w3.org/wiki/WebSchemas/Accessibility)).'),
(385, 1, 14, 'accessibilityControl', 'accessibilityControl', 'Identifies input methods that are sufficient to fully control the described resource ([WebSchemas wiki lists possible values](http://www.w3.org/wiki/WebSchemas/Accessibility)).'),
(386, 1, 14, 'accessibilityFeature', 'accessibilityFeature', 'Content features of the resource, such as accessible media, alternatives and supported enhancements for accessibility ([WebSchemas wiki lists possible values](http://www.w3.org/wiki/WebSchemas/Accessibility)).'),
(387, 1, 14, 'accessibilityHazard', 'accessibilityHazard', 'A characteristic of the described resource that is physiologically dangerous to some users. Related to WCAG 2.0 guideline 2.3 ([WebSchemas wiki lists possible values](http://www.w3.org/wiki/WebSchemas/Accessibility)).'),
(388, 1, 14, 'accessibilitySummary', 'accessibilitySummary', 'A human-readable summary of specific accessibility features or deficiencies, consistent with the other accessibility metadata but expressing subtleties such as \"short descriptions are present but long descriptions will be needed for non-visual users\" or \"short descriptions are present and no long descriptions are needed.\"'),
(389, 1, 14, 'accommodationCategory', 'accommodationCategory', 'Category of an [[Accommodation]], following real estate conventions e.g. RESO (see [PropertySubType](https://ddwiki.reso.org/display/DDW17/PropertySubType+Field), and [PropertyType](https://ddwiki.reso.org/display/DDW17/PropertyType+Field) fields  for suggested values).'),
(390, 1, 14, 'accommodationFloorPlan', 'accommodationFloorPlan', 'A floorplan of some [[Accommodation]].'),
(391, 1, 14, 'accountId', 'accountId', 'The identifier for the account the payment will be applied to.'),
(392, 1, 14, 'accountMinimumInflow', 'accountMinimumInflow', 'A minimum amount that has to be paid in every month.'),
(393, 1, 14, 'accountOverdraftLimit', 'accountOverdraftLimit', 'An overdraft is an extension of credit from a lending institution when an account reaches zero. An overdraft allows the individual to continue withdrawing money even if the account has no funds in it. Basically the bank allows people to borrow a set amount of money.');
INSERT INTO `property` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(394, 1, 14, 'accountablePerson', 'accountablePerson', 'Specifies the Person that is legally accountable for the CreativeWork.'),
(395, 1, 14, 'acquireLicensePage', 'acquireLicensePage', 'Indicates a page documenting how licenses can be purchased or otherwise acquired, for the current item.'),
(396, 1, 14, 'acquiredFrom', 'acquiredFrom', 'The organization or person from which the product was acquired.'),
(397, 1, 14, 'acrissCode', 'acrissCode', 'The ACRISS Car Classification Code is a code used by many car rental companies, for classifying vehicles. ACRISS stands for Association of Car Rental Industry Systems and Standards.'),
(398, 1, 14, 'actionAccessibilityRequirement', 'actionAccessibilityRequirement', 'A set of requirements that a must be fulfilled in order to perform an Action. If more than one value is specied, fulfilling one set of requirements will allow the Action to be performed.'),
(399, 1, 14, 'actionPlatform', 'actionPlatform', 'The high level platform(s) where the Action can be performed for the given URL. To specify a specific application or operating system instance, use actionApplication.'),
(400, 1, 14, 'actionStatus', 'actionStatus', 'Indicates the current disposition of the Action.'),
(401, 1, 14, 'actionableFeedbackPolicy', 'actionableFeedbackPolicy', 'For a [[NewsMediaOrganization]] or other news-related [[Organization]], a statement about public engagement activities (for news media, the newsroom’s), including involving the public - digitally or otherwise -- in coverage decisions, reporting and activities after publication.'),
(402, 1, 14, 'activeIngredient', 'activeIngredient', 'An active ingredient, typically chemical compounds and/or biologic substances.'),
(403, 1, 14, 'activityDuration', 'activityDuration', 'Length of time to engage in the activity.'),
(404, 1, 14, 'activityFrequency', 'activityFrequency', 'How often one should engage in the activity.'),
(405, 1, 14, 'actors', 'actors', 'An actor, e.g. in tv, radio, movie, video games etc. Actors can be associated with individual items or with a series, episode, clip.'),
(406, 1, 14, 'addOn', 'addOn', 'An additional offer that can only be obtained in combination with the first base offer (e.g. supplements and extensions that are available for a surcharge).'),
(407, 1, 14, 'additionalName', 'additionalName', 'An additional name for a Person, can be used for a middle name.'),
(408, 1, 14, 'additionalNumberOfGuests', 'additionalNumberOfGuests', 'If responding yes, the number of guests who will attend in addition to the invitee.'),
(409, 1, 14, 'additionalProperty', 'additionalProperty', 'A property-value pair representing an additional characteristics of the entitity, e.g. a product feature or another characteristic for which there is no matching property in schema.org.\\\n\\\nNote: Publishers should be aware that applications designed to use specific schema.org properties (e.g. http://schema.org/width, http://schema.org/color, http://schema.org/gtin13, ...) will typically expect such data to be provided using those properties, rather than using the generic property/value mechanism.\n'),
(410, 1, 14, 'additionalType', 'additionalType', 'An additional type for the item, typically used for adding more specific types from external vocabularies in microdata syntax. This is a relationship between something and a class that the thing is in. In RDFa syntax, it is better to use the native RDFa syntax - the \'typeof\' attribute - for multiple types. Schema.org tools may have only weaker understanding of extra types, in particular those defined externally.'),
(411, 1, 14, 'additionalVariable', 'additionalVariable', 'Any additional component of the exercise prescription that may need to be articulated to the patient. This may include the order of exercises, the number of repetitions of movement, quantitative distance, progressions over time, etc.'),
(412, 1, 14, 'address', 'address', 'Physical address of the item.'),
(413, 1, 14, 'addressCountry', 'addressCountry', 'The country. For example, USA. You can also provide the two-letter [ISO 3166-1 alpha-2 country code](http://en.wikipedia.org/wiki/ISO_3166-1).'),
(414, 1, 14, 'addressLocality', 'addressLocality', 'The locality in which the street address is, and which is in the region. For example, Mountain View.'),
(415, 1, 14, 'addressRegion', 'addressRegion', 'The region in which the locality is, and which is in the country. For example, California or another appropriate first-level [Administrative division](https://en.wikipedia.org/wiki/List_of_administrative_divisions_by_country) '),
(416, 1, 14, 'administrationRoute', 'administrationRoute', 'A route by which this drug may be administered, e.g. \'oral\'.'),
(417, 1, 14, 'advanceBookingRequirement', 'advanceBookingRequirement', 'The amount of time that is required between accepting the offer and the actual usage of the resource or service.'),
(418, 1, 14, 'adverseOutcome', 'adverseOutcome', 'A possible complication and/or side effect of this therapy. If it is known that an adverse outcome is serious (resulting in death, disability, or permanent damage; requiring hospitalization; or is otherwise life-threatening or requires immediate medical attention), tag it as a seriouseAdverseOutcome instead.'),
(419, 1, 14, 'affectedBy', 'affectedBy', 'Drugs that affect the test\'s results.'),
(420, 1, 14, 'affiliation', 'affiliation', 'An organization that this person is affiliated with. For example, a school/university, a club, or a team.'),
(421, 1, 14, 'afterMedia', 'afterMedia', 'A media object representing the circumstances after performing this direction.'),
(422, 1, 14, 'agent', 'agent', 'The direct performer or driver of the action (animate or inanimate). e.g. *John* wrote a book.'),
(423, 1, 14, 'aggregateRating', 'aggregateRating', 'The overall rating, based on a collection of reviews or ratings, of the item.'),
(424, 1, 14, 'aircraft', 'aircraft', 'The kind of aircraft (e.g., \"Boeing 747\").'),
(425, 1, 14, 'albumProductionType', 'albumProductionType', 'Classification of the album by it\'s type of content: soundtrack, live album, studio album, etc.'),
(426, 1, 14, 'albumReleaseType', 'albumReleaseType', 'The kind of release which this album is: single, EP or album.'),
(427, 1, 14, 'albums', 'albums', 'A collection of music albums.'),
(428, 1, 14, 'alcoholWarning', 'alcoholWarning', 'Any precaution, guidance, contraindication, etc. related to consumption of alcohol while taking this drug.'),
(429, 1, 14, 'algorithm', 'algorithm', 'The algorithm or rules to follow to compute the score.'),
(430, 1, 14, 'alignmentType', 'alignmentType', 'A category of alignment between the learning resource and the framework node. Recommended values include: \'requires\', \'textComplexity\', \'readingLevel\', and \'educationalSubject\'.'),
(431, 1, 14, 'alternateName', 'alternateName', 'An alias for the item.'),
(432, 1, 14, 'alternativeHeadline', 'alternativeHeadline', 'A secondary title of the CreativeWork.'),
(433, 1, 14, 'amenityFeature', 'amenityFeature', 'An amenity feature (e.g. a characteristic or service) of the Accommodation. This generic property does not make a statement about whether the feature is included in an offer for the main accommodation or available at extra costs.'),
(434, 1, 14, 'amount', 'amount', 'The amount of money.'),
(435, 1, 14, 'amountOfThisGood', 'amountOfThisGood', 'The quantity of the goods included in the offer.'),
(436, 1, 14, 'announcementLocation', 'announcementLocation', 'Indicates a specific [[CivicStructure]] or [[LocalBusiness]] associated with the SpecialAnnouncement. For example, a specific testing facility or business with special opening hours. For a larger geographic region like a quarantine of an entire region, use [[spatialCoverage]].'),
(437, 1, 14, 'annualPercentageRate', 'annualPercentageRate', 'The annual rate that is charged for borrowing (or made by investing), expressed as a single percentage number that represents the actual yearly cost of funds over the term of a loan. This includes any fees or additional costs associated with the transaction.'),
(438, 1, 14, 'answerCount', 'answerCount', 'The number of answers this question has received.'),
(439, 1, 14, 'answerExplanation', 'answerExplanation', 'A step-by-step or full explanation about Answer. Can outline how this Answer was achieved or contain more broad clarification or statement about it. '),
(440, 1, 14, 'antagonist', 'antagonist', 'The muscle whose action counteracts the specified muscle.'),
(441, 1, 14, 'appearance', 'appearance', 'Indicates an occurence of a [[Claim]] in some [[CreativeWork]].'),
(442, 1, 14, 'applicableLocation', 'applicableLocation', 'The location in which the status applies.'),
(443, 1, 14, 'applicantLocationRequirements', 'applicantLocationRequirements', 'The location(s) applicants can apply from. This is usually used for telecommuting jobs where the applicant does not need to be in a physical office. Note: This should not be used for citizenship or work visa requirements.'),
(444, 1, 14, 'application', 'application', 'An application that can complete the request.'),
(445, 1, 14, 'applicationCategory', 'applicationCategory', 'Type of software application, e.g. \'Game, Multimedia\'.'),
(446, 1, 14, 'applicationContact', 'applicationContact', 'Contact details for further information relevant to this job posting.'),
(447, 1, 14, 'applicationDeadline', 'applicationDeadline', 'The date at which the program stops collecting applications for the next enrollment cycle.'),
(448, 1, 14, 'applicationStartDate', 'applicationStartDate', 'The date at which the program begins collecting applications for the next enrollment cycle.'),
(449, 1, 14, 'applicationSubCategory', 'applicationSubCategory', 'Subcategory of the application, e.g. \'Arcade Game\'.'),
(450, 1, 14, 'applicationSuite', 'applicationSuite', 'The name of the application suite to which the application belongs (e.g. Excel belongs to Office).'),
(451, 1, 14, 'appliesToDeliveryMethod', 'appliesToDeliveryMethod', 'The delivery method(s) to which the delivery charge or payment charge specification applies.'),
(452, 1, 14, 'appliesToPaymentMethod', 'appliesToPaymentMethod', 'The payment method(s) to which the payment charge specification applies.'),
(453, 1, 14, 'area', 'area', 'The area within which users can expect to reach the broadcast service.'),
(454, 1, 14, 'arrivalAirport', 'arrivalAirport', 'The airport where the flight terminates.'),
(455, 1, 14, 'arrivalBoatTerminal', 'arrivalBoatTerminal', 'The terminal or port from which the boat arrives.'),
(456, 1, 14, 'arrivalBusStop', 'arrivalBusStop', 'The stop or station from which the bus arrives.'),
(457, 1, 14, 'arrivalGate', 'arrivalGate', 'Identifier of the flight\'s arrival gate.'),
(458, 1, 14, 'arrivalPlatform', 'arrivalPlatform', 'The platform where the train arrives.'),
(459, 1, 14, 'arrivalStation', 'arrivalStation', 'The station where the train trip ends.'),
(460, 1, 14, 'arrivalTerminal', 'arrivalTerminal', 'Identifier of the flight\'s arrival terminal.'),
(461, 1, 14, 'arrivalTime', 'arrivalTime', 'The expected arrival time.'),
(462, 1, 14, 'artEdition', 'artEdition', 'The number of copies when multiple copies of a piece of artwork are produced - e.g. for a limited edition of 20 prints, \'artEdition\' refers to the total number of copies (in this example \"20\").'),
(463, 1, 14, 'artMedium', 'artMedium', 'The material used. (e.g. Oil, Watercolour, Acrylic, Linoprint, Marble, Cyanotype, Digital, Lithograph, DryPoint, Intaglio, Pastel, Woodcut, Pencil, Mixed Media, etc.)'),
(464, 1, 14, 'artform', 'artform', 'e.g. Painting, Drawing, Sculpture, Print, Photograph, Assemblage, Collage, etc.'),
(465, 1, 14, 'articleBody', 'articleBody', 'The actual body of the article.'),
(466, 1, 14, 'articleSection', 'articleSection', 'Articles may belong to one or more \'sections\' in a magazine or newspaper, such as Sports, Lifestyle, etc.'),
(467, 1, 14, 'artist', 'artist', 'The primary artist for a work\n    	in a medium other than pencils or digital line art--for example, if the\n    	primary artwork is done in watercolors or digital paints.'),
(468, 1, 14, 'aspect', 'aspect', 'An aspect of medical practice that is considered on the page, such as \'diagnosis\', \'treatment\', \'causes\', \'prognosis\', \'etiology\', \'epidemiology\', etc.'),
(469, 1, 14, 'assembly', 'assembly', 'Library file name e.g., mscorlib.dll, system.web.dll.'),
(470, 1, 14, 'assemblyVersion', 'assemblyVersion', 'Associated product/technology version. e.g., .NET Framework 4.5.'),
(471, 1, 14, 'assesses', 'assesses', 'The item being described is intended to assess the competency or learning outcome defined by the referenced term.'),
(472, 1, 14, 'associatedAnatomy', 'associatedAnatomy', 'The anatomy of the underlying organ system or structures associated with this entity.'),
(473, 1, 14, 'associatedArticle', 'associatedArticle', 'A NewsArticle associated with the Media Object.'),
(474, 1, 14, 'associatedMedia', 'associatedMedia', 'A media object that encodes this CreativeWork. This property is a synonym for encoding.'),
(475, 1, 14, 'associatedPathophysiology', 'associatedPathophysiology', 'If applicable, a description of the pathophysiology associated with the anatomical system, including potential abnormal changes in the mechanical, physical, and biochemical functions of the system.'),
(476, 1, 14, 'athlete', 'athlete', 'A person that acts as performing member of a sports team; a player as opposed to a coach.'),
(477, 1, 14, 'attendees', 'attendees', 'A person attending the event.'),
(478, 1, 14, 'audienceType', 'audienceType', 'The target group associated with a given audience (e.g. veterans, car owners, musicians, etc.).'),
(479, 1, 14, 'audio', 'audio', 'An embedded audio object.'),
(480, 1, 14, 'authenticator', 'authenticator', 'The Organization responsible for authenticating the user\'s subscription. For example, many media apps require a cable/satellite provider to authenticate your subscription before playing media.'),
(481, 1, 14, 'author', 'author', 'The author of this content or rating. Please note that author is special in that HTML 5 provides a special mechanism for indicating authorship via the rel tag. That is equivalent to this and may be used interchangeably.'),
(482, 1, 14, 'availability', 'availability', 'The availability of this item&#x2014;for example In stock, Out of stock, Pre-order, etc.'),
(483, 1, 14, 'availabilityEnds', 'availabilityEnds', 'The end of the availability of the product or service included in the offer.'),
(484, 1, 14, 'availabilityStarts', 'availabilityStarts', 'The beginning of the availability of the product or service included in the offer.'),
(485, 1, 14, 'availableAtOrFrom', 'availableAtOrFrom', 'The place(s) from which the offer can be obtained (e.g. store locations).'),
(486, 1, 14, 'availableChannel', 'availableChannel', 'A means of accessing the service (e.g. a phone bank, a web site, a location, etc.).'),
