(628, 1, 14, 'costPerUnit', 'costPerUnit', 'The cost per unit of the drug.'),
(629, 1, 14, 'countriesNotSupported', 'countriesNotSupported', 'Countries for which the application is not supported. You can also provide the two-letter ISO 3166-1 alpha-2 country code.'),
