(642, 1, 14, 'creditedTo', 'creditedTo', 'The group the release is credited to if different than the byArtist. For example, Red and Blue is credited to \"Stefani Germanotta Band\", but by Lady Gaga.'),
(643, 1, 14, 'cssSelector', 'cssSelector', 'A CSS selector, e.g. of a [[SpeakableSpecification]] or [[WebPageElement]]. In the latter case, multiple matches within a page can constitute a single conceptual \"Web page element\".'),
(644, 1, 14, 'currenciesAccepted', 'currenciesAccepted', 'The currency accepted.\\\n\\\nUse standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217) e.g. \"USD\"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies e.g. \"BTC\"; well known names for [Local Exchange Tradings Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types e.g. \"Ithaca HOUR\".'),
(645, 1, 14, 'currency', 'currency', 'The currency in which the monetary amount is expressed.\\\n\\\nUse standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217) e.g. \"USD\"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies e.g. \"BTC\"; well known names for [Local Exchange Tradings Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types e.g. \"Ithaca HOUR\".'),
(646, 1, 14, 'currentExchangeRate', 'currentExchangeRate', 'The current price of a currency.'),
(647, 1, 14, 'customer', 'customer', 'Party placing the order or paying the invoice.'),
(648, 1, 14, 'cutoffTime', 'cutoffTime', 'Order cutoff time allows merchants to describe the time after which they will no longer process orders received on that day. For orders processed after cutoff time, one day gets added to the delivery time estimate. This property is expected to be most typically used via the [[ShippingRateSettings]] publication pattern. The time is indicated using the ISO-8601 Time format, e.g. \"23:30:00-05:00\" would represent 6:30 pm Eastern Standard Time (EST) which is 5 hours behind Coordinated Universal Time (UTC).'),
(649, 1, 14, 'cvdCollectionDate', 'cvdCollectionDate', 'collectiondate - Date for which patient counts are reported.'),
(650, 1, 14, 'cvdFacilityCounty', 'cvdFacilityCounty', 'Name of the County of the NHSN facility that this data record applies to. Use [[cvdFacilityId]] to identify the facility. To provide other details, [[healthcareReportingData]] can be used on a [[Hospital]] entry.'),
(651, 1, 14, 'cvdFacilityId', 'cvdFacilityId', 'Identifier of the NHSN facility that this data record applies to. Use [[cvdFacilityCounty]] to indicate the county. To provide other details, [[healthcareReportingData]] can be used on a [[Hospital]] entry.'),
(652, 1, 14, 'cvdNumBeds', 'cvdNumBeds', 'numbeds - HOSPITAL INPATIENT BEDS: Inpatient beds, including all staffed, licensed, and overflow (surge) beds used for inpatients.'),
(653, 1, 14, 'cvdNumBedsOcc', 'cvdNumBedsOcc', 'numbedsocc - HOSPITAL INPATIENT BED OCCUPANCY: Total number of staffed inpatient beds that are occupied.'),
(654, 1, 14, 'cvdNumC19Died', 'cvdNumC19Died', 'numc19died - DEATHS: Patients with suspected or confirmed COVID-19 who died in the hospital, ED, or any overflow location.'),
(655, 1, 14, 'cvdNumC19HOPats', 'cvdNumC19HOPats', 'numc19hopats - HOSPITAL ONSET: Patients hospitalized in an NHSN inpatient care location with onset of suspected or confirmed COVID-19 14 or more days after hospitalization.'),
(656, 1, 14, 'cvdNumC19HospPats', 'cvdNumC19HospPats', 'numc19hosppats - HOSPITALIZED: Patients currently hospitalized in an inpatient care location who have suspected or confirmed COVID-19.'),
(657, 1, 14, 'cvdNumC19MechVentPats', 'cvdNumC19MechVentPats', 'numc19mechventpats - HOSPITALIZED and VENTILATED: Patients hospitalized in an NHSN inpatient care location who have suspected or confirmed COVID-19 and are on a mechanical ventilator.'),
(658, 1, 14, 'cvdNumC19OFMechVentPats', 'cvdNumC19OFMechVentPats', 'numc19ofmechventpats - ED/OVERFLOW and VENTILATED: Patients with suspected or confirmed COVID-19 who are in the ED or any overflow location awaiting an inpatient bed and on a mechanical ventilator.'),
(659, 1, 14, 'cvdNumC19OverflowPats', 'cvdNumC19OverflowPats', 'numc19overflowpats - ED/OVERFLOW: Patients with suspected or confirmed COVID-19 who are in the ED or any overflow location awaiting an inpatient bed.'),
(660, 1, 14, 'cvdNumICUBeds', 'cvdNumICUBeds', 'numicubeds - ICU BEDS: Total number of staffed inpatient intensive care unit (ICU) beds.'),
(661, 1, 14, 'cvdNumICUBedsOcc', 'cvdNumICUBedsOcc', 'numicubedsocc - ICU BED OCCUPANCY: Total number of staffed inpatient ICU beds that are occupied.'),
(662, 1, 14, 'cvdNumTotBeds', 'cvdNumTotBeds', 'numtotbeds - ALL HOSPITAL BEDS: Total number of all Inpatient and outpatient beds, including all staffed,ICU, licensed, and overflow (surge) beds used for inpatients or outpatients.'),
(663, 1, 14, 'cvdNumVent', 'cvdNumVent', 'numvent - MECHANICAL VENTILATORS: Total number of ventilators available.'),
(664, 1, 14, 'cvdNumVentUse', 'cvdNumVentUse', 'numventuse - MECHANICAL VENTILATORS IN USE: Total number of ventilators in use.'),
(665, 1, 14, 'dataFeedElement', 'dataFeedElement', 'An item within in a data feed. Data feeds may have many elements.'),
(666, 1, 14, 'datasetTimeInterval', 'datasetTimeInterval', 'The range of temporal applicability of a dataset, e.g. for a 2011 census dataset, the year 2011 (in ISO 8601 time interval format).'),
(667, 1, 14, 'dateDeleted', 'dateDeleted', 'The datetime the item was removed from the DataFeed.'),
(668, 1, 14, 'dateIssued', 'dateIssued', 'The date the ticket was issued.'),
(669, 1, 14, 'dateModified', 'dateModified', 'The date on which the CreativeWork was most recently modified or when the item\'s entry was modified within a DataFeed.'),
(670, 1, 14, 'datePosted', 'datePosted', 'Publication date of an online listing.'),
(671, 1, 14, 'datePublished', 'datePublished', 'Date of first broadcast/publication.'),
(672, 1, 14, 'dateRead', 'dateRead', 'The date/time at which the message has been read by the recipient if a single recipient exists.'),
(673, 1, 14, 'dateReceived', 'dateReceived', 'The date/time the message was received if a single recipient exists.'),
(674, 1, 14, 'dateSent', 'dateSent', 'The date/time at which the message was sent.'),
(675, 1, 14, 'dateVehicleFirstRegistered', 'dateVehicleFirstRegistered', 'The date of the first registration of the vehicle with the respective public authorities.'),
(676, 1, 14, 'dateline', 'dateline', 'A [dateline](https://en.wikipedia.org/wiki/Dateline) is a brief piece of text included in news articles that describes where and when the story was written or filed though the date is often omitted. Sometimes only a placename is provided.\n\nStructured representations of dateline-related information can also be expressed more explicitly using [[locationCreated]] (which represents where a work was created e.g. where a news report was written).  For location depicted or described in the content, use [[contentLocation]].\n\nDateline summaries are oriented more towards human readers than towards automated processing, and can vary substantially. Some examples: \"BEIRUT, Lebanon, June 2.\", \"Paris, France\", \"December 19, 2017 11:43AM Reporting from Washington\", \"Beijing/Moscow\", \"QUEZON CITY, Philippines\".\n      '),
(677, 1, 14, 'dayOfWeek', 'dayOfWeek', 'The day of the week for which these opening hours are valid.'),
(678, 1, 14, 'deathDate', 'deathDate', 'Date of death.'),
(679, 1, 14, 'deathPlace', 'deathPlace', 'The place where the person died.'),
(680, 1, 14, 'defaultValue', 'defaultValue', 'The default value of the input.  For properties that expect a literal, the default is a literal value, for properties that expect an object, it\'s an ID reference to one of the current values.'),
(681, 1, 14, 'deliveryAddress', 'deliveryAddress', 'Destination address.'),
(682, 1, 14, 'deliveryLeadTime', 'deliveryLeadTime', 'The typical delay between the receipt of the order and the goods either leaving the warehouse or being prepared for pickup, in case the delivery method is on site pickup.'),
(683, 1, 14, 'deliveryMethod', 'deliveryMethod', 'A sub property of instrument. The method of delivery.'),
(684, 1, 14, 'deliveryStatus', 'deliveryStatus', 'New entry added as the package passes through each leg of its journey (from shipment to final delivery).'),
(685, 1, 14, 'deliveryTime', 'deliveryTime', 'The total delay between the receipt of the order and the goods reaching the final customer.'),
(686, 1, 14, 'department', 'department', 'A relationship between an organization and a department of that organization, also described as an organization (allowing different urls, logos, opening hours). For example: a store with a pharmacy, or a bakery with a cafe.'),
(687, 1, 14, 'departureAirport', 'departureAirport', 'The airport where the flight originates.'),
(688, 1, 14, 'departureBoatTerminal', 'departureBoatTerminal', 'The terminal or port from which the boat departs.'),
(689, 1, 14, 'departureBusStop', 'departureBusStop', 'The stop or station from which the bus departs.'),
(690, 1, 14, 'departureGate', 'departureGate', 'Identifier of the flight\'s departure gate.'),
(691, 1, 14, 'departurePlatform', 'departurePlatform', 'The platform from which the train departs.'),
(692, 1, 14, 'departureStation', 'departureStation', 'The station from which the train departs.'),
(693, 1, 14, 'departureTerminal', 'departureTerminal', 'Identifier of the flight\'s departure terminal.'),
(694, 1, 14, 'departureTime', 'departureTime', 'The expected departure time.'),
(695, 1, 14, 'dependencies', 'dependencies', 'Prerequisites needed to fulfill steps in article.'),
(696, 1, 14, 'depth', 'depth', 'The depth of the item.'),
(697, 1, 14, 'device', 'device', 'Device required to run the application. Used in cases where a specific make/model is required to run the application.'),
(698, 1, 14, 'diagnosis', 'diagnosis', 'One or more alternative conditions considered in the differential diagnosis process as output of a diagnosis process.'),
(699, 1, 14, 'diagram', 'diagram', 'An image containing a diagram that illustrates the structure and/or its component substructures and/or connections with other structures.'),
(700, 1, 14, 'diet', 'diet', 'A sub property of instrument. The diet used in this action.'),
(701, 1, 14, 'dietFeatures', 'dietFeatures', 'Nutritional information specific to the dietary plan. May include dietary recommendations on what foods to avoid, what foods to consume, and specific alterations/deviations from the USDA or other regulatory body\'s approved dietary guidelines.'),
(702, 1, 14, 'differentialDiagnosis', 'differentialDiagnosis', 'One of a set of differential diagnoses for the condition. Specifically, a closely-related or competing diagnosis typically considered later in the cognitive process whereby this medical condition is distinguished from others most likely responsible for a similar collection of signs and symptoms to reach the most parsimonious diagnosis or diagnoses in a patient.'),
(703, 1, 14, 'directors', 'directors', 'A director of e.g. tv, radio, movie, video games etc. content. Directors can be associated with individual items or with a series, episode, clip.'),
(704, 1, 14, 'disambiguatingDescription', 'disambiguatingDescription', 'A sub property of description. A short description of the item used to disambiguate from other, similar items. Information from other properties (in particular, name) may be necessary for the description to be useful for disambiguation.'),
(705, 1, 14, 'discount', 'discount', 'Any discount applied (to an Order).'),
(706, 1, 14, 'discountCode', 'discountCode', 'Code used to redeem a discount.'),
(707, 1, 14, 'discountCurrency', 'discountCurrency', 'The currency of the discount.\\\n\\\nUse standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217) e.g. \"USD\"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies e.g. \"BTC\"; well known names for [Local Exchange Tradings Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types e.g. \"Ithaca HOUR\".'),
(708, 1, 14, 'discusses', 'discusses', 'Specifies the CreativeWork associated with the UserComment.');
INSERT INTO `property` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(709, 1, 14, 'discussionUrl', 'discussionUrl', 'A link to the page containing the comments of the CreativeWork.'),
(710, 1, 14, 'diseasePreventionInfo', 'diseasePreventionInfo', 'Information about disease prevention.'),
(711, 1, 14, 'diseaseSpreadStatistics', 'diseaseSpreadStatistics', 'Statistical information about the spread of a disease, either as [[WebContent]], or\n  described directly as a [[Dataset]], or the specific [[Observation]]s in the dataset. When a [[WebContent]] URL is\n  provided, the page indicated might also contain more such markup.'),
(712, 1, 14, 'dissolutionDate', 'dissolutionDate', 'The date that this organization was dissolved.'),
(713, 1, 14, 'distance', 'distance', 'The distance travelled, e.g. exercising or travelling.'),
(714, 1, 14, 'distinguishingSign', 'distinguishingSign', 'One of a set of signs and symptoms that can be used to distinguish this diagnosis from others in the differential diagnosis.'),
(715, 1, 14, 'distribution', 'distribution', 'A downloadable form of this dataset, at a specific location, in a specific format.'),
(716, 1, 14, 'diversityPolicy', 'diversityPolicy', 'Statement on diversity policy by an [[Organization]] e.g. a [[NewsMediaOrganization]]. For a [[NewsMediaOrganization]], a statement describing the newsroom’s diversity policy on both staffing and sources, typically providing staffing data.'),
(717, 1, 14, 'diversityStaffingReport', 'diversityStaffingReport', 'For an [[Organization]] (often but not necessarily a [[NewsMediaOrganization]]), a report on staffing diversity issues. In a news context this might be for example ASNE or RTDNA (US) reports, or self-reported.'),
(718, 1, 14, 'documentation', 'documentation', 'Further documentation describing the Web API in more detail.'),
(719, 1, 14, 'doesNotShip', 'doesNotShip', 'Indicates when shipping to a particular [[shippingDestination]] is not available.'),
(720, 1, 14, 'domainIncludes', 'domainIncludes', 'Relates a property to a class that is (one of) the type(s) the property is expected to be used on.'),
(721, 1, 14, 'domiciledMortgage', 'domiciledMortgage', 'Whether borrower is a resident of the jurisdiction where the property is located.'),
(722, 1, 14, 'doorTime', 'doorTime', 'The time admission will commence.'),
(723, 1, 14, 'dosageForm', 'dosageForm', 'A dosage form in which this drug/supplement is available, e.g. \'tablet\', \'suspension\', \'injection\'.'),
(724, 1, 14, 'doseSchedule', 'doseSchedule', 'A dosing schedule for the drug for a given population, either observed, recommended, or maximum dose based on the type used.'),
(725, 1, 14, 'doseUnit', 'doseUnit', 'The unit of the dose, e.g. \'mg\'.'),
(726, 1, 14, 'doseValue', 'doseValue', 'The value of the dose, e.g. 500.'),
(727, 1, 14, 'downPayment', 'downPayment', 'a type of payment made in cash during the onset of the purchase of an expensive good/service. The payment typically represents only a percentage of the full purchase price.'),
(728, 1, 14, 'downloadUrl', 'downloadUrl', 'If the file can be downloaded, URL to download the binary.'),
(729, 1, 14, 'downvoteCount', 'downvoteCount', 'The number of downvotes this question, answer or comment has received from the community.'),
(730, 1, 14, 'drainsTo', 'drainsTo', 'The vasculature that the vein drains into.'),
(731, 1, 14, 'driveWheelConfiguration', 'driveWheelConfiguration', 'The drive wheel configuration, i.e. which roadwheels will receive torque from the vehicle\'s engine via the drivetrain.'),
(732, 1, 14, 'dropoffLocation', 'dropoffLocation', 'Where a rental car can be dropped off.'),
(733, 1, 14, 'dropoffTime', 'dropoffTime', 'When a rental car can be dropped off.'),
(734, 1, 14, 'drug', 'drug', 'Specifying a drug or medicine used in a medication procedure'),
(735, 1, 14, 'drugClass', 'drugClass', 'The class of drug this belongs to (e.g., statins).'),
(736, 1, 14, 'drugUnit', 'drugUnit', 'The unit in which the drug is measured, e.g. \'5 mg tablet\'.'),
(737, 1, 14, 'duns', 'duns', 'The Dun & Bradstreet DUNS number for identifying an organization or business person.'),
(738, 1, 14, 'duplicateTherapy', 'duplicateTherapy', 'A therapy that duplicates or overlaps this one.'),
(739, 1, 14, 'durationOfWarranty', 'durationOfWarranty', 'The duration of the warranty promise. Common unitCode values are ANN for year, MON for months, or DAY for days.'),
(740, 1, 14, 'duringMedia', 'duringMedia', 'A media object representing the circumstances while performing this direction.'),
(741, 1, 14, 'earlyPrepaymentPenalty', 'earlyPrepaymentPenalty', 'The amount to be paid as a penalty in the event of early payment of the loan.'),
(742, 1, 14, 'editEIDR', 'editEIDR', 'An [EIDR](https://eidr.org/) (Entertainment Identifier Registry) [[identifier]] representing a specific edit / edition for a work of film or television.\n\nFor example, the motion picture known as \"Ghostbusters\" whose [[titleEIDR]] is \"10.5240/7EC7-228A-510A-053E-CBB8-J\", has several edits e.g. \"10.5240/1F2A-E1C5-680A-14C6-E76B-I\" and \"10.5240/8A35-3BEE-6497-5D12-9E4F-3\".\n\nSince schema.org types like [[Movie]] and [[TVEpisode]] can be used for both works and their multiple expressions, it is possible to use [[titleEIDR]] alone (for a general description), or alongside [[editEIDR]] for a more edit-specific description.\n'),
(743, 1, 14, 'editor', 'editor', 'Specifies the Person who edited the CreativeWork.'),
(744, 1, 14, 'eduQuestionType', 'eduQuestionType', 'For questions that are part of learning resources (e.g. Quiz), eduQuestionType indicates the format of question being given. Example: \"Multiple choice\", \"Open ended\", \"Flashcard\".'),
(745, 1, 14, 'educationRequirements', 'educationRequirements', 'Educational background needed for the position or Occupation.'),
(746, 1, 14, 'educationalAlignment', 'educationalAlignment', 'An alignment to an established educational framework.\n\nThis property should not be used where the nature of the alignment can be described using a simple property, for example to express that a resource [[teaches]] or [[assesses]] a competency.'),
(747, 1, 14, 'educationalCredentialAwarded', 'educationalCredentialAwarded', 'A description of the qualification, award, certificate, diploma or other educational credential awarded as a consequence of successful completion of this course or program.'),
(748, 1, 14, 'educationalFramework', 'educationalFramework', 'The framework to which the resource being described is aligned.'),
(749, 1, 14, 'educationalLevel', 'educationalLevel', 'The level in terms of progression through an educational or training context. Examples of educational levels include \'beginner\', \'intermediate\' or \'advanced\', and formal sets of level indicators.'),
(750, 1, 14, 'educationalProgramMode', 'educationalProgramMode', 'Similar to courseMode, The medium or means of delivery of the program as a whole. The value may either be a text label (e.g. \"online\", \"onsite\" or \"blended\"; \"synchronous\" or \"asynchronous\"; \"full-time\" or \"part-time\") or a URL reference to a term from a controlled vocabulary (e.g. https://ceds.ed.gov/element/001311#Asynchronous ).'),
(751, 1, 14, 'educationalRole', 'educationalRole', 'An educationalRole of an EducationalAudience.'),
(752, 1, 14, 'educationalUse', 'educationalUse', 'The purpose of a work in the context of education; for example, \'assignment\', \'group work\'.'),
(753, 1, 14, 'elevation', 'elevation', 'The elevation of a location ([WGS 84](https://en.wikipedia.org/wiki/World_Geodetic_System)). Values may be of the form \'NUMBER UNIT_OF_MEASUREMENT\' (e.g., \'1,000 m\', \'3,200 ft\') while numbers alone should be assumed to be a value in meters.'),
(754, 1, 14, 'eligibilityToWorkRequirement', 'eligibilityToWorkRequirement', 'The legal requirements such as citizenship, visa and other documentation required for an applicant to this job.'),
(755, 1, 14, 'eligibleCustomerType', 'eligibleCustomerType', 'The type(s) of customers for which the given offer is valid.'),
(756, 1, 14, 'eligibleDuration', 'eligibleDuration', 'The duration for which the given offer is valid.'),
(757, 1, 14, 'eligibleQuantity', 'eligibleQuantity', 'The interval and unit of measurement of ordering quantities for which the offer or price specification is valid. This allows e.g. specifying that a certain freight charge is valid only for a certain quantity.'),
(758, 1, 14, 'eligibleRegion', 'eligibleRegion', 'The ISO 3166-1 (ISO 3166-1 alpha-2) or ISO 3166-2 code, the place, or the GeoShape for the geo-political region(s) for which the offer or delivery charge specification is valid.\\\n\\\nSee also [[ineligibleRegion]].\n    '),
(759, 1, 14, 'eligibleTransactionVolume', 'eligibleTransactionVolume', 'The transaction volume, in a monetary unit, for which the offer or price specification is valid, e.g. for indicating a minimal purchasing volume, to express free shipping above a certain order volume, or to limit the acceptance of credit cards to purchases to a certain minimal amount.'),
(760, 1, 14, 'email', 'email', 'Email address.'),
(761, 1, 14, 'embedUrl', 'embedUrl', 'A URL pointing to a player for a specific video. In general, this is the information in the ```src``` element of an ```embed``` tag and should not be the same as the content of the ```loc``` tag.'),
(762, 1, 14, 'emissionsCO2', 'emissionsCO2', 'The CO2 emissions in g/km. When used in combination with a QuantitativeValue, put \"g/km\" into the unitText property of that value, since there is no UN/CEFACT Common Code for \"g/km\".'),
(763, 1, 14, 'employees', 'employees', 'People working for this organization.'),
(764, 1, 14, 'employerOverview', 'employerOverview', 'A description of the employer, career opportunities and work environment for this position.'),
(765, 1, 14, 'employmentType', 'employmentType', 'Type of employment (e.g. full-time, part-time, contract, temporary, seasonal, internship).'),
(766, 1, 14, 'employmentUnit', 'employmentUnit', 'Indicates the department, unit and/or facility where the employee reports and/or in which the job is to be performed.'),
(767, 1, 14, 'encodingType', 'encodingType', 'The supported encoding type(s) for an EntryPoint request.'),
(768, 1, 14, 'encodings', 'encodings', 'A media object that encodes this CreativeWork.'),
(769, 1, 14, 'endDate', 'endDate', 'The end date and time of the item (in [ISO 8601 date format](http://en.wikipedia.org/wiki/ISO_8601)).'),
(770, 1, 14, 'endOffset', 'endOffset', 'The end time of the clip expressed as the number of seconds from the beginning of the work.'),
(771, 1, 14, 'endTime', 'endTime', 'The endTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to end. For actions that span a period of time, when the action was performed. e.g. John wrote a book from January to *December*. For media, including audio and video, it\'s the time offset of the end of a clip within a larger file.\\\n\\\nNote that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.'),
(772, 1, 14, 'endorsee', 'endorsee', 'A sub property of participant. The person/organization being supported.'),
(773, 1, 14, 'endorsers', 'endorsers', 'People or organizations that endorse the plan.'),
(774, 1, 14, 'energyEfficiencyScaleMax', 'energyEfficiencyScaleMax', 'Specifies the most energy efficient class on the regulated EU energy consumption scale for the product category a product belongs to. For example, energy consumption for televisions placed on the market after January 1, 2020 is scaled from D to A+++.'),
(775, 1, 14, 'energyEfficiencyScaleMin', 'energyEfficiencyScaleMin', 'Specifies the least energy efficient class on the regulated EU energy consumption scale for the product category a product belongs to. For example, energy consumption for televisions placed on the market after January 1, 2020 is scaled from D to A+++.'),
(776, 1, 14, 'engineDisplacement', 'engineDisplacement', 'The volume swept by all of the pistons inside the cylinders of an internal combustion engine in a single movement. \\\n\\\nTypical unit code(s): CMQ for cubic centimeter, LTR for liters, INQ for cubic inches\\\n* Note 1: You can link to information about how the given value has been determined using the [[valueReference]] property.\\\n* Note 2: You can use [[minValue]] and [[maxValue]] to indicate ranges.'),
(777, 1, 14, 'enginePower', 'enginePower', 'The power of the vehicle\'s engine.\n    Typical unit code(s): KWT for kilowatt, BHP for brake horsepower, N12 for metric horsepower (PS, with 1 PS = 735,49875 W)\\\n\\\n* Note 1: There are many different ways of measuring an engine\'s power. For an overview, see  [http://en.wikipedia.org/wiki/Horsepower#Engine_power_test_codes](http://en.wikipedia.org/wiki/Horsepower#Engine_power_test_codes).\\\n* Note 2: You can link to information about how the given value has been determined using the [[valueReference]] property.\\\n* Note 3: You can use [[minValue]] and [[maxValue]] to indicate ranges.'),
(778, 1, 14, 'engineType', 'engineType', 'The type of engine or engines powering the vehicle.'),
(779, 1, 14, 'entertainmentBusiness', 'entertainmentBusiness', 'A sub property of location. The entertainment business where the action occurred.'),
(780, 1, 14, 'epidemiology', 'epidemiology', 'The characteristics of associated patients, such as age, gender, race etc.'),
(781, 1, 14, 'episodeNumber', 'episodeNumber', 'Position of the episode within an ordered group of episodes.'),
(782, 1, 14, 'episodes', 'episodes', 'An episode of a TV/radio series or season.'),
(783, 1, 14, 'equal', 'equal', 'This ordering relation for qualitative values indicates that the subject is equal to the object.'),
(784, 1, 14, 'error', 'error', 'For failed actions, more information on the cause of the failure.'),
(785, 1, 14, 'estimatedCost', 'estimatedCost', 'The estimated cost of the supply or supplies consumed when performing instructions.'),
(786, 1, 14, 'estimatedFlightDuration', 'estimatedFlightDuration', 'The estimated time the flight will take.'),
(787, 1, 14, 'estimatedSalary', 'estimatedSalary', 'An estimated salary for a job posting or occupation, based on a variety of variables including, but not limited to industry, job title, and location. Estimated salaries  are often computed by outside organizations rather than the hiring organization, who may not have committed to the estimated value.'),
(788, 1, 14, 'estimatesRiskOf', 'estimatesRiskOf', 'The condition, complication, or symptom whose risk is being estimated.'),
(789, 1, 14, 'ethicsPolicy', 'ethicsPolicy', 'Statement about ethics policy, e.g. of a [[NewsMediaOrganization]] regarding journalistic and publishing practices, or of a [[Restaurant]], a page describing food source policies. In the case of a [[NewsMediaOrganization]], an ethicsPolicy is typically a statement describing the personal, organizational, and corporate standards of behavior expected by the organization.'),
(790, 1, 14, 'eventAttendanceMode', 'eventAttendanceMode', 'The eventAttendanceMode of an event indicates whether it occurs online, offline, or a mix.'),
(791, 1, 14, 'eventSchedule', 'eventSchedule', 'Associates an [[Event]] with a [[Schedule]]. There are circumstances where it is preferable to share a schedule for a series of\n      repeating events rather than data on the individual events themselves. For example, a website or application might prefer to publish a schedule for a weekly\n      gym class rather than provide data on every event. A schedule could be processed by applications to add forthcoming events to a calendar. An [[Event]] that\n      is associated with a [[Schedule]] using this property should not have [[startDate]] or [[endDate]] properties. These are instead defined within the associated\n      [[Schedule]], this avoids any ambiguity for clients using the data. The property might have repeated values to specify different schedules, e.g. for different months\n      or seasons.'),
(792, 1, 14, 'eventStatus', 'eventStatus', 'An eventStatus of an event represents its status; particularly useful when an event is cancelled or rescheduled.'),
(793, 1, 14, 'events', 'events', 'Upcoming or past events associated with this place or organization.'),
(794, 1, 14, 'evidenceLevel', 'evidenceLevel', 'Strength of evidence of the data used to formulate the guideline (enumerated).'),
(795, 1, 14, 'evidenceOrigin', 'evidenceOrigin', 'Source of the data used to formulate the guidance, e.g. RCT, consensus opinion, etc.'),
(796, 1, 14, 'exceptDate', 'exceptDate', 'Defines a [[Date]] or [[DateTime]] during which a scheduled [[Event]] will not take place. The property allows exceptions to\n      a [[Schedule]] to be specified. If an exception is specified as a [[DateTime]] then only the event that would have started at that specific date and time\n      should be excluded from the schedule. If an exception is specified as a [[Date]] then any event that is scheduled for that 24 hour period should be\n      excluded from the schedule. This allows a whole day to be excluded from the schedule without having to itemise every scheduled event.'),
(797, 1, 14, 'exchangeRateSpread', 'exchangeRateSpread', 'The difference between the price at which a broker or other intermediary buys and sells foreign currency.'),
(798, 1, 14, 'exercisePlan', 'exercisePlan', 'A sub property of instrument. The exercise plan used on this action.'),
(799, 1, 14, 'exerciseRelatedDiet', 'exerciseRelatedDiet', 'A sub property of instrument. The diet used in this action.'),
(800, 1, 14, 'exerciseType', 'exerciseType', 'Type(s) of exercise or activity, such as strength training, flexibility training, aerobics, cardiac rehabilitation, etc.'),
(801, 1, 14, 'exifData', 'exifData', 'exif data for this object.'),
(802, 1, 14, 'expectedArrivalFrom', 'expectedArrivalFrom', 'The earliest date the package may arrive.'),
(803, 1, 14, 'expectedArrivalUntil', 'expectedArrivalUntil', 'The latest date the package may arrive.'),
(804, 1, 14, 'expectedPrognosis', 'expectedPrognosis', 'The likely outcome in either the short term or long term of the medical condition.'),
(805, 1, 14, 'expectsAcceptanceOf', 'expectsAcceptanceOf', 'An Offer which must be accepted before the user can perform the Action. For example, the user may need to buy a movie before being able to watch it.'),
(806, 1, 14, 'experienceRequirements', 'experienceRequirements', 'Description of skills and experience needed for the position or Occupation.'),
(807, 1, 14, 'expertConsiderations', 'expertConsiderations', 'Medical expert advice related to the plan.'),
(808, 1, 14, 'expires', 'expires', 'Date the content expires and is no longer useful or available. For example a [[VideoObject]] or [[NewsArticle]] whose availability or relevance is time-limited, or a [[ClaimReview]] fact check whose publisher wants to indicate that it may no longer be relevant (or helpful to highlight) after some date.'),
(809, 1, 14, 'familyName', 'familyName', 'Family name. In the U.S., the last name of a Person.'),
(810, 1, 14, 'fatContent', 'fatContent', 'The number of grams of fat.'),
(811, 1, 14, 'faxNumber', 'faxNumber', 'The fax number.'),
(812, 1, 14, 'featureList', 'featureList', 'Features or modules provided by this application (and possibly required by other applications).'),
(813, 1, 14, 'feesAndCommissionsSpecification', 'feesAndCommissionsSpecification', 'Description of fees, commissions, and other terms applied either to a class of financial product, or by a financial service organization.'),
(814, 1, 14, 'fiberContent', 'fiberContent', 'The number of grams of fiber.'),
(815, 1, 14, 'fileFormat', 'fileFormat', 'Media type, typically MIME format (see [IANA site](http://www.iana.org/assignments/media-types/media-types.xhtml)) of the content e.g. application/zip of a SoftwareApplication binary. In cases where a CreativeWork has several media type representations, \'encoding\' can be used to indicate each MediaObject alongside particular fileFormat information. Unregistered or niche file formats can be indicated instead via the most appropriate URL, e.g. defining Web page or a Wikipedia entry.'),
(816, 1, 14, 'fileSize', 'fileSize', 'Size of the application / package (e.g. 18MB). In the absence of a unit (MB, KB etc.), KB will be assumed.'),
(817, 1, 14, 'financialAidEligible', 'financialAidEligible', 'A financial aid type or program which students may use to pay for tuition or fees associated with the program.'),
(818, 1, 14, 'firstAppearance', 'firstAppearance', 'Indicates the first known occurence of a [[Claim]] in some [[CreativeWork]].'),
(819, 1, 14, 'firstPerformance', 'firstPerformance', 'The date and place the work was first performed.'),
(820, 1, 14, 'flightDistance', 'flightDistance', 'The distance of the flight.'),
(821, 1, 14, 'flightNumber', 'flightNumber', 'The unique identifier for a flight including the airline IATA code. For example, if describing United flight 110, where the IATA code for United is \'UA\', the flightNumber is \'UA110\'.'),
(822, 1, 14, 'floorLevel', 'floorLevel', 'The floor level for an [[Accommodation]] in a multi-storey building. Since counting\n  systems [vary internationally](https://en.wikipedia.org/wiki/Storey#Consecutive_number_floor_designations), the local system should be used where possible.'),
(823, 1, 14, 'floorLimit', 'floorLimit', 'A floor limit is the amount of money above which credit card transactions must be authorized.'),
(824, 1, 14, 'floorSize', 'floorSize', 'The size of the accommodation, e.g. in square meter or squarefoot.\nTypical unit code(s): MTK for square meter, FTK for square foot, or YDK for square yard '),
(825, 1, 14, 'followee', 'followee', 'A sub property of object. The person or organization being followed.'),
(826, 1, 14, 'follows', 'follows', 'The most generic uni-directional social relation.'),
(827, 1, 14, 'followup', 'followup', 'Typical or recommended followup care after the procedure is performed.'),
(828, 1, 14, 'foodEstablishment', 'foodEstablishment', 'A sub property of location. The specific food establishment where the action occurred.'),
(829, 1, 14, 'foodEvent', 'foodEvent', 'A sub property of location. The specific food event where the action occurred.'),
(830, 1, 14, 'foodWarning', 'foodWarning', 'Any precaution, guidance, contraindication, etc. related to consumption of specific foods while taking this drug.'),
(831, 1, 14, 'founders', 'founders', 'A person who founded this organization.'),
(832, 1, 14, 'foundingDate', 'foundingDate', 'The date that this organization was founded.'),
(833, 1, 14, 'foundingLocation', 'foundingLocation', 'The place where the Organization was founded.'),
(834, 1, 14, 'free', 'free', 'A flag to signal that the item, event, or place is accessible for free.'),
(835, 1, 14, 'freeShippingThreshold', 'freeShippingThreshold', 'A monetary value above which (or equal to) the shipping rate becomes free. Intended to be used via an [[OfferShippingDetails]] with [[shippingSettingsLink]] matching this [[ShippingRateSettings]].'),
(836, 1, 14, 'fromLocation', 'fromLocation', 'A sub property of location. The original location of the object or the agent before the action.'),
(837, 1, 14, 'fuelCapacity', 'fuelCapacity', 'The capacity of the fuel tank or in the case of electric cars, the battery. If there are multiple components for storage, this should indicate the total of all storage of the same type.\\\n\\\nTypical unit code(s): LTR for liters, GLL of US gallons, GLI for UK / imperial gallons, AMH for ampere-hours (for electrical vehicles).'),
(838, 1, 14, 'fuelConsumption', 'fuelConsumption', 'The amount of fuel consumed for traveling a particular distance or temporal duration with the given vehicle (e.g. liters per 100 km).\\\n\\\n* Note 1: There are unfortunately no standard unit codes for liters per 100 km.  Use [[unitText]] to indicate the unit of measurement, e.g. L/100 km.\\\n* Note 2: There are two ways of indicating the fuel consumption, [[fuelConsumption]] (e.g. 8 liters per 100 km) and [[fuelEfficiency]] (e.g. 30 miles per gallon). They are reciprocal.\\\n* Note 3: Often, the absolute value is useful only when related to driving speed (\"at 80 km/h\") or usage pattern (\"city traffic\"). You can use [[valueReference]] to link the value for the fuel consumption to another value.'),
(839, 1, 14, 'fuelEfficiency', 'fuelEfficiency', 'The distance traveled per unit of fuel used; most commonly miles per gallon (mpg) or kilometers per liter (km/L).\\\n\\\n* Note 1: There are unfortunately no standard unit codes for miles per gallon or kilometers per liter. Use [[unitText]] to indicate the unit of measurement, e.g. mpg or km/L.\\\n* Note 2: There are two ways of indicating the fuel consumption, [[fuelConsumption]] (e.g. 8 liters per 100 km) and [[fuelEfficiency]] (e.g. 30 miles per gallon). They are reciprocal.\\\n* Note 3: Often, the absolute value is useful only when related to driving speed (\"at 80 km/h\") or usage pattern (\"city traffic\"). You can use [[valueReference]] to link the value for the fuel economy to another value.'),
(840, 1, 14, 'fuelType', 'fuelType', 'The type of fuel suitable for the engine or engines of the vehicle. If the vehicle has only one engine, this property can be attached directly to the vehicle.'),
(841, 1, 14, 'functionalClass', 'functionalClass', 'The degree of mobility the joint allows.'),
(842, 1, 14, 'fundedItem', 'fundedItem', 'Indicates an item funded or sponsored through a [[Grant]].'),
(843, 1, 14, 'funder', 'funder', 'A person or organization that supports (sponsors) something through some kind of financial contribution.'),
(844, 1, 14, 'gameItem', 'gameItem', 'An item is an object within the game world that can be collected by a player or, occasionally, a non-player character.'),
(845, 1, 14, 'gameLocation', 'gameLocation', 'Real or fictional location of the game (or part of game).'),
(846, 1, 14, 'gamePlatform', 'gamePlatform', 'The electronic systems used to play <a href=\"http://en.wikipedia.org/wiki/Category:Video_game_platforms\">video games</a>.'),
(847, 1, 14, 'gameTip', 'gameTip', 'Links to tips, tactics, etc.'),
(848, 1, 14, 'gender', 'gender', 'Gender of something, typically a [[Person]], but possibly also fictional characters, animals, etc. While http://schema.org/Male and http://schema.org/Female may be used, text strings are also acceptable for people who do not identify as a binary gender. The [[gender]] property can also be used in an extended sense to cover e.g. the gender of sports teams. As with the gender of individuals, we do not try to enumerate all possibilities. A mixed-gender [[SportsTeam]] can be indicated with a text value of \"Mixed\".'),
(849, 1, 14, 'geo', 'geo', 'The geo coordinates of the place.'),
(850, 1, 14, 'geoContains', 'geoContains', 'Represents a relationship between two geometries (or the places they represent), relating a containing geometry to a contained geometry. \"a contains b iff no points of b lie in the exterior of a, and at least one point of the interior of b lies in the interior of a\". As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
(851, 1, 14, 'geoCoveredBy', 'geoCoveredBy', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to another that covers it. As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
(852, 1, 14, 'geoCovers', 'geoCovers', 'Represents a relationship between two geometries (or the places they represent), relating a covering geometry to a covered geometry. \"Every point of b is a point of (the interior or boundary of) a\". As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
(853, 1, 14, 'geoCrosses', 'geoCrosses', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to another that crosses it: \"a crosses b: they have some but not all interior points in common, and the dimension of the intersection is less than that of at least one of them\". As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
(854, 1, 14, 'geoDisjoint', 'geoDisjoint', 'Represents spatial relations in which two geometries (or the places they represent) are topologically disjoint: they have no point in common. They form a set of disconnected geometries.\" (a symmetric relationship, as defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM))'),
(855, 1, 14, 'geoEquals', 'geoEquals', 'Represents spatial relations in which two geometries (or the places they represent) are topologically equal, as defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM). \"Two geometries are topologically equal if their interiors intersect and no part of the interior or boundary of one geometry intersects the exterior of the other\" (a symmetric relationship)'),
(856, 1, 14, 'geoIntersects', 'geoIntersects', 'Represents spatial relations in which two geometries (or the places they represent) have at least one point in common. As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
(857, 1, 14, 'geoMidpoint', 'geoMidpoint', 'Indicates the GeoCoordinates at the centre of a GeoShape e.g. GeoCircle.'),
(858, 1, 14, 'geoOverlaps', 'geoOverlaps', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to another that geospatially overlaps it, i.e. they have some but not all points in common. As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
(859, 1, 14, 'geoRadius', 'geoRadius', 'Indicates the approximate radius of a GeoCircle (metres unless indicated otherwise via Distance notation).'),
(860, 1, 14, 'geoTouches', 'geoTouches', 'Represents spatial relations in which two geometries (or the places they represent) touch: they have at least one boundary point in common, but no interior points.\" (a symmetric relationship, as defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM) )'),
(861, 1, 14, 'geoWithin', 'geoWithin', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to one that contains it, i.e. it is inside (i.e. within) its interior. As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
(862, 1, 14, 'geographicArea', 'geographicArea', 'The geographic area associated with the audience.'),
(863, 1, 14, 'gettingTestedInfo', 'gettingTestedInfo', 'Information about getting tested (for a [[MedicalCondition]]), e.g. in the context of a pandemic.'),
(864, 1, 14, 'givenName', 'givenName', 'Given name. In the U.S., the first name of a Person.'),
(865, 1, 14, 'globalLocationNumber', 'globalLocationNumber', 'The [Global Location Number](http://www.gs1.org/gln) (GLN, sometimes also referred to as International Location Number or ILN) of the respective organization, person, or place. The GLN is a 13-digit number used to identify parties and physical locations.'),
(866, 1, 14, 'governmentBenefitsInfo', 'governmentBenefitsInfo', 'governmentBenefitsInfo provides information about government benefits associated with a SpecialAnnouncement.'),
(867, 1, 14, 'gracePeriod', 'gracePeriod', 'The period of time after any due date that the borrower has to fulfil its obligations before a default (failure to pay) is deemed to have occurred.'),
(868, 1, 14, 'grantee', 'grantee', 'The person, organization, contact point, or audience that has been granted this permission.'),
(869, 1, 14, 'greater', 'greater', 'This ordering relation for qualitative values indicates that the subject is greater than the object.'),
(870, 1, 14, 'greaterOrEqual', 'greaterOrEqual', 'This ordering relation for qualitative values indicates that the subject is greater than or equal to the object.'),
(871, 1, 14, 'gtin12', 'gtin12', 'The GTIN-12 code of the product, or the product to which the offer refers. The GTIN-12 is the 12-digit GS1 Identification Key composed of a U.P.C. Company Prefix, Item Reference, and Check Digit used to identify trade items. See [GS1 GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) for more details.'),
(872, 1, 14, 'gtin13', 'gtin13', 'The GTIN-13 code of the product, or the product to which the offer refers. This is equivalent to 13-digit ISBN codes and EAN UCC-13. Former 12-digit UPC codes can be converted into a GTIN-13 code by simply adding a preceding zero. See [GS1 GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) for more details.'),
(873, 1, 14, 'gtin14', 'gtin14', 'The GTIN-14 code of the product, or the product to which the offer refers. See [GS1 GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) for more details.'),
(874, 1, 14, 'gtin8', 'gtin8', 'The [GTIN-8](http://apps.gs1.org/GDD/glossary/Pages/GTIN-8.aspx) code of the product, or the product to which the offer refers. This code is also known as EAN/UCC-8 or 8-digit EAN. See [GS1 GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) for more details.'),
(875, 1, 14, 'guideline', 'guideline', 'A medical guideline related to this entity.'),
(876, 1, 14, 'guidelineDate', 'guidelineDate', 'Date on which this guideline\'s recommendation was made.'),
(877, 1, 14, 'guidelineSubject', 'guidelineSubject', 'The medical conditions, treatments, etc. that are the subject of the guideline.'),
(878, 1, 14, 'handlingTime', 'handlingTime', 'The typical delay between the receipt of the order and the goods either leaving the warehouse or being prepared for pickup, in case the delivery method is on site pickup. Typical properties: minValue, maxValue, unitCode (d for DAY).  This is by common convention assumed to mean business days (if a unitCode is used, coded as \"d\"), i.e. only counting days when the business normally operates.'),
(879, 1, 14, 'hasCategoryCode', 'hasCategoryCode', 'A Category code contained in this code set.'),
(880, 1, 14, 'hasCourse', 'hasCourse', 'A course or class that is one of the learning opportunities that constitute an educational / occupational program. No information is implied about whether the course is mandatory or optional; no guarantee is implied about whether the course will be available to everyone on the program.'),
(881, 1, 14, 'hasCourseInstance', 'hasCourseInstance', 'An offering of the course at a specific time and place or through specific media or mode of study or to a specific section of students.'),
(882, 1, 14, 'hasCredential', 'hasCredential', 'A credential awarded to the Person or Organization.'),
(883, 1, 14, 'hasDeliveryMethod', 'hasDeliveryMethod', 'Method used for delivery or shipping.'),
(884, 1, 14, 'hasDigitalDocumentPermission', 'hasDigitalDocumentPermission', 'A permission related to the access to this document (e.g. permission to read or write an electronic document). For a public document, specify a grantee with an Audience with audienceType equal to \"public\".'),
(885, 1, 14, 'hasDriveThroughService', 'hasDriveThroughService', 'Indicates whether some facility (e.g. [[FoodEstablishment]], [[CovidTestingFacility]]) offers a service that can be used by driving through in a car. In the case of [[CovidTestingFacility]] such facilities could potentially help with social distancing from other potentially-infected users.'),
(886, 1, 14, 'hasEnergyConsumptionDetails', 'hasEnergyConsumptionDetails', 'Defines the energy efficiency Category (also known as \"class\" or \"rating\") for a product according to an international energy efficiency standard'),
(887, 1, 14, 'hasEnergyEfficiencyCategory', 'hasEnergyEfficiencyCategory', 'Defines the energy efficiency Category (which could be either a rating out of range of values or a yes/no certification) for a product according to an international energy efficiency standard'),
(888, 1, 14, 'hasHealthAspect', 'hasHealthAspect', 'Indicates the aspect or aspects specifically addressed in some [[HealthTopicContent]]. For example, that the content is an overview, or that it talks about treatment, self-care, treatments or their side-effects.'),
(889, 1, 14, 'hasMenuItem', 'hasMenuItem', 'A food or drink item contained in a menu or menu section.'),
(890, 1, 14, 'hasMenuSection', 'hasMenuSection', 'A subgrouping of the menu (by dishes, course, serving time period, etc.).'),
(891, 1, 14, 'hasMerchantReturnPolicy', 'hasMerchantReturnPolicy', 'Indicates a MerchantReturnPolicy that may be applicable.'),
(892, 1, 14, 'hasOccupation', 'hasOccupation', 'The Person\'s occupation. For past professions, use Role for expressing dates.'),
(893, 1, 14, 'hasOfferCatalog', 'hasOfferCatalog', 'Indicates an OfferCatalog listing for this Organization, Person, or Service.'),
(894, 1, 14, 'hasPOS', 'hasPOS', 'Points-of-Sales operated by the organization or person.'),
(895, 1, 14, 'headline', 'headline', 'Headline of the article.'),
(896, 1, 14, 'healthCondition', 'healthCondition', 'Specifying the health condition(s) of a patient, medical study, or other target audience.'),
(897, 1, 14, 'healthPlanCoinsuranceOption', 'healthPlanCoinsuranceOption', 'Whether the coinsurance applies before or after deductible, etc. TODO: Is this a closed set?'),
(898, 1, 14, 'healthPlanCoinsuranceRate', 'healthPlanCoinsuranceRate', 'Whether The rate of coinsurance expressed as a number between 0.0 and 1.0.'),
(899, 1, 14, 'healthPlanCopay', 'healthPlanCopay', 'Whether The copay amount.'),
(900, 1, 14, 'healthPlanCopayOption', 'healthPlanCopayOption', 'Whether the copay is before or after deductible, etc. TODO: Is this a closed set?'),
(901, 1, 14, 'healthPlanCostSharing', 'healthPlanCostSharing', 'Whether The costs to the patient for services under this network or formulary.'),
(902, 1, 14, 'healthPlanDrugOption', 'healthPlanDrugOption', 'TODO.'),
(903, 1, 14, 'healthPlanDrugTier', 'healthPlanDrugTier', 'The tier(s) of drugs offered by this formulary or insurance plan.'),
(904, 1, 14, 'healthPlanId', 'healthPlanId', 'The 14-character, HIOS-generated Plan ID number. (Plan IDs must be unique, even across different markets.)'),
(905, 1, 14, 'healthPlanMarketingUrl', 'healthPlanMarketingUrl', 'The URL that goes directly to the plan brochure for the specific standard plan or plan variation.'),
(906, 1, 14, 'healthPlanNetworkId', 'healthPlanNetworkId', 'Name or unique ID of network. (Networks are often reused across different insurance plans).'),
(907, 1, 14, 'healthPlanNetworkTier', 'healthPlanNetworkTier', 'The tier(s) for this network.'),
(908, 1, 14, 'healthPlanPharmacyCategory', 'healthPlanPharmacyCategory', 'The category or type of pharmacy associated with this cost sharing.'),
(909, 1, 14, 'healthcareReportingData', 'healthcareReportingData', 'Indicates data describing a hospital, e.g. a CDC [[CDCPMDRecord]] or as some kind of [[Dataset]].'),
(910, 1, 14, 'height', 'height', 'The height of the item.'),
(911, 1, 14, 'highPrice', 'highPrice', 'The highest price of all offers available.\\\n\\\nUsage guidelines:\\\n\\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.\\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
(912, 1, 14, 'hiringOrganization', 'hiringOrganization', 'Organization offering the job position.'),
(913, 1, 14, 'homeLocation', 'homeLocation', 'A contact location for a person\'s residence.'),
(914, 1, 14, 'homeTeam', 'homeTeam', 'The home team in a sports event.'),
(915, 1, 14, 'honorificPrefix', 'honorificPrefix', 'An honorific prefix preceding a Person\'s name such as Dr/Mrs/Mr.'),
(916, 1, 14, 'honorificSuffix', 'honorificSuffix', 'An honorific suffix following a Person\'s name such as M.D. /PhD/MSCSW.'),
(917, 1, 14, 'hospitalAffiliation', 'hospitalAffiliation', 'A hospital with which the physician or office is affiliated.'),
(918, 1, 14, 'hostingOrganization', 'hostingOrganization', 'The organization (airline, travelers\' club, etc.) the membership is made with.'),
(919, 1, 14, 'hoursAvailable', 'hoursAvailable', 'The hours during which this service or contact is available.'),
(920, 1, 14, 'howPerformed', 'howPerformed', 'How the procedure is performed.'),
(921, 1, 14, 'httpMethod', 'httpMethod', 'An HTTP method that specifies the appropriate HTTP method for a request to an HTTP EntryPoint. Values are capitalized strings as used in HTTP.'),
(922, 1, 14, 'iataCode', 'iataCode', 'IATA identifier for an airline or airport.'),
(923, 1, 14, 'icaoCode', 'icaoCode', 'ICAO identifier for an airport.'),
(924, 1, 14, 'identifyingExam', 'identifyingExam', 'A physical examination that can identify this sign.'),
(925, 1, 14, 'identifyingTest', 'identifyingTest', 'A diagnostic test that can identify this sign.'),
(926, 1, 14, 'illustrator', 'illustrator', 'The illustrator of the book.'),
(927, 1, 14, 'imagingTechnique', 'imagingTechnique', 'Imaging technique used.'),
(928, 1, 14, 'inAlbum', 'inAlbum', 'The album to which this recording belongs.'),
(929, 1, 14, 'inBroadcastLineup', 'inBroadcastLineup', 'The CableOrSatelliteService offering the channel.'),
(930, 1, 14, 'inCodeSet', 'inCodeSet', 'A [[CategoryCodeSet]] that contains this category code.'),
(931, 1, 14, 'inPlaylist', 'inPlaylist', 'The playlist to which this recording belongs.'),
(932, 1, 14, 'inProductGroupWithID', 'inProductGroupWithID', 'Indicates the [[productGroupID]] for a [[ProductGroup]] that this product [[isVariantOf]]. '),
(933, 1, 14, 'inStoreReturnsOffered', 'inStoreReturnsOffered', 'Are in-store returns offered?'),
(934, 1, 14, 'inSupportOf', 'inSupportOf', 'Qualification, candidature, degree, application that Thesis supports.'),
(935, 1, 14, 'incentives', 'incentives', 'Description of bonus and commission compensation aspects of the job.'),
(936, 1, 14, 'includedComposition', 'includedComposition', 'Smaller compositions included in this work (e.g. a movement in a symphony).'),
(937, 1, 14, 'includedDataCatalog', 'includedDataCatalog', 'A data catalog which contains this dataset (this property was previously \'catalog\', preferred name is now \'includedInDataCatalog\').'),
(938, 1, 14, 'includedInHealthInsurancePlan', 'includedInHealthInsurancePlan', 'The insurance plans that cover this drug.'),
(939, 1, 14, 'includedRiskFactor', 'includedRiskFactor', 'A modifiable or non-modifiable risk factor included in the calculation, e.g. age, coexisting condition.'),
(940, 1, 14, 'includesAttraction', 'includesAttraction', 'Attraction located at destination.'),
(941, 1, 14, 'includesHealthPlanFormulary', 'includesHealthPlanFormulary', 'Formularies covered by this plan.'),
(942, 1, 14, 'includesHealthPlanNetwork', 'includesHealthPlanNetwork', 'Networks covered by this plan.'),
(943, 1, 14, 'includesObject', 'includesObject', 'This links to a node or nodes indicating the exact quantity of the products included in  an [[Offer]] or [[ProductCollection]].'),
(944, 1, 14, 'increasesRiskOf', 'increasesRiskOf', 'The condition, complication, etc. influenced by this factor.'),
(945, 1, 14, 'industry', 'industry', 'The industry associated with the job position.'),
(946, 1, 14, 'ineligibleRegion', 'ineligibleRegion', 'The ISO 3166-1 (ISO 3166-1 alpha-2) or ISO 3166-2 code, the place, or the GeoShape for the geo-political region(s) for which the offer or delivery charge specification is not valid, e.g. a region where the transaction is not allowed.\\\n\\\nSee also [[eligibleRegion]].\n      '),
(947, 1, 14, 'infectiousAgent', 'infectiousAgent', 'The actual infectious agent, such as a specific bacterium.'),
(948, 1, 14, 'infectiousAgentClass', 'infectiousAgentClass', 'The class of infectious agent (bacteria, prion, etc.) that causes the disease.'),
(949, 1, 14, 'ingredients', 'ingredients', 'A single ingredient used in the recipe, e.g. sugar, flour or garlic.'),
(950, 1, 14, 'inker', 'inker', 'The individual who traces over the pencil drawings in ink after pencils are complete.'),
(951, 1, 14, 'insertion', 'insertion', 'The place of attachment of a muscle, or what the muscle moves.'),
(952, 1, 14, 'installUrl', 'installUrl', 'URL at which the app may be installed, if different from the URL of the item.'),
(953, 1, 14, 'instructor', 'instructor', 'A person assigned to instruct or provide instructional assistance for the [[CourseInstance]].'),
(954, 1, 14, 'intensity', 'intensity', 'Quantitative measure gauging the degree of force involved in the exercise, for example, heartbeats per minute. May include the velocity of the movement.'),
(955, 1, 14, 'interactingDrug', 'interactingDrug', 'Another drug that is known to interact with this drug in a way that impacts the effect of this drug or causes a risk to the patient. Note: disease interactions are typically captured as contraindications.'),
(956, 1, 14, 'interactionCount', 'interactionCount', 'This property is deprecated, alongside the UserInteraction types on which it depended.'),
(957, 1, 14, 'interactionService', 'interactionService', 'The WebSite or SoftwareApplication where the interactions took place.'),
(958, 1, 14, 'interactionType', 'interactionType', 'The Action representing the type of interaction. For up votes, +1s, etc. use [[LikeAction]]. For down votes use [[DislikeAction]]. Otherwise, use the most specific Action.'),
(959, 1, 14, 'interactivityType', 'interactivityType', 'The predominant mode of learning supported by the learning resource. Acceptable values are \'active\', \'expositive\', or \'mixed\'.'),
(960, 1, 14, 'interestRate', 'interestRate', 'The interest rate, charged or paid, applicable to the financial product. Note: This is different from the calculated annualPercentageRate.'),
(961, 1, 14, 'inventoryLevel', 'inventoryLevel', 'The current approximate inventory level for the item or items.'),
(962, 1, 14, 'inverseOf', 'inverseOf', 'Relates a property to a property that is its inverse. Inverse properties relate the same pairs of items to each other, but in reversed direction. For example, the \'alumni\' and \'alumniOf\' properties are inverseOf each other. Some properties don\'t have explicit inverses; in these situations RDFa and JSON-LD syntax for reverse properties can be used.'),
(963, 1, 14, 'isAcceptingNewPatients', 'isAcceptingNewPatients', 'Whether the provider is accepting new patients.'),
(964, 1, 14, 'isAccessoryOrSparePartFor', 'isAccessoryOrSparePartFor', 'A pointer to another product (or multiple products) for which this product is an accessory or spare part.'),
(965, 1, 14, 'isAvailableGenerically', 'isAvailableGenerically', 'True if the drug is available in a generic form (regardless of name).'),
(966, 1, 14, 'isBasedOnUrl', 'isBasedOnUrl', 'A resource that was used in the creation of this resource. This term can be repeated for multiple sources. For example, http://example.com/great-multiplication-intro.html.'),
(967, 1, 14, 'isConsumableFor', 'isConsumableFor', 'A pointer to another product (or multiple products) for which this product is a consumable.'),
(968, 1, 14, 'isFamilyFriendly', 'isFamilyFriendly', 'Indicates whether this content is family friendly.'),
(969, 1, 14, 'isGift', 'isGift', 'Was the offer accepted as a gift for someone other than the buyer.'),
(970, 1, 14, 'isLiveBroadcast', 'isLiveBroadcast', 'True is the broadcast is of a live event.'),
(971, 1, 14, 'isPlanForApartment', 'isPlanForApartment', 'Indicates some accommodation that this floor plan describes.'),
(972, 1, 14, 'isProprietary', 'isProprietary', 'True if this item\'s name is a proprietary/brand name (vs. generic name).'),
(973, 1, 14, 'isRelatedTo', 'isRelatedTo', 'A pointer to another, somehow related product (or multiple products).'),
(974, 1, 14, 'isResizable', 'isResizable', 'Whether the 3DModel allows resizing. For example, room layout applications often do not allow 3DModel elements to be resized to reflect reality.'),
(975, 1, 14, 'isSimilarTo', 'isSimilarTo', 'A pointer to another, functionally similar product (or multiple products).'),
(976, 1, 14, 'isUnlabelledFallback', 'isUnlabelledFallback', 'This can be marked \'true\' to indicate that some published [[DeliveryTimeSettings]] or [[ShippingRateSettings]] are intended to apply to all [[OfferShippingDetails]] published by the same merchant, when referenced by a [[shippingSettingsLink]] in those settings. It is not meaningful to use a \'true\' value for this property alongside a transitTimeLabel (for [[DeliveryTimeSettings]]) or shippingLabel (for [[ShippingRateSettings]]), since this property is for use with unlabelled settings.'),
(977, 1, 14, 'isbn', 'isbn', 'The ISBN of the book.'),
(978, 1, 14, 'isicV4', 'isicV4', 'The International Standard of Industrial Classification of All Economic Activities (ISIC), Revision 4 code for a particular organization, business person, or place.'),
(979, 1, 14, 'isrcCode', 'isrcCode', 'The International Standard Recording Code for the recording.'),
(980, 1, 14, 'issn', 'issn', 'The International Standard Serial Number (ISSN) that identifies this serial publication. You can repeat this property to identify different formats of, or the linking ISSN (ISSN-L) for, this serial publication.'),
(981, 1, 14, 'issueNumber', 'issueNumber', 'Identifies the issue of publication; for example, \"iii\" or \"2\".'),
(982, 1, 14, 'issuedBy', 'issuedBy', 'The organization issuing the ticket or permit.'),
(983, 1, 14, 'issuedThrough', 'issuedThrough', 'The service through with the permit was granted.'),
(984, 1, 14, 'iswcCode', 'iswcCode', 'The International Standard Musical Work Code for the composition.'),
(985, 1, 14, 'item', 'item', 'An entity represented by an entry in a list or data feed (e.g. an \'artist\' in a list of \'artists\')’.'),
(986, 1, 14, 'itemCondition', 'itemCondition', 'A predefined value from OfferItemCondition or a textual description of the condition of the product or service, or the products or services included in the offer.');
INSERT INTO `property` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(987, 1, 14, 'itemListElement', 'itemListElement', 'For itemListElement values, you can use simple strings (e.g. \"Peter\", \"Paul\", \"Mary\"), existing entities, or use ListItem.\\\n\\\nText values are best if the elements in the list are plain strings. Existing entities are best for a simple, unordered list of existing things in your data. ListItem is used with ordered lists when you want to provide additional context about the element in that list or when the same item might be in different places in different lists.\\\n\\\nNote: The order of elements in your mark-up is not sufficient for indicating the order or elements.  Use ListItem with a \'position\' property in such cases.'),
(988, 1, 14, 'itemListOrder', 'itemListOrder', 'Type of ordering (e.g. Ascending, Descending, Unordered).'),
(989, 1, 14, 'itemLocation', 'itemLocation', 'Current location of the item.'),
(990, 1, 14, 'itemReviewed', 'itemReviewed', 'The item that is being reviewed/rated.'),
(991, 1, 14, 'itemShipped', 'itemShipped', 'Item(s) being shipped.'),
(992, 1, 14, 'itinerary', 'itinerary', 'Destination(s) ( [[Place]] ) that make up a trip. For a trip where destination order is important use [[ItemList]] to specify that order (see examples).'),
(993, 1, 14, 'jobImmediateStart', 'jobImmediateStart', 'An indicator as to whether a position is available for an immediate start.'),
(994, 1, 14, 'jobLocation', 'jobLocation', 'A (typically single) geographic location associated with the job position.'),
(995, 1, 14, 'jobLocationType', 'jobLocationType', 'A description of the job location (e.g TELECOMMUTE for telecommute jobs).'),
(996, 1, 14, 'jobStartDate', 'jobStartDate', 'The date on which a successful applicant for this job would be expected to start work. Choose a specific date in the future or use the jobImmediateStart property to indicate the position is to be filled as soon as possible.'),
(997, 1, 14, 'jobTitle', 'jobTitle', 'The job title of the person (for example, Financial Manager).'),
(998, 1, 14, 'keywords', 'keywords', 'Keywords or tags used to describe this content. Multiple entries in a keywords list are typically delimited by commas.'),
(999, 1, 14, 'knownVehicleDamages', 'knownVehicleDamages', 'A textual description of known damages, both repaired and unrepaired.'),
(1000, 1, 14, 'knows', 'knows', 'The most generic bi-directional social/work relation.'),
(1001, 1, 14, 'knowsAbout', 'knowsAbout', 'Of a [[Person]], and less typically of an [[Organization]], to indicate a topic that is known about - suggesting possible expertise but not implying it. We do not distinguish skill levels here, or relate this to educational content, events, objectives or [[JobPosting]] descriptions.'),
(1002, 1, 14, 'knowsLanguage', 'knowsLanguage', 'Of a [[Person]], and less typically of an [[Organization]], to indicate a known language. We do not distinguish skill levels or reading/writing/speaking/signing here. Use language codes from the [IETF BCP 47 standard](http://tools.ietf.org/html/bcp47).'),
(1003, 1, 14, 'labelDetails', 'labelDetails', 'Link to the drug\'s label details.'),
(1004, 1, 14, 'landlord', 'landlord', 'A sub property of participant. The owner of the real estate property.'),
(1005, 1, 14, 'language', 'language', 'A sub property of instrument. The language used on this action.'),
(1006, 1, 14, 'lastReviewed', 'lastReviewed', 'Date on which the content on this web page was last reviewed for accuracy and/or completeness.'),
(1007, 1, 14, 'latitude', 'latitude', 'The latitude of a location. For example ```37.42242``` ([WGS 84](https://en.wikipedia.org/wiki/World_Geodetic_System)).'),
(1008, 1, 14, 'layoutImage', 'layoutImage', 'A schematic image showing the floorplan layout.'),
(1009, 1, 14, 'learningResourceType', 'learningResourceType', 'The predominant type or kind characterizing the learning resource. For example, \'presentation\', \'handout\'.'),
(1010, 1, 14, 'leaseLength', 'leaseLength', 'Length of the lease for some [[Accommodation]], either particular to some [[Offer]] or in some cases intrinsic to the property.'),
(1011, 1, 14, 'legalName', 'legalName', 'The official name of the organization, e.g. the registered company name.'),
(1012, 1, 14, 'legalStatus', 'legalStatus', 'The drug or supplement\'s legal status, including any controlled substance schedules that apply.'),
(1013, 1, 14, 'legislationChanges', 'legislationChanges', 'Another legislation that this legislation changes. This encompasses the notions of amendment, replacement, correction, repeal, or other types of change. This may be a direct change (textual or non-textual amendment) or a consequential or indirect change. The property is to be used to express the existence of a change relationship between two acts rather than the existence of a consolidated version of the text that shows the result of the change. For consolidation relationships, use the <a href=\"/legislationConsolidates\">legislationConsolidates</a> property.'),
(1014, 1, 14, 'legislationConsolidates', 'legislationConsolidates', 'Indicates another legislation taken into account in this consolidated legislation (which is usually the product of an editorial process that revises the legislation). This property should be used multiple times to refer to both the original version or the previous consolidated version, and to the legislations making the change.'),
(1015, 1, 14, 'legislationDate', 'legislationDate', 'The date of adoption or signature of the legislation. This is the date at which the text is officially aknowledged to be a legislation, even though it might not even be published or in force.'),
(1016, 1, 14, 'legislationDateVersion', 'legislationDateVersion', 'The point-in-time at which the provided description of the legislation is valid (e.g. : when looking at the law on the 2016-04-07 (= dateVersion), I get the consolidation of 2015-04-12 of the \"National Insurance Contributions Act 2015\")'),
(1017, 1, 14, 'legislationIdentifier', 'legislationIdentifier', 'An identifier for the legislation. This can be either a string-based identifier, like the CELEX at EU level or the NOR in France, or a web-based, URL/URI identifier, like an ELI (European Legislation Identifier) or an URN-Lex.'),
(1018, 1, 14, 'legislationJurisdiction', 'legislationJurisdiction', 'The jurisdiction from which the legislation originates.'),
(1019, 1, 14, 'legislationLegalForce', 'legislationLegalForce', 'Whether the legislation is currently in force, not in force, or partially in force.'),
(1020, 1, 14, 'legislationLegalValue', 'legislationLegalValue', 'The legal value of this legislation file. The same legislation can be written in multiple files with different legal values. Typically a digitally signed PDF have a \"stronger\" legal value than the HTML file of the same act.'),
(1021, 1, 14, 'legislationPassedBy', 'legislationPassedBy', 'The person or organization that originally passed or made the law : typically parliament (for primary legislation) or government (for secondary legislation). This indicates the \"legal author\" of the law, as opposed to its physical author.'),
(1022, 1, 14, 'legislationResponsible', 'legislationResponsible', 'An individual or organization that has some kind of responsibility for the legislation. Typically the ministry who is/was in charge of elaborating the legislation, or the adressee for potential questions about the legislation once it is published.'),
(1023, 1, 14, 'legislationTransposes', 'legislationTransposes', 'Indicates that this legislation (or part of legislation) fulfills the objectives set by another legislation, by passing appropriate implementation measures. Typically, some legislations of European Union\'s member states or regions transpose European Directives. This indicates a legally binding link between the 2 legislations.'),
(1024, 1, 14, 'legislationType', 'legislationType', 'The type of the legislation. Examples of values are \"law\", \"act\", \"directive\", \"decree\", \"regulation\", \"statutory instrument\", \"loi organique\", \"règlement grand-ducal\", etc., depending on the country.'),
(1025, 1, 14, 'leiCode', 'leiCode', 'An organization identifier that uniquely identifies a legal entity as defined in ISO 17442.'),
(1026, 1, 14, 'lender', 'lender', 'A sub property of participant. The person that lends the object being borrowed.'),
(1027, 1, 14, 'lesser', 'lesser', 'This ordering relation for qualitative values indicates that the subject is lesser than the object.'),
(1028, 1, 14, 'lesserOrEqual', 'lesserOrEqual', 'This ordering relation for qualitative values indicates that the subject is lesser than or equal to the object.'),
(1029, 1, 14, 'letterer', 'letterer', 'The individual who adds lettering, including speech balloons and sound effects, to artwork.'),
(1030, 1, 14, 'license', 'license', 'A license document that applies to this content, typically indicated by URL.'),
(1031, 1, 14, 'line', 'line', 'A line is a point-to-point path consisting of two or more points. A line is expressed as a series of two or more point objects separated by space.'),
(1032, 1, 14, 'linkRelationship', 'linkRelationship', 'Indicates the relationship type of a Web link. '),
(1033, 1, 14, 'liveBlogUpdate', 'liveBlogUpdate', 'An update to the LiveBlog.'),
(1034, 1, 14, 'loanMortgageMandateAmount', 'loanMortgageMandateAmount', 'Amount of mortgage mandate that can be converted into a proper mortgage at a later stage.'),
(1035, 1, 14, 'loanPaymentAmount', 'loanPaymentAmount', 'The amount of money to pay in a single payment.'),
(1036, 1, 14, 'loanPaymentFrequency', 'loanPaymentFrequency', 'Frequency of payments due, i.e. number of months between payments. This is defined as a frequency, i.e. the reciprocal of a period of time.'),
(1037, 1, 14, 'loanRepaymentForm', 'loanRepaymentForm', 'A form of paying back money previously borrowed from a lender. Repayment usually takes the form of periodic payments that normally include part principal plus interest in each payment.'),
(1038, 1, 14, 'loanTerm', 'loanTerm', 'The duration of the loan or credit agreement.'),
(1039, 1, 14, 'loanType', 'loanType', 'The type of a loan or credit.'),
(1040, 1, 14, 'locationCreated', 'locationCreated', 'The location where the CreativeWork was created, which may not be the same as the location depicted in the CreativeWork.'),
(1041, 1, 14, 'lodgingUnitDescription', 'lodgingUnitDescription', 'A full description of the lodging unit.'),
(1042, 1, 14, 'lodgingUnitType', 'lodgingUnitType', 'Textual description of the unit type (including suite vs. room, size of bed, etc.).'),
(1043, 1, 14, 'logo', 'logo', 'An associated logo.'),
(1044, 1, 14, 'longitude', 'longitude', 'The longitude of a location. For example ```-122.08585``` ([WGS 84](https://en.wikipedia.org/wiki/World_Geodetic_System)).'),
(1045, 1, 14, 'loser', 'loser', 'A sub property of participant. The loser of the action.'),
(1046, 1, 14, 'lowPrice', 'lowPrice', 'The lowest price of all offers available.\\\n\\\nUsage guidelines:\\\n\\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.\\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
(1047, 1, 14, 'lyricist', 'lyricist', 'The person who wrote the words.'),
(1048, 1, 14, 'lyrics', 'lyrics', 'The words in the song.'),
(1049, 1, 14, 'maintainer', 'maintainer', 'A maintainer of a [[Dataset]], software package ([[SoftwareApplication]]), or other [[Project]]. A maintainer is a [[Person]] or [[Organization]] that manages contributions to, and/or publication of, some (typically complex) artifact. It is common for distributions of software and data to be based on \"upstream\" sources. When [[maintainer]] is applied to a specific version of something e.g. a particular version or packaging of a [[Dataset]], it is always  possible that the upstream source has a different maintainer. The [[isBasedOn]] property can be used to indicate such relationships between datasets to make the different maintenance roles clear. Similarly in the case of software, a package may have dedicated maintainers working on integration into software distributions such as Ubuntu, as well as upstream maintainers of the underlying work.\n      '),
(1050, 1, 14, 'manufacturer', 'manufacturer', 'The manufacturer of the product.'),
(1051, 1, 14, 'map', 'map', 'A URL to a map of the place.'),
(1052, 1, 14, 'mapType', 'mapType', 'Indicates the kind of Map, from the MapCategoryType Enumeration.'),
(1053, 1, 14, 'maps', 'maps', 'A URL to a map of the place.'),
(1054, 1, 14, 'marginOfError', 'marginOfError', 'A marginOfError for an [[Observation]].'),
(1055, 1, 14, 'masthead', 'masthead', 'For a [[NewsMediaOrganization]], a link to the masthead page or a page listing top editorial management.'),
(1056, 1, 14, 'materialExtent', 'materialExtent', 'The quantity of the materials being described or an expression of the physical space they occupy.'),
(1057, 1, 14, 'mathExpression', 'mathExpression', 'A mathematical expression (e.g. \'x^2-3x=0\') that may be solved for a specific variable, simplified, or transformed. This can take many formats, e.g. LaTeX, Ascii-Math, or math as you would write with a keyboard.'),
(1058, 1, 14, 'maxPrice', 'maxPrice', 'The highest price if the price is a range.'),
(1059, 1, 14, 'maxValue', 'maxValue', 'The upper value of some characteristic or property.'),
(1060, 1, 14, 'maximumAttendeeCapacity', 'maximumAttendeeCapacity', 'The total number of individuals that may attend an event or venue.'),
(1061, 1, 14, 'maximumEnrollment', 'maximumEnrollment', 'The maximum number of students who may be enrolled in the program.'),
(1062, 1, 14, 'maximumIntake', 'maximumIntake', 'Recommended intake of this supplement for a given population as defined by a specific recommending authority.'),
(1063, 1, 14, 'maximumPhysicalAttendeeCapacity', 'maximumPhysicalAttendeeCapacity', 'The maximum physical attendee capacity of an [[Event]] whose [[eventAttendanceMode]] is [[OfflineEventAttendanceMode]] (or the offline aspects, in the case of a [[MixedEventAttendanceMode]]). '),
(1064, 1, 14, 'maximumVirtualAttendeeCapacity', 'maximumVirtualAttendeeCapacity', 'The maximum physical attendee capacity of an [[Event]] whose [[eventAttendanceMode]] is [[OnlineEventAttendanceMode]] (or the online aspects, in the case of a [[MixedEventAttendanceMode]]). '),
(1065, 1, 14, 'mealService', 'mealService', 'Description of the meals that will be provided or available for purchase.'),
(1066, 1, 14, 'measuredProperty', 'measuredProperty', 'The measuredProperty of an [[Observation]], either a schema.org property, a property from other RDF-compatible systems e.g. W3C RDF Data Cube, or schema.org extensions such as [GS1\'s](https://www.gs1.org/voc/?show=properties).'),
(1067, 1, 14, 'measuredValue', 'measuredValue', 'The measuredValue of an [[Observation]].'),
(1068, 1, 14, 'measurementTechnique', 'measurementTechnique', 'A technique or technology used in a [[Dataset]] (or [[DataDownload]], [[DataCatalog]]),\ncorresponding to the method used for measuring the corresponding variable(s) (described using [[variableMeasured]]). This is oriented towards scientific and scholarly dataset publication but may have broader applicability; it is not intended as a full representation of measurement, but rather as a high level summary for dataset discovery.\n\nFor example, if [[variableMeasured]] is: molecule concentration, [[measurementTechnique]] could be: \"mass spectrometry\" or \"nmr spectroscopy\" or \"colorimetry\" or \"immunofluorescence\".\n\nIf the [[variableMeasured]] is \"depression rating\", the [[measurementTechnique]] could be \"Zung Scale\" or \"HAM-D\" or \"Beck Depression Inventory\".\n\nIf there are several [[variableMeasured]] properties recorded for some given data object, use a [[PropertyValue]] for each [[variableMeasured]] and attach the corresponding [[measurementTechnique]].\n      '),
(1069, 1, 14, 'mechanismOfAction', 'mechanismOfAction', 'The specific biochemical interaction through which this drug or supplement produces its pharmacological effect.'),
(1070, 1, 14, 'mediaAuthenticityCategory', 'mediaAuthenticityCategory', 'Indicates a MediaManipulationRatingEnumeration classification of a media object (in the context of how it was published or shared).'),
(1071, 1, 14, 'median', 'median', 'The median value.'),
(1072, 1, 14, 'medicalAudience', 'medicalAudience', 'Medical audience for page.'),
(1073, 1, 14, 'medicalSpecialty', 'medicalSpecialty', 'A medical specialty of the provider.'),
(1074, 1, 14, 'medicineSystem', 'medicineSystem', 'The system of medicine that includes this MedicalEntity, for example \'evidence-based\', \'homeopathic\', \'chiropractic\', etc.'),
(1075, 1, 14, 'meetsEmissionStandard', 'meetsEmissionStandard', 'Indicates that the vehicle meets the respective emission standard.'),
(1076, 1, 14, 'members', 'members', 'A member of this organization.'),
(1077, 1, 14, 'membershipNumber', 'membershipNumber', 'A unique identifier for the membership.'),
(1078, 1, 14, 'membershipPointsEarned', 'membershipPointsEarned', 'The number of membership points earned by the member. If necessary, the unitText can be used to express the units the points are issued in. (e.g. stars, miles, etc.)'),
(1079, 1, 14, 'memoryRequirements', 'memoryRequirements', 'Minimum memory requirements.'),
(1080, 1, 14, 'mentions', 'mentions', 'Indicates that the CreativeWork contains a reference to, but is not necessarily about a concept.'),
(1081, 1, 14, 'menu', 'menu', 'Either the actual menu as a structured representation, as text, or a URL of the menu.'),
(1082, 1, 14, 'menuAddOn', 'menuAddOn', 'Additional menu item(s) such as a side dish of salad or side order of fries that can be added to this menu item. Additionally it can be a menu section containing allowed add-on menu items for this menu item.'),
(1083, 1, 14, 'merchant', 'merchant', '\'merchant\' is an out-dated term for \'seller\'.'),
(1084, 1, 14, 'merchantReturnDays', 'merchantReturnDays', 'The merchantReturnDays property indicates the number of days (from purchase) within which relevant merchant return policy is applicable.'),
(1085, 1, 14, 'merchantReturnLink', 'merchantReturnLink', 'Indicates a Web page or service by URL, for product return.'),
(1086, 1, 14, 'messageAttachment', 'messageAttachment', 'A CreativeWork attached to the message.'),
(1087, 1, 14, 'mileageFromOdometer', 'mileageFromOdometer', 'The total distance travelled by the particular vehicle since its initial production, as read from its odometer.\\\n\\\nTypical unit code(s): KMT for kilometers, SMI for statute miles'),
(1088, 1, 14, 'minPrice', 'minPrice', 'The lowest price if the price is a range.'),
(1089, 1, 14, 'minValue', 'minValue', 'The lower value of some characteristic or property.'),
(1090, 1, 14, 'minimumPaymentDue', 'minimumPaymentDue', 'The minimum payment required at this time.'),
(1091, 1, 14, 'missionCoveragePrioritiesPolicy', 'missionCoveragePrioritiesPolicy', 'For a [[NewsMediaOrganization]], a statement on coverage priorities, including any public agenda or stance on issues.'),
(1092, 1, 14, 'model', 'model', 'The model of the product. Use with the URL of a ProductModel or a textual representation of the model identifier. The URL of the ProductModel can be from an external source. It is recommended to additionally provide strong product identifiers via the gtin8/gtin13/gtin14 and mpn properties.'),
(1093, 1, 14, 'modelDate', 'modelDate', 'The release date of a vehicle model (often used to differentiate versions of the same make and model).'),
(1094, 1, 14, 'modifiedTime', 'modifiedTime', 'The date and time the reservation was modified.'),
(1095, 1, 14, 'monthlyMinimumRepaymentAmount', 'monthlyMinimumRepaymentAmount', 'The minimum payment is the lowest amount of money that one is required to pay on a credit card statement each month.'),
(1096, 1, 14, 'mpn', 'mpn', 'The Manufacturer Part Number (MPN) of the product, or the product to which the offer refers.'),
(1097, 1, 14, 'multipleValues', 'multipleValues', 'Whether multiple values are allowed for the property.  Default is false.'),
(1098, 1, 14, 'muscleAction', 'muscleAction', 'The movement the muscle generates.'),
(1099, 1, 14, 'musicArrangement', 'musicArrangement', 'An arrangement derived from the composition.'),
(1100, 1, 14, 'musicBy', 'musicBy', 'The composer of the soundtrack.'),
(1101, 1, 14, 'musicCompositionForm', 'musicCompositionForm', 'The type of composition (e.g. overture, sonata, symphony, etc.).'),
(1102, 1, 14, 'musicGroupMember', 'musicGroupMember', 'A member of a music group&#x2014;for example, John, Paul, George, or Ringo.'),
(1103, 1, 14, 'musicReleaseFormat', 'musicReleaseFormat', 'Format of this release (the type of recording media used, ie. compact disc, digital media, LP, etc.).'),
(1104, 1, 14, 'musicalKey', 'musicalKey', 'The key, mode, or scale this composition uses.'),
(1105, 1, 14, 'naics', 'naics', 'The North American Industry Classification System (NAICS) code for a particular organization or business person.'),
(1106, 1, 14, 'name', 'name', 'The name of the item.'),
(1107, 1, 14, 'namedPosition', 'namedPosition', 'A position played, performed or filled by a person or organization, as part of an organization. For example, an athlete in a SportsTeam might play in the position named \'Quarterback\'.'),
(1108, 1, 14, 'nationality', 'nationality', 'Nationality of the person.'),
(1109, 1, 14, 'naturalProgression', 'naturalProgression', 'The expected progression of the condition if it is not treated and allowed to progress naturally.'),
(1110, 1, 14, 'nerve', 'nerve', 'The underlying innervation associated with the muscle.'),
(1111, 1, 14, 'nerveMotor', 'nerveMotor', 'The neurological pathway extension that involves muscle control.'),
(1112, 1, 14, 'netWorth', 'netWorth', 'The total financial value of the person as calculated by subtracting assets from liabilities.'),
(1113, 1, 14, 'newsUpdatesAndGuidelines', 'newsUpdatesAndGuidelines', 'Indicates a page with news updates and guidelines. This could often be (but is not required to be) the main page containing [[SpecialAnnouncement]] markup on a site.'),
(1114, 1, 14, 'nextItem', 'nextItem', 'A link to the ListItem that follows the current one.'),
(1115, 1, 14, 'noBylinesPolicy', 'noBylinesPolicy', 'For a [[NewsMediaOrganization]] or other news-related [[Organization]], a statement explaining when authors of articles are not named in bylines.'),
(1116, 1, 14, 'nonEqual', 'nonEqual', 'This ordering relation for qualitative values indicates that the subject is not equal to the object.'),
(1117, 1, 14, 'nonProprietaryName', 'nonProprietaryName', 'The generic name of this drug or supplement.'),
(1118, 1, 14, 'nonprofitStatus', 'nonprofitStatus', 'nonprofit Status indicates the legal status of a non-profit organization in its primary place of business.'),
(1119, 1, 14, 'normalRange', 'normalRange', 'Range of acceptable values for a typical patient, when applicable.'),
(1120, 1, 14, 'nsn', 'nsn', 'Indicates the [NATO stock number](https://en.wikipedia.org/wiki/NATO_Stock_Number) (nsn) of a [[Product]]. '),
(1121, 1, 14, 'numAdults', 'numAdults', 'The number of adults staying in the unit.'),
(1122, 1, 14, 'numChildren', 'numChildren', 'The number of children staying in the unit.'),
(1123, 1, 14, 'numConstraints', 'numConstraints', 'Indicates the number of constraints (not counting [[populationType]]) defined for a particular [[StatisticalPopulation]]. This helps applications understand if they have access to a sufficiently complete description of a [[StatisticalPopulation]].'),
(1124, 1, 14, 'numTracks', 'numTracks', 'The number of tracks in this album or playlist.'),
(1125, 1, 14, 'numberOfAccommodationUnits', 'numberOfAccommodationUnits', 'Indicates the total (available plus unavailable) number of accommodation units in an [[ApartmentComplex]], or the number of accommodation units for a specific [[FloorPlan]] (within its specific [[ApartmentComplex]]). See also [[numberOfAvailableAccommodationUnits]].'),
(1126, 1, 14, 'numberOfAirbags', 'numberOfAirbags', 'The number or type of airbags in the vehicle.'),
(1127, 1, 14, 'numberOfAvailableAccommodationUnits', 'numberOfAvailableAccommodationUnits', 'Indicates the number of available accommodation units in an [[ApartmentComplex]], or the number of accommodation units for a specific [[FloorPlan]] (within its specific [[ApartmentComplex]]). See also [[numberOfAccommodationUnits]].'),
(1128, 1, 14, 'numberOfAxles', 'numberOfAxles', 'The number of axles.\\\n\\\nTypical unit code(s): C62'),
(1129, 1, 14, 'numberOfBathroomsTotal', 'numberOfBathroomsTotal', 'The total integer number of bathrooms in a some [[Accommodation]], following real estate conventions as [documented in RESO](https://ddwiki.reso.org/display/DDW17/BathroomsTotalInteger+Field): \"The simple sum of the number of bathrooms. For example for a property with two Full Bathrooms and one Half Bathroom, the Bathrooms Total Integer will be 3.\". See also [[numberOfRooms]].'),
(1130, 1, 14, 'numberOfBedrooms', 'numberOfBedrooms', 'The total integer number of bedrooms in a some [[Accommodation]], [[ApartmentComplex]] or [[FloorPlan]].'),
(1131, 1, 14, 'numberOfBeds', 'numberOfBeds', 'The quantity of the given bed type available in the HotelRoom, Suite, House, or Apartment.'),
(1132, 1, 14, 'numberOfCredits', 'numberOfCredits', 'The number of credits or units awarded by a Course or required to complete an EducationalOccupationalProgram.'),
(1133, 1, 14, 'numberOfDoors', 'numberOfDoors', 'The number of doors.\\\n\\\nTypical unit code(s): C62'),
(1134, 1, 14, 'numberOfEmployees', 'numberOfEmployees', 'The number of employees in an organization e.g. business.'),
(1135, 1, 14, 'numberOfEpisodes', 'numberOfEpisodes', 'The number of episodes in this season or series.'),
(1136, 1, 14, 'numberOfForwardGears', 'numberOfForwardGears', 'The total number of forward gears available for the transmission system of the vehicle.\\\n\\\nTypical unit code(s): C62'),
(1137, 1, 14, 'numberOfFullBathrooms', 'numberOfFullBathrooms', 'Number of full bathrooms - The total number of full and ¾ bathrooms in an [[Accommodation]]. This corresponds to the [BathroomsFull field in RESO](https://ddwiki.reso.org/display/DDW17/BathroomsFull+Field).'),
(1138, 1, 14, 'numberOfItems', 'numberOfItems', 'The number of items in an ItemList. Note that some descriptions might not fully describe all items in a list (e.g., multi-page pagination); in such cases, the numberOfItems would be for the entire list.'),
(1139, 1, 14, 'numberOfLoanPayments', 'numberOfLoanPayments', 'The number of payments contractually required at origination to repay the loan. For monthly paying loans this is the number of months from the contractual first payment date to the maturity date.'),
(1140, 1, 14, 'numberOfPages', 'numberOfPages', 'The number of pages in the book.'),
(1141, 1, 14, 'numberOfPartialBathrooms', 'numberOfPartialBathrooms', 'Number of partial bathrooms - The total number of half and ¼ bathrooms in an [[Accommodation]]. This corresponds to the [BathroomsPartial field in RESO](https://ddwiki.reso.org/display/DDW17/BathroomsPartial+Field). '),
(1142, 1, 14, 'numberOfPlayers', 'numberOfPlayers', 'Indicate how many people can play this game (minimum, maximum, or range).'),
(1143, 1, 14, 'numberOfPreviousOwners', 'numberOfPreviousOwners', 'The number of owners of the vehicle, including the current one.\\\n\\\nTypical unit code(s): C62'),
(1144, 1, 14, 'numberOfRooms', 'numberOfRooms', 'The number of rooms (excluding bathrooms and closets) of the accommodation or lodging business.\nTypical unit code(s): ROM for room or C62 for no unit. The type of room can be put in the unitText property of the QuantitativeValue.'),
(1145, 1, 14, 'numberOfSeasons', 'numberOfSeasons', 'The number of seasons in this series.'),
(1146, 1, 14, 'numberedPosition', 'numberedPosition', 'A number associated with a role in an organization, for example, the number on an athlete\'s jersey.'),
(1147, 1, 14, 'nutrition', 'nutrition', 'Nutrition information about the recipe or menu item.'),
(1148, 1, 14, 'observationDate', 'observationDate', 'The observationDate of an [[Observation]].'),
(1149, 1, 14, 'observedNode', 'observedNode', 'The observedNode of an [[Observation]], often a [[StatisticalPopulation]].'),
(1150, 1, 14, 'occupancy', 'occupancy', 'The allowed total occupancy for the accommodation in persons (including infants etc). For individual accommodations, this is not necessarily the legal maximum but defines the permitted usage as per the contractual agreement (e.g. a double room used by a single person).\nTypical unit code(s): C62 for person'),
(1151, 1, 14, 'occupationLocation', 'occupationLocation', ' The region/country for which this occupational description is appropriate. Note that educational requirements and qualifications can vary between jurisdictions.'),
(1152, 1, 14, 'occupationalCategory', 'occupationalCategory', 'A category describing the job, preferably using a term from a taxonomy such as [BLS O*NET-SOC](http://www.onetcenter.org/taxonomy.html), [ISCO-08](https://www.ilo.org/public/english/bureau/stat/isco/isco08/) or similar, with the property repeated for each applicable value. Ideally the taxonomy should be identified, and both the textual label and formal code for the category should be provided.\\\n\nNote: for historical reasons, any textual label and formal code provided as a literal may be assumed to be from O*NET-SOC.'),
(1153, 1, 14, 'occupationalCredentialAwarded', 'occupationalCredentialAwarded', 'A description of the qualification, award, certificate, diploma or other occupational credential awarded as a consequence of successful completion of this course or program.'),
(1154, 1, 14, 'offerCount', 'offerCount', 'The number of offers for the product.'),
(1155, 1, 14, 'offersPrescriptionByMail', 'offersPrescriptionByMail', 'Whether prescriptions can be delivered by mail.'),
(1156, 1, 14, 'openingHours', 'openingHours', 'The general opening hours for a business. Opening hours can be specified as a weekly time range, starting with days, then times per day. Multiple days can be listed with commas \',\' separating each day. Day or time ranges are specified using a hyphen \'-\'.\\\n\\\n* Days are specified using the following two-letter combinations: ```Mo```, ```Tu```, ```We```, ```Th```, ```Fr```, ```Sa```, ```Su```.\\\n* Times are specified using 24:00 format. For example, 3pm is specified as ```15:00```, 10am as ```10:00```. \\\n* Here is an example: <code>&lt;time itemprop=\"openingHours\" datetime=&quot;Tu,Th 16:00-20:00&quot;&gt;Tuesdays and Thursdays 4-8pm&lt;/time&gt;</code>.\\\n* If a business is open 7 days a week, then it can be specified as <code>&lt;time itemprop=&quot;openingHours&quot; datetime=&quot;Mo-Su&quot;&gt;Monday through Sunday, all day&lt;/time&gt;</code>.'),
(1157, 1, 14, 'openingHoursSpecification', 'openingHoursSpecification', 'The opening hours of a certain place.'),
(1158, 1, 14, 'opens', 'opens', 'The opening hour of the place or service on the given day(s) of the week.'),
(1159, 1, 14, 'operatingSystem', 'operatingSystem', 'Operating systems supported (Windows 7, OSX 10.6, Android 1.6).'),
(1160, 1, 14, 'opponent', 'opponent', 'A sub property of participant. The opponent on this action.'),
(1161, 1, 14, 'option', 'option', 'A sub property of object. The options subject to this action.'),
(1162, 1, 14, 'orderDate', 'orderDate', 'Date order was placed.'),
(1163, 1, 14, 'orderDelivery', 'orderDelivery', 'The delivery of the parcel related to this order or order item.'),
(1164, 1, 14, 'orderItemNumber', 'orderItemNumber', 'The identifier of the order item.'),
(1165, 1, 14, 'orderItemStatus', 'orderItemStatus', 'The current status of the order item.'),
(1166, 1, 14, 'orderNumber', 'orderNumber', 'The identifier of the transaction.'),
(1167, 1, 14, 'orderQuantity', 'orderQuantity', 'The number of the item ordered. If the property is not set, assume the quantity is one.'),
(1168, 1, 14, 'orderStatus', 'orderStatus', 'The current status of the order.'),
(1169, 1, 14, 'orderedItem', 'orderedItem', 'The item ordered.'),
(1170, 1, 14, 'organizer', 'organizer', 'An organizer of an Event.'),
(1171, 1, 14, 'originAddress', 'originAddress', 'Shipper\'s address.'),
(1172, 1, 14, 'originatesFrom', 'originatesFrom', 'The vasculature the lymphatic structure originates, or afferents, from.'),
(1173, 1, 14, 'overdosage', 'overdosage', 'Any information related to overdose on a drug, including signs or symptoms, treatments, contact information for emergency response.'),
(1174, 1, 14, 'ownedFrom', 'ownedFrom', 'The date and time of obtaining the product.'),
(1175, 1, 14, 'ownedThrough', 'ownedThrough', 'The date and time of giving up ownership on the product.'),
(1176, 1, 14, 'ownershipFundingInfo', 'ownershipFundingInfo', 'For an [[Organization]] (often but not necessarily a [[NewsMediaOrganization]]), a description of organizational ownership structure; funding and grants. In a news/media setting, this is with particular reference to editorial independence.   Note that the [[funder]] is also available and can be used to make basic funder information machine-readable.'),
(1177, 1, 14, 'owns', 'owns', 'Products owned by the organization or person.'),
(1178, 1, 14, 'pageEnd', 'pageEnd', 'The page on which the work ends; for example \"138\" or \"xvi\".'),
(1179, 1, 14, 'pageStart', 'pageStart', 'The page on which the work starts; for example \"135\" or \"xiii\".'),
(1180, 1, 14, 'pagination', 'pagination', 'Any description of pages that is not separated into pageStart and pageEnd; for example, \"1-6, 9, 55\" or \"10-12, 46-49\".'),
(1181, 1, 14, 'parentItem', 'parentItem', 'The parent of a question, answer or item in general.'),
(1182, 1, 14, 'parentService', 'parentService', 'A broadcast service to which the broadcast service may belong to such as regional variations of a national channel.'),
(1183, 1, 14, 'parents', 'parents', 'A parents of the person.'),
(1184, 1, 14, 'partOfEpisode', 'partOfEpisode', 'The episode to which this clip belongs.'),
(1185, 1, 14, 'partOfInvoice', 'partOfInvoice', 'The order is being paid as part of the referenced Invoice.'),
(1186, 1, 14, 'partOfOrder', 'partOfOrder', 'The overall order the items in this delivery were included in.'),
(1187, 1, 14, 'partOfSeason', 'partOfSeason', 'The season to which this episode belongs.'),
(1188, 1, 14, 'partOfSystem', 'partOfSystem', 'The anatomical or organ system that this structure is part of.'),
(1189, 1, 14, 'partOfTVSeries', 'partOfTVSeries', 'The TV series to which this episode or season belongs.'),
(1190, 1, 14, 'partySize', 'partySize', 'Number of people the reservation should accommodate.'),
(1191, 1, 14, 'passengerPriorityStatus', 'passengerPriorityStatus', 'The priority status assigned to a passenger for security or boarding (e.g. FastTrack or Priority).'),
(1192, 1, 14, 'passengerSequenceNumber', 'passengerSequenceNumber', 'The passenger\'s sequence number as assigned by the airline.'),
(1193, 1, 14, 'pathophysiology', 'pathophysiology', 'Changes in the normal mechanical, physical, and biochemical functions that are associated with this activity or condition.'),
(1194, 1, 14, 'pattern', 'pattern', 'A pattern that something has, for example \'polka dot\', \'striped\', \'Canadian flag\'. Values are typically expressed as text, although links to controlled value schemes are also supported.'),
(1195, 1, 14, 'payload', 'payload', 'The permitted weight of passengers and cargo, EXCLUDING the weight of the empty vehicle.\\\n\\\nTypical unit code(s): KGM for kilogram, LBR for pound\\\n\\\n* Note 1: Many databases specify the permitted TOTAL weight instead, which is the sum of [[weight]] and [[payload]]\\\n* Note 2: You can indicate additional information in the [[name]] of the [[QuantitativeValue]] node.\\\n* Note 3: You may also link to a [[QualitativeValue]] node that provides additional information using [[valueReference]].\\\n* Note 4: Note that you can use [[minValue]] and [[maxValue]] to indicate ranges.'),
(1196, 1, 14, 'paymentAccepted', 'paymentAccepted', 'Cash, Credit Card, Cryptocurrency, Local Exchange Tradings System, etc.'),
(1197, 1, 14, 'paymentDue', 'paymentDue', 'The date that payment is due.'),
(1198, 1, 14, 'paymentMethod', 'paymentMethod', 'The name of the credit card or other method of payment for the order.'),
(1199, 1, 14, 'paymentMethodId', 'paymentMethodId', 'An identifier for the method of payment used (e.g. the last 4 digits of the credit card).'),
(1200, 1, 14, 'paymentStatus', 'paymentStatus', 'The status of payment; whether the invoice has been paid or not.'),
(1201, 1, 14, 'paymentUrl', 'paymentUrl', 'The URL for sending a payment.'),
(1202, 1, 14, 'penciler', 'penciler', 'The individual who draws the primary narrative artwork.'),
(1203, 1, 14, 'percentile10', 'percentile10', 'The 10th percentile value.'),
(1204, 1, 14, 'percentile25', 'percentile25', 'The 25th percentile value.'),
(1205, 1, 14, 'percentile75', 'percentile75', 'The 75th percentile value.'),
(1206, 1, 14, 'percentile90', 'percentile90', 'The 90th percentile value.'),
(1207, 1, 14, 'performerIn', 'performerIn', 'Event that this person is a performer or participant in.'),
(1208, 1, 14, 'performers', 'performers', 'The main performer or performers of the event&#x2014;for example, a presenter, musician, or actor.'),
(1209, 1, 14, 'permissionType', 'permissionType', 'The type of permission granted the person, organization, or audience.'),
(1210, 1, 14, 'permissions', 'permissions', 'Permission(s) required to run the app (for example, a mobile app may require full internet access or may run only on wifi).'),
(1211, 1, 14, 'permitAudience', 'permitAudience', 'The target audience for this permit.'),
(1212, 1, 14, 'permittedUsage', 'permittedUsage', 'Indications regarding the permitted usage of the accommodation.'),
(1213, 1, 14, 'petsAllowed', 'petsAllowed', 'Indicates whether pets are allowed to enter the accommodation or lodging business. More detailed information can be put in a text value.'),
(1214, 1, 14, 'phoneticText', 'phoneticText', 'Representation of a text [[textValue]] using the specified [[speechToTextMarkup]]. For example the city name of Houston in IPA: /ˈhjuːstən/.'),
(1215, 1, 14, 'photos', 'photos', 'Photographs of this place.'),
(1216, 1, 14, 'physicalRequirement', 'physicalRequirement', 'A description of the types of physical activity associated with the job. Defined terms such as those in O*net may be used, but note that there is no way to specify the level of ability as well as its nature when using a defined term.'),
(1217, 1, 14, 'physiologicalBenefits', 'physiologicalBenefits', 'Specific physiologic benefits associated to the plan.'),
(1218, 1, 14, 'pickupLocation', 'pickupLocation', 'Where a taxi will pick up a passenger or a rental car can be picked up.'),
(1219, 1, 14, 'pickupTime', 'pickupTime', 'When a taxi will pickup a passenger or a rental car can be picked up.'),
(1220, 1, 14, 'playMode', 'playMode', 'Indicates whether this game is multi-player, co-op or single-player.  The game can be marked as multi-player, co-op and single-player at the same time.'),
(1221, 1, 14, 'playerType', 'playerType', 'Player type required&#x2014;for example, Flash or Silverlight.'),
(1222, 1, 14, 'playersOnline', 'playersOnline', 'Number of players on the server.'),
(1223, 1, 14, 'polygon', 'polygon', 'A polygon is the area enclosed by a point-to-point path for which the starting and ending points are the same. A polygon is expressed as a series of four or more space delimited points where the first and final points are identical.'),
(1224, 1, 14, 'populationType', 'populationType', 'Indicates the populationType common to all members of a [[StatisticalPopulation]].'),
(1225, 1, 14, 'possibleComplication', 'possibleComplication', 'A possible unexpected and unfavorable evolution of a medical condition. Complications may include worsening of the signs or symptoms of the disease, extension of the condition to other organ systems, etc.'),
(1226, 1, 14, 'possibleTreatment', 'possibleTreatment', 'A possible treatment to address this condition, sign or symptom.'),
(1227, 1, 14, 'postOfficeBoxNumber', 'postOfficeBoxNumber', 'The post office box number for PO box addresses.'),
(1228, 1, 14, 'postOp', 'postOp', 'A description of the postoperative procedures, care, and/or followups for this device.'),
(1229, 1, 14, 'postalCode', 'postalCode', 'The postal code. For example, 94043.'),
(1230, 1, 14, 'postalCodeBegin', 'postalCodeBegin', 'First postal code in a range (included).'),
(1231, 1, 14, 'postalCodeEnd', 'postalCodeEnd', 'Last postal code in the range (included). Needs to be after [[postalCodeBegin]].'),
(1232, 1, 14, 'postalCodePrefix', 'postalCodePrefix', 'A defined range of postal codes indicated by a common textual prefix. Used for non-numeric systems such as UK.'),
(1233, 1, 14, 'postalCodeRange', 'postalCodeRange', 'A defined range of postal codes.'),
(1234, 1, 14, 'potentialAction', 'potentialAction', 'Indicates a potential Action, which describes an idealized action in which this thing would play an \'object\' role.'),
(1235, 1, 14, 'preOp', 'preOp', 'A description of the workup, testing, and other preparations required before implanting this device.'),
(1236, 1, 14, 'predecessorOf', 'predecessorOf', 'A pointer from a previous, often discontinued variant of the product to its newer variant.'),
(1237, 1, 14, 'pregnancyCategory', 'pregnancyCategory', 'Pregnancy category of this drug.'),
(1238, 1, 14, 'pregnancyWarning', 'pregnancyWarning', 'Any precaution, guidance, contraindication, etc. related to this drug\'s use during pregnancy.'),
(1239, 1, 14, 'prepTime', 'prepTime', 'The length of time it takes to prepare the items to be used in instructions or a direction, in [ISO 8601 duration format](http://en.wikipedia.org/wiki/ISO_8601).'),
(1240, 1, 14, 'preparation', 'preparation', 'Typical preparation that a patient must undergo before having the procedure performed.'),
(1241, 1, 14, 'prescribingInfo', 'prescribingInfo', 'Link to prescribing information for the drug.'),
(1242, 1, 14, 'prescriptionStatus', 'prescriptionStatus', 'Indicates the status of drug prescription eg. local catalogs classifications or whether the drug is available by prescription or over-the-counter, etc.'),
(1243, 1, 14, 'previousItem', 'previousItem', 'A link to the ListItem that preceeds the current one.'),
(1244, 1, 14, 'previousStartDate', 'previousStartDate', 'Used in conjunction with eventStatus for rescheduled or cancelled events. This property contains the previously scheduled start date. For rescheduled events, the startDate property should be used for the newly scheduled start date. In the (rare) case of an event that has been postponed and rescheduled multiple times, this field may be repeated.'),
(1245, 1, 14, 'price', 'price', 'The offer price of a product, or of a price component when attached to PriceSpecification and its subtypes.\\\n\\\nUsage guidelines:\\\n\\\n* Use the [[priceCurrency]] property (with standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217) e.g. \"USD\"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies e.g. \"BTC\"; well known names for [Local Exchange Tradings Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types e.g. \"Ithaca HOUR\") instead of including [ambiguous symbols](http://en.wikipedia.org/wiki/Dollar_sign#Currencies_that_use_the_dollar_or_peso_sign) such as \'$\' in the value.\\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.\\\n* Note that both [RDFa](http://www.w3.org/TR/xhtml-rdfa-primer/#using-the-content-attribute) and Microdata syntax allow the use of a \"content=\" attribute for publishing simple machine-readable values alongside more human-friendly formatting.\\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.\n      '),
(1246, 1, 14, 'priceComponent', 'priceComponent', 'This property links to all [[UnitPriceSpecification]] nodes that apply in parallel for the [[CompoundPriceSpecification]] node.'),
(1247, 1, 14, 'priceComponentType', 'priceComponentType', 'Identifies a price component (for example, a line item on an invoice), part of the total price for an offer.'),
(1248, 1, 14, 'priceCurrency', 'priceCurrency', 'The currency of the price, or a price component when attached to [[PriceSpecification]] and its subtypes.\\\n\\\nUse standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217) e.g. \"USD\"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies e.g. \"BTC\"; well known names for [Local Exchange Tradings Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types e.g. \"Ithaca HOUR\".'),
(1249, 1, 14, 'priceRange', 'priceRange', 'The price range of the business, for example ```$$$```.'),
(1250, 1, 14, 'priceSpecification', 'priceSpecification', 'One or more detailed price specifications, indicating the unit price and delivery or payment charges.'),
(1251, 1, 14, 'priceType', 'priceType', 'Defines the type of a price specified for an offered product, for example a list price, a (temporary) sale price or a manufacturer suggested retail price. If multiple prices are specified for an offer the [[priceType]] property can be used to identify the type of each such specified price. The value of priceType can be specified as a value from enumeration PriceTypeEnumeration or as a free form text string for price types that are not already predefined in PriceTypeEnumeration.'),
(1252, 1, 14, 'priceValidUntil', 'priceValidUntil', 'The date after which the price is no longer available.'),
(1253, 1, 14, 'primaryImageOfPage', 'primaryImageOfPage', 'Indicates the main image on the page.'),
(1254, 1, 14, 'primaryPrevention', 'primaryPrevention', 'A preventative therapy used to prevent an initial occurrence of the medical condition, such as vaccination.'),
(1255, 1, 14, 'printColumn', 'printColumn', 'The number of the column in which the NewsArticle appears in the print edition.'),
(1256, 1, 14, 'printEdition', 'printEdition', 'The edition of the print product in which the NewsArticle appears.'),
(1257, 1, 14, 'printPage', 'printPage', 'If this NewsArticle appears in print, this field indicates the name of the page on which the article is found. Please note that this field is intended for the exact page name (e.g. A5, B18).'),
(1258, 1, 14, 'printSection', 'printSection', 'If this NewsArticle appears in print, this field indicates the print section in which the article appeared.'),
(1259, 1, 14, 'procedure', 'procedure', 'A description of the procedure involved in setting up, using, and/or installing the device.'),
(1260, 1, 14, 'procedureType', 'procedureType', 'The type of procedure, for example Surgical, Noninvasive, or Percutaneous.'),
(1261, 1, 14, 'processingTime', 'processingTime', 'Estimated processing time for the service using this channel.'),
(1262, 1, 14, 'processorRequirements', 'processorRequirements', 'Processor architecture required to run the application (e.g. IA64).'),
(1263, 1, 14, 'producer', 'producer', 'The person or organization who produced the work (e.g. music album, movie, tv/radio series etc.).'),
(1264, 1, 14, 'produces', 'produces', 'The tangible thing generated by the service, e.g. a passport, permit, etc.'),
(1265, 1, 14, 'productGroupID', 'productGroupID', 'Indicates a textual identifier for a ProductGroup.'),
(1266, 1, 14, 'productID', 'productID', 'The product identifier, such as ISBN. For example: ``` meta itemprop=\"productID\" content=\"isbn:123-456-789\" ```.'),
(1267, 1, 14, 'productSupported', 'productSupported', 'The product or service this support contact point is related to (such as product support for a particular product line). This can be a specific product or product line (e.g. \"iPhone\") or a general category of products or services (e.g. \"smartphones\").'),
(1268, 1, 14, 'productionCompany', 'productionCompany', 'The production company or studio responsible for the item e.g. series, video game, episode etc.'),
(1269, 1, 14, 'productionDate', 'productionDate', 'The date of production of the item, e.g. vehicle.'),
(1270, 1, 14, 'proficiencyLevel', 'proficiencyLevel', 'Proficiency needed for this content; expected values: \'Beginner\', \'Expert\'.'),
(1271, 1, 14, 'programMembershipUsed', 'programMembershipUsed', 'Any membership in a frequent flyer, hotel loyalty program, etc. being applied to the reservation.'),
(1272, 1, 14, 'programName', 'programName', 'The program providing the membership.'),
(1273, 1, 14, 'programPrerequisites', 'programPrerequisites', 'Prerequisites for enrolling in the program.'),
(1274, 1, 14, 'programType', 'programType', 'The type of educational or occupational program. For example, classroom, internship, alternance, etc..'),
(1275, 1, 14, 'programmingLanguage', 'programmingLanguage', 'The computer programming language.'),
(1276, 1, 14, 'programmingModel', 'programmingModel', 'Indicates whether API is managed or unmanaged.'),
(1277, 1, 14, 'propertyID', 'propertyID', 'A commonly used identifier for the characteristic represented by the property, e.g. a manufacturer or a standard code for a property. propertyID can be\n(1) a prefixed string, mainly meant to be used with standards for product properties; (2) a site-specific, non-prefixed string (e.g. the primary key of the property or the vendor-specific id of the property), or (3)\na URL indicating the type of the property, either pointing to an external vocabulary, or a Web resource that describes the property (e.g. a glossary entry).\nStandards bodies should promote a standard prefix for the identifiers of properties from their standards.'),
(1278, 1, 14, 'proprietaryName', 'proprietaryName', 'Proprietary name given to the diet plan, typically by its originator or creator.'),
(1279, 1, 14, 'proteinContent', 'proteinContent', 'The number of grams of protein.');
INSERT INTO `property` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(1280, 1, 14, 'providerMobility', 'providerMobility', 'Indicates the mobility of a provided service (e.g. \'static\', \'dynamic\').'),
(1281, 1, 14, 'providesService', 'providesService', 'The service provided by this channel.'),
(1282, 1, 14, 'publicAccess', 'publicAccess', 'A flag to signal that the [[Place]] is open to public visitors.  If this property is omitted there is no assumed default boolean value'),
(1283, 1, 14, 'publicTransportClosuresInfo', 'publicTransportClosuresInfo', 'Information about public transport closures.'),
(1284, 1, 14, 'publication', 'publication', 'A publication event associated with the item.'),
(1285, 1, 14, 'publicationType', 'publicationType', 'The type of the medical article, taken from the US NLM MeSH publication type catalog. See also [MeSH documentation](http://www.nlm.nih.gov/mesh/pubtypes.html).'),
(1286, 1, 14, 'publishedBy', 'publishedBy', 'An agent associated with the publication event.'),
(1287, 1, 14, 'publishedOn', 'publishedOn', 'A broadcast service associated with the publication event.'),
(1288, 1, 14, 'publisher', 'publisher', 'The publisher of the creative work.'),
(1289, 1, 14, 'publisherImprint', 'publisherImprint', 'The publishing division which published the comic.'),
(1290, 1, 14, 'purchaseDate', 'purchaseDate', 'The date the item e.g. vehicle was purchased by the current owner.'),
(1291, 1, 14, 'qualifications', 'qualifications', 'Specific qualifications required for this role or Occupation.'),
(1292, 1, 14, 'quarantineGuidelines', 'quarantineGuidelines', 'Guidelines about quarantine rules, e.g. in the context of a pandemic.'),
(1293, 1, 14, 'query', 'query', 'A sub property of instrument. The query used on this action.'),
(1294, 1, 14, 'quest', 'quest', 'The task that a player-controlled character, or group of characters may complete in order to gain a reward.'),
(1295, 1, 14, 'question', 'question', 'A sub property of object. A question.'),
(1296, 1, 14, 'rangeIncludes', 'rangeIncludes', 'Relates a property to a class that constitutes (one of) the expected type(s) for values of the property.'),
(1297, 1, 14, 'ratingCount', 'ratingCount', 'The count of total number of ratings.'),
(1298, 1, 14, 'ratingExplanation', 'ratingExplanation', 'A short explanation (e.g. one to two sentences) providing background context and other information that led to the conclusion expressed in the rating. This is particularly applicable to ratings associated with \"fact check\" markup using [[ClaimReview]].'),
(1299, 1, 14, 'ratingValue', 'ratingValue', 'The rating for the content.\\\n\\\nUsage guidelines:\\\n\\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.\\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
(1300, 1, 14, 'readBy', 'readBy', 'A person who reads (performs) the audiobook.'),
(1301, 1, 14, 'readonlyValue', 'readonlyValue', 'Whether or not a property is mutable.  Default is false. Specifying this for a property that also has a value makes it act similar to a \"hidden\" input in an HTML form.'),
(1302, 1, 14, 'realEstateAgent', 'realEstateAgent', 'A sub property of participant. The real estate agent involved in the action.'),
(1303, 1, 14, 'recipe', 'recipe', 'A sub property of instrument. The recipe/instructions used to perform the action.'),
(1304, 1, 14, 'recipeCategory', 'recipeCategory', 'The category of the recipe—for example, appetizer, entree, etc.'),
(1305, 1, 14, 'recipeCuisine', 'recipeCuisine', 'The cuisine of the recipe (for example, French or Ethiopian).'),
(1306, 1, 14, 'recipeInstructions', 'recipeInstructions', 'A step in making the recipe, in the form of a single item (document, video, etc.) or an ordered list with HowToStep and/or HowToSection items.'),
(1307, 1, 14, 'recipeYield', 'recipeYield', 'The quantity produced by the recipe (for example, number of people served, number of servings, etc).'),
(1308, 1, 14, 'recognizedBy', 'recognizedBy', 'An organization that acknowledges the validity, value or utility of a credential. Note: recognition may include a process of quality assurance or accreditation.'),
(1309, 1, 14, 'recognizingAuthority', 'recognizingAuthority', 'If applicable, the organization that officially recognizes this entity as part of its endorsed system of medicine.'),
(1310, 1, 14, 'recommendationStrength', 'recommendationStrength', 'Strength of the guideline\'s recommendation (e.g. \'class I\').'),
(1311, 1, 14, 'recommendedIntake', 'recommendedIntake', 'Recommended intake of this supplement for a given population as defined by a specific recommending authority.'),
(1312, 1, 14, 'recordLabel', 'recordLabel', 'The label that issued the release.'),
(1313, 1, 14, 'recourseLoan', 'recourseLoan', 'The only way you get the money back in the event of default is the security. Recourse is where you still have the opportunity to go back to the borrower for the rest of the money.'),
(1314, 1, 14, 'referenceQuantity', 'referenceQuantity', 'The reference quantity for which a certain price applies, e.g. 1 EUR per 4 kWh of electricity. This property is a replacement for unitOfMeasurement for the advanced cases where the price does not relate to a standard unit.'),
(1315, 1, 14, 'referencesOrder', 'referencesOrder', 'The Order(s) related to this Invoice. One or more Orders may be combined into a single Invoice.'),
(1316, 1, 14, 'refundType', 'refundType', 'A refundType, from an enumerated list.'),
(1317, 1, 14, 'regionDrained', 'regionDrained', 'The anatomical or organ system drained by this vessel; generally refers to a specific part of an organ.'),
(1318, 1, 14, 'regionsAllowed', 'regionsAllowed', 'The regions where the media is allowed. If not specified, then it\'s assumed to be allowed everywhere. Specify the countries in [ISO 3166 format](http://en.wikipedia.org/wiki/ISO_3166).'),
(1319, 1, 14, 'relatedAnatomy', 'relatedAnatomy', 'Anatomical systems or structures that relate to the superficial anatomy.'),
(1320, 1, 14, 'relatedCondition', 'relatedCondition', 'A medical condition associated with this anatomy.'),
(1321, 1, 14, 'relatedDrug', 'relatedDrug', 'Any other drug related to this one, for example commonly-prescribed alternatives.'),
