(1505, 1, 14, 'timeOfDay', 'timeOfDay', 'The time of day the program normally runs. For example, \"evenings\".'),
(1506, 1, 14, 'timeRequired', 'timeRequired', 'Approximate or typical time it takes to work with or through this learning resource for the typical intended target audience, e.g. \'PT30M\', \'PT1H25M\'.'),
(1507, 1, 14, 'timeToComplete', 'timeToComplete', 'The expected length of time to complete the program if attending full-time.'),
(1508, 1, 14, 'tissueSample', 'tissueSample', 'The type of tissue sample required for the test.'),
(1509, 1, 14, 'title', 'title', 'The title of the job.'),
(1510, 1, 14, 'titleEIDR', 'titleEIDR', 'An [EIDR](https://eidr.org/) (Entertainment Identifier Registry) [[identifier]] representing at the most general/abstract level, a work of film or television.\n\nFor example, the motion picture known as \"Ghostbusters\" has a titleEIDR of  \"10.5240/7EC7-228A-510A-053E-CBB8-J\". This title (or work) may have several variants, which EIDR calls \"edits\". See [[editEIDR]].\n\nSince schema.org types like [[Movie]] and [[TVEpisode]] can be used for both works and their multiple expressions, it is possible to use [[titleEIDR]] alone (for a general description), or alongside [[editEIDR]] for a more edit-specific description.\n'),
(1511, 1, 14, 'toLocation', 'toLocation', 'A sub property of location. The final location of the object or the agent after the action.'),
(1512, 1, 14, 'toRecipient', 'toRecipient', 'A sub property of recipient. The recipient who was directly sent the message.'),
(1513, 1, 14, 'tocContinuation', 'tocContinuation', 'A [[HyperTocEntry]] can have a [[tocContinuation]] indicated, which is another [[HyperTocEntry]] that would be the default next item to play or render.'),
(1514, 1, 14, 'tocEntry', 'tocEntry', 'Indicates a [[HyperTocEntry]] in a [[HyperToc]].'),
(1515, 1, 14, 'tongueWeight', 'tongueWeight', 'The permitted vertical load (TWR) of a trailer attached to the vehicle. Also referred to as Tongue Load Rating (TLR) or Vertical Load Rating (VLR)\\\n\\\nTypical unit code(s): KGM for kilogram, LBR for pound\\\n\\\n* Note 1: You can indicate additional information in the [[name]] of the [[QuantitativeValue]] node.\\\n* Note 2: You may also link to a [[QualitativeValue]] node that provides additional information using [[valueReference]].\\\n* Note 3: Note that you can use [[minValue]] and [[maxValue]] to indicate ranges.'),
(1516, 1, 14, 'tool', 'tool', 'A sub property of instrument. An object used (but not consumed) when performing instructions or a direction.'),
(1517, 1, 14, 'torque', 'torque', 'The torque (turning force) of the vehicle\'s engine.\\\n\\\nTypical unit code(s): NU for newton metre (N m), F17 for pound-force per foot, or F48 for pound-force per inch\\\n\\\n* Note 1: You can link to information about how the given value has been determined (e.g. reference RPM) using the [[valueReference]] property.\\\n* Note 2: You can use [[minValue]] and [[maxValue]] to indicate ranges.'),
(1518, 1, 14, 'totalJobOpenings', 'totalJobOpenings', 'The number of positions open for this job posting. Use a positive integer. Do not use if the number of positions is unclear or not known.'),
(1519, 1, 14, 'totalPaymentDue', 'totalPaymentDue', 'The total amount due.'),
(1520, 1, 14, 'totalPrice', 'totalPrice', 'The total price for the reservation or ticket, including applicable taxes, shipping, etc.\\\n\\\nUsage guidelines:\\\n\\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.\\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
(1521, 1, 14, 'totalTime', 'totalTime', 'The total time required to perform instructions or a direction (including time to prepare the supplies), in [ISO 8601 duration format](http://en.wikipedia.org/wiki/ISO_8601).'),
(1522, 1, 14, 'tourBookingPage', 'tourBookingPage', 'A page providing information on how to book a tour of some [[Place]], such as an [[Accommodation]] or [[ApartmentComplex]] in a real estate setting, as well as other kinds of tours as appropriate.'),
(1523, 1, 14, 'touristType', 'touristType', 'Attraction suitable for type(s) of tourist. eg. Children, visitors from a particular country, etc. '),
(1524, 1, 14, 'trackingNumber', 'trackingNumber', 'Shipper tracking number.'),
(1525, 1, 14, 'trackingUrl', 'trackingUrl', 'Tracking url for the parcel delivery.'),
(1526, 1, 14, 'tracks', 'tracks', 'A music recording (track)&#x2014;usually a single song.'),
(1527, 1, 14, 'trailer', 'trailer', 'The trailer of a movie or tv/radio series, season, episode, etc.'),
(1528, 1, 14, 'trailerWeight', 'trailerWeight', 'The permitted weight of a trailer attached to the vehicle.\\\n\\\nTypical unit code(s): KGM for kilogram, LBR for pound\\\n* Note 1: You can indicate additional information in the [[name]] of the [[QuantitativeValue]] node.\\\n* Note 2: You may also link to a [[QualitativeValue]] node that provides additional information using [[valueReference]].\\\n* Note 3: Note that you can use [[minValue]] and [[maxValue]] to indicate ranges.'),
(1529, 1, 14, 'trainName', 'trainName', 'The name of the train (e.g. The Orient Express).'),
(1530, 1, 14, 'trainNumber', 'trainNumber', 'The unique identifier for the train.'),
(1531, 1, 14, 'trainingSalary', 'trainingSalary', 'The estimated salary earned while in the program.'),
(1532, 1, 14, 'transFatContent', 'transFatContent', 'The number of grams of trans fat.'),
(1533, 1, 14, 'transcript', 'transcript', 'If this MediaObject is an AudioObject or VideoObject, the transcript of that object.'),
(1534, 1, 14, 'transitTime', 'transitTime', 'The typical delay the order has been sent for delivery and the goods reach the final customer. Typical properties: minValue, maxValue, unitCode (d for DAY).'),
(1535, 1, 14, 'transitTimeLabel', 'transitTimeLabel', 'Label to match an [[OfferShippingDetails]] with a [[DeliveryTimeSettings]] (within the context of a [[shippingSettingsLink]] cross-reference).'),
(1536, 1, 14, 'translator', 'translator', 'Organization or person who adapts a creative work to different languages, regional differences and technical requirements of a target market, or that translates during some event.'),
(1537, 1, 14, 'transmissionMethod', 'transmissionMethod', 'How the disease spreads, either as a route or vector, for example \'direct contact\', \'Aedes aegypti\', etc.'),
(1538, 1, 14, 'travelBans', 'travelBans', 'Information about travel bans, e.g. in the context of a pandemic.'),
(1539, 1, 14, 'trialDesign', 'trialDesign', 'Specifics about the trial design (enumerated).'),
(1540, 1, 14, 'tributary', 'tributary', 'The anatomical or organ system that the vein flows into; a larger structure that the vein connects to.'),
(1541, 1, 14, 'typeOfBed', 'typeOfBed', 'The type of bed to which the BedDetail refers, i.e. the type of bed available in the quantity indicated by quantity.'),
(1542, 1, 14, 'typeOfGood', 'typeOfGood', 'The product that this structured value is referring to.'),
(1543, 1, 14, 'typicalAgeRange', 'typicalAgeRange', 'The typical expected age range, e.g. \'7-9\', \'11-\'.'),
(1544, 1, 14, 'typicalCreditsPerTerm', 'typicalCreditsPerTerm', 'The number of credits or units a full-time student would be expected to take in 1 term however \'term\' is defined by the institution.'),
(1545, 1, 14, 'typicalTest', 'typicalTest', 'A medical test typically performed given this condition.'),
(1546, 1, 14, 'underName', 'underName', 'The person or organization the reservation or ticket is for.'),
(1547, 1, 14, 'unitCode', 'unitCode', 'The unit of measurement given using the UN/CEFACT Common Code (3 characters) or a URL. Other codes than the UN/CEFACT Common Code may be used with a prefix followed by a colon.'),
(1548, 1, 14, 'unitText', 'unitText', 'A string or text indicating the unit of measurement. Useful if you cannot provide a standard unit code for\n<a href=\'unitCode\'>unitCode</a>.'),
(1549, 1, 14, 'unnamedSourcesPolicy', 'unnamedSourcesPolicy', 'For an [[Organization]] (typically a [[NewsMediaOrganization]]), a statement about policy on use of unnamed sources and the decision process required.'),
(1550, 1, 14, 'unsaturatedFatContent', 'unsaturatedFatContent', 'The number of grams of unsaturated fat.'),
(1551, 1, 14, 'uploadDate', 'uploadDate', 'Date when this media object was uploaded to this site.'),
(1552, 1, 14, 'upvoteCount', 'upvoteCount', 'The number of upvotes this question, answer or comment has received from the community.'),
(1553, 1, 14, 'url', 'url', 'URL of the item.'),
(1554, 1, 14, 'urlTemplate', 'urlTemplate', 'An url template (RFC6570) that will be used to construct the target of the execution of the action.'),
(1555, 1, 14, 'usedToDiagnose', 'usedToDiagnose', 'A condition the test is used to diagnose.'),
(1556, 1, 14, 'userInteractionCount', 'userInteractionCount', 'The number of interactions for the CreativeWork using the WebSite or SoftwareApplication.'),
(1557, 1, 14, 'usesDevice', 'usesDevice', 'Device used to perform the test.'),
(1558, 1, 14, 'usesHealthPlanIdStandard', 'usesHealthPlanIdStandard', 'The standard for interpreting thePlan ID. The preferred is \"HIOS\". See the Centers for Medicare & Medicaid Services for more details.'),
(1559, 1, 14, 'utterances', 'utterances', 'Text of an utterances (spoken words, lyrics etc.) that occurs at a certain section of a media object, represented as a [[HyperTocEntry]].'),
(1560, 1, 14, 'validFor', 'validFor', 'The duration of validity of a permit or similar thing.'),
(1561, 1, 14, 'validFrom', 'validFrom', 'The date when the item becomes valid.'),
(1562, 1, 14, 'validIn', 'validIn', 'The geographic area where a permit or similar thing is valid.'),
(1563, 1, 14, 'validThrough', 'validThrough', 'The date after when the item is not valid. For example the end of an offer, salary period, or a period of opening hours.'),
(1564, 1, 14, 'validUntil', 'validUntil', 'The date when the item is no longer valid.'),
(1565, 1, 14, 'value', 'value', 'The value of the quantitative value or property value node.\\\n\\\n* For [[QuantitativeValue]] and [[MonetaryAmount]], the recommended type for values is \'Number\'.\\\n* For [[PropertyValue]], it can be \'Text;\', \'Number\', \'Boolean\', or \'StructuredValue\'.\\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.\\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
(1566, 1, 14, 'valueAddedTaxIncluded', 'valueAddedTaxIncluded', 'Specifies whether the applicable value-added tax (VAT) is included in the price specification or not.'),
(1567, 1, 14, 'valueMaxLength', 'valueMaxLength', 'Specifies the allowed range for number of characters in a literal value.'),
(1568, 1, 14, 'valueMinLength', 'valueMinLength', 'Specifies the minimum allowed range for number of characters in a literal value.'),
(1569, 1, 14, 'valueName', 'valueName', 'Indicates the name of the PropertyValueSpecification to be used in URL templates and form encoding in a manner analogous to HTML\'s input@name.'),
(1570, 1, 14, 'valuePattern', 'valuePattern', 'Specifies a regular expression for testing literal values according to the HTML spec.'),
(1571, 1, 14, 'valueReference', 'valueReference', 'A pointer to a secondary value that provides additional information on the original value, e.g. a reference temperature.'),
(1572, 1, 14, 'valueRequired', 'valueRequired', 'Whether the property must be filled in to complete the action.  Default is false.'),
(1573, 1, 14, 'variableMeasured', 'variableMeasured', 'The variableMeasured property can indicate (repeated as necessary) the  variables that are measured in some dataset, either described as text or as pairs of identifier and description using PropertyValue.'),
(1574, 1, 14, 'variantCover', 'variantCover', 'A description of the variant cover\n    	for the issue, if the issue is a variant printing. For example, \"Bryan Hitch\n    	Variant Cover\" or \"2nd Printing Variant\".'),
(1575, 1, 14, 'variesBy', 'variesBy', 'Indicates the property or properties by which the variants in a [[ProductGroup]] vary, e.g. their size, color etc. Schema.org properties can be referenced by their short name e.g. \"color\"; terms defined elsewhere can be referenced with their URIs.'),
(1576, 1, 14, 'vatID', 'vatID', 'The Value-added Tax ID of the organization or person.'),
(1577, 1, 14, 'vehicleConfiguration', 'vehicleConfiguration', 'A short text indicating the configuration of the vehicle, e.g. \'5dr hatchback ST 2.5 MT 225 hp\' or \'limited edition\'.'),
(1578, 1, 14, 'vehicleEngine', 'vehicleEngine', 'Information about the engine or engines of the vehicle.'),
(1579, 1, 14, 'vehicleIdentificationNumber', 'vehicleIdentificationNumber', 'The Vehicle Identification Number (VIN) is a unique serial number used by the automotive industry to identify individual motor vehicles.'),
(1580, 1, 14, 'vehicleInteriorColor', 'vehicleInteriorColor', 'The color or color combination of the interior of the vehicle.'),
(1581, 1, 14, 'vehicleInteriorType', 'vehicleInteriorType', 'The type or material of the interior of the vehicle (e.g. synthetic fabric, leather, wood, etc.). While most interior types are characterized by the material used, an interior type can also be based on vehicle usage or target audience.'),
(1582, 1, 14, 'vehicleModelDate', 'vehicleModelDate', 'The release date of a vehicle model (often used to differentiate versions of the same make and model).'),
(1583, 1, 14, 'vehicleSeatingCapacity', 'vehicleSeatingCapacity', 'The number of passengers that can be seated in the vehicle, both in terms of the physical space available, and in terms of limitations set by law.\\\n\\\nTypical unit code(s): C62 for persons.'),
(1584, 1, 14, 'vehicleSpecialUsage', 'vehicleSpecialUsage', 'Indicates whether the vehicle has been used for special purposes, like commercial rental, driving school, or as a taxi. The legislation in many countries requires this information to be revealed when offering a car for sale.'),
(1585, 1, 14, 'vehicleTransmission', 'vehicleTransmission', 'The type of component used for transmitting the power from a rotating power source to the wheels or other relevant component(s) (\"gearbox\" for cars).'),
(1586, 1, 14, 'vendor', 'vendor', '\'vendor\' is an earlier term for \'seller\'.'),
(1587, 1, 14, 'verificationFactCheckingPolicy', 'verificationFactCheckingPolicy', 'Disclosure about verification and fact-checking processes for a [[NewsMediaOrganization]] or other fact-checking [[Organization]].'),
(1588, 1, 14, 'version', 'version', 'The version of the CreativeWork embodied by a specified resource.'),
(1589, 1, 14, 'video', 'video', 'An embedded video object.'),
(1590, 1, 14, 'videoFormat', 'videoFormat', 'The type of screening or video broadcast used (e.g. IMAX, 3D, SD, HD, etc.).'),
(1591, 1, 14, 'videoFrameSize', 'videoFrameSize', 'The frame size of the video.'),
(1592, 1, 14, 'videoQuality', 'videoQuality', 'The quality of the video.'),
(1593, 1, 14, 'volumeNumber', 'volumeNumber', 'Identifies the volume of publication or multi-part work; for example, \"iii\" or \"2\".'),
(1594, 1, 14, 'warning', 'warning', 'Any FDA or other warnings about the drug (text or URL).'),
(1595, 1, 14, 'warrantyPromise', 'warrantyPromise', 'The warranty promise(s) included in the offer.'),
(1596, 1, 14, 'warrantyScope', 'warrantyScope', 'The scope of the warranty promise.'),
(1597, 1, 14, 'webCheckinTime', 'webCheckinTime', 'The time when a passenger can check into the flight online.');
INSERT INTO `property` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(1598, 1, 14, 'webFeed', 'webFeed', 'The URL for a feed, e.g. associated with a podcast series, blog, or series of date-stamped updates. This is usually RSS or Atom.'),
(1599, 1, 14, 'weight', 'weight', 'The weight of the product or person.'),
(1600, 1, 14, 'weightTotal', 'weightTotal', 'The permitted total weight of the loaded vehicle, including passengers and cargo and the weight of the empty vehicle.\\\n\\\nTypical unit code(s): KGM for kilogram, LBR for pound\\\n\\\n* Note 1: You can indicate additional information in the [[name]] of the [[QuantitativeValue]] node.\\\n* Note 2: You may also link to a [[QualitativeValue]] node that provides additional information using [[valueReference]].\\\n* Note 3: Note that you can use [[minValue]] and [[maxValue]] to indicate ranges.'),
(1601, 1, 14, 'wheelbase', 'wheelbase', 'The distance between the centers of the front and rear wheels.\\\n\\\nTypical unit code(s): CMT for centimeters, MTR for meters, INH for inches, FOT for foot/feet'),
(1602, 1, 14, 'width', 'width', 'The width of the item.'),
(1603, 1, 14, 'winner', 'winner', 'A sub property of participant. The winner of the action.'),
(1604, 1, 14, 'wordCount', 'wordCount', 'The number of words in the text of the Article.'),
(1605, 1, 14, 'workHours', 'workHours', 'The typical working hours for this job (e.g. 1st shift, night shift, 8am-5pm).'),
(1606, 1, 14, 'workLocation', 'workLocation', 'A contact location for a person\'s place of work.'),
(1607, 1, 14, 'workPerformed', 'workPerformed', 'A work performed in some event, for example a play performed in a TheaterEvent.'),
(1608, 1, 14, 'workPresented', 'workPresented', 'The movie presented during this event.'),
(1609, 1, 14, 'workload', 'workload', 'Quantitative measure of the physiologic output of the exercise; also referred to as energy expenditure.'),
(1610, 1, 14, 'worksFor', 'worksFor', 'Organizations that the person works for.'),
(1611, 1, 14, 'worstRating', 'worstRating', 'The lowest value allowed in this rating system. If worstRating is omitted, 1 is assumed.'),
(1612, 1, 14, 'xpath', 'xpath', 'An XPath, e.g. of a [[SpeakableSpecification]] or [[WebPageElement]]. In the latter case, multiple matches within a page can constitute a single conceptual \"Web page element\".'),
(1613, 1, 14, 'yearBuilt', 'yearBuilt', 'The year an [[Accommodation]] was constructed. This corresponds to the [YearBuilt field in RESO](https://ddwiki.reso.org/display/DDW17/YearBuilt+Field). '),
(1614, 1, 14, 'yearlyRevenue', 'yearlyRevenue', 'The size of the business in annual revenue.'),
(1615, 1, 14, 'yearsInOperation', 'yearsInOperation', 'The age of the business.'),
(1616, 1, 14, 'actionApplication', 'actionApplication', 'An application that can complete the request.'),
(1617, 1, 14, 'actionOption', 'actionOption', 'A sub property of object. The options subject to this action.'),
(1618, 1, 14, 'album', 'album', 'A music album.'),
(1619, 1, 14, 'albumRelease', 'albumRelease', 'A release of this album.'),
(1620, 1, 14, 'alumni', 'alumni', 'Alumni of an organization.'),
(1621, 1, 14, 'alumniOf', 'alumniOf', 'An organization that the person is an alumni of.'),
(1622, 1, 14, 'archiveHeld', 'archiveHeld', 'Collection, [fonds](https://en.wikipedia.org/wiki/Fonds), or item held, kept or maintained by an [[ArchiveOrganization]].'),
(1623, 1, 14, 'arterialBranch', 'arterialBranch', 'The branches that comprise the arterial structure.'),
(1624, 1, 14, 'artworkSurface', 'artworkSurface', 'The supporting materials for the artwork, e.g. Canvas, Paper, Wood, Board, etc.'),
(1625, 1, 14, 'attendee', 'attendee', 'A person or organization attending the event.'),
(1626, 1, 14, 'audience', 'audience', 'An intended audience, i.e. a group for whom something was created.'),
(1627, 1, 14, 'availableOnDevice', 'availableOnDevice', 'Device required to run the application. Used in cases where a specific make/model is required to run the application.'),
(1628, 1, 14, 'award', 'award', 'An award won by or for this item.'),
(1629, 1, 14, 'blogPost', 'blogPost', 'A posting that is part of this blog.'),
(1630, 1, 14, 'broker', 'broker', 'An entity that arranges for an exchange between a buyer and a seller.  In most cases a broker never acquires or releases ownership of a product or service involved in an exchange.  If it is not clear whether an entity is a broker, seller, or buyer, the latter two terms are preferred.'),
(1631, 1, 14, 'category', 'category', 'A category for the item. Greater signs or slashes can be used to informally indicate a category hierarchy.'),
(1632, 1, 14, 'clinicalPharmacology', 'clinicalPharmacology', 'Description of the absorption and elimination of drugs, including their concentration (pharmacokinetics, pK) and biological effects (pharmacodynamics, pD).'),
(1633, 1, 14, 'codeSampleType', 'codeSampleType', 'What type of code sample: full (compile ready) solution, code snippet, inline code, scripts, template.'),
(1634, 1, 14, 'colleague', 'colleague', 'A colleague of the person.'),
(1635, 1, 14, 'contactPoint', 'contactPoint', 'A contact point for a person or organization.'),
(1636, 1, 14, 'containsPlace', 'containsPlace', 'The basic containment relation between a place and another that it contains.'),
(1637, 1, 14, 'containsSeason', 'containsSeason', 'A season that is part of the media series.'),
(1638, 1, 14, 'contentLocation', 'contentLocation', 'The location depicted or described in the content. For example, the location in a photograph or painting.'),
(1639, 1, 14, 'creator', 'creator', 'The creator/author of this CreativeWork. This is the same as the Author property for CreativeWork.'),
(1640, 1, 14, 'dataset', 'dataset', 'A dataset contained in this catalog.'),
(1641, 1, 14, 'dateCreated', 'dateCreated', 'The date on which the CreativeWork was created or the item was added to a DataFeed.'),
(1642, 1, 14, 'description', 'description', 'A description of the item.'),
(1643, 1, 14, 'director', 'director', 'A director of e.g. tv, radio, movie, video gaming etc. content, or of an event. Directors can be associated with individual items or with a series, episode, clip.'),
(1644, 1, 14, 'duration', 'duration', 'The duration of the item (movie, audio recording, event, etc.) in [ISO 8601 date format](http://en.wikipedia.org/wiki/ISO_8601).'),
(1645, 1, 14, 'employee', 'employee', 'Someone working for this organization.'),
(1646, 1, 14, 'encodesCreativeWork', 'encodesCreativeWork', 'The CreativeWork encoded by this media object.'),
(1647, 1, 14, 'encodingFormat', 'encodingFormat', 'Media type typically expressed using a MIME format (see [IANA site](http://www.iana.org/assignments/media-types/media-types.xhtml) and [MDN reference](https://developer.mozilla.org/en-US/docs/Web/HTTP/Basics_of_HTTP/MIME_types)) e.g. application/zip for a SoftwareApplication binary, audio/mpeg for .mp3 etc.).\n\nIn cases where a [[CreativeWork]] has several media type representations, [[encoding]] can be used to indicate each [[MediaObject]] alongside particular [[encodingFormat]] information.\n\nUnregistered or niche encoding and file formats can be indicated instead via the most appropriate URL, e.g. defining Web page or a Wikipedia/Wikidata entry.'),
(1648, 1, 14, 'episode', 'episode', 'An episode of a tv, radio or game media within a series or season.'),
(1649, 1, 14, 'event', 'event', 'Upcoming or past event associated with this place, organization, or action.'),
(1650, 1, 14, 'exampleOfWork', 'exampleOfWork', 'A creative work that this work is an example/instance/realization/derivation of.'),
(1651, 1, 14, 'executableLibraryName', 'executableLibraryName', 'Library file name e.g., mscorlib.dll, system.web.dll.'),
(1652, 1, 14, 'exerciseCourse', 'exerciseCourse', 'A sub property of location. The course where this action was taken.'),
(1653, 1, 14, 'founder', 'founder', 'A person who founded this organization.'),
(1654, 1, 14, 'frequency', 'frequency', 'How often the dose is taken, e.g. \'daily\'.'),
(1655, 1, 14, 'game', 'game', 'Video game which is played on this server.'),
(1656, 1, 14, 'gameServer', 'gameServer', 'The server on which  it is possible to play the game.'),
(1657, 1, 14, 'genre', 'genre', 'Genre of the creative work, broadcast channel or group.'),
(1658, 1, 14, 'hasBroadcastChannel', 'hasBroadcastChannel', 'A broadcast channel of a broadcast service.'),
(1659, 1, 14, 'hasDefinedTerm', 'hasDefinedTerm', 'A Defined Term contained in this term set.'),
(1660, 1, 14, 'hasMenu', 'hasMenu', 'Either the actual menu as a structured representation, as text, or a URL of the menu.'),
(1661, 1, 14, 'hasVariant', 'hasVariant', 'Indicates a [[Product]] that is a member of this [[ProductGroup]] (or [[ProductModel]]).'),
(1662, 1, 14, 'holdingArchive', 'holdingArchive', '[[ArchiveOrganization]] that holds, keeps or maintains the [[ArchiveComponent]].'),
(1663, 1, 14, 'inDefinedTermSet', 'inDefinedTermSet', 'A [[DefinedTermSet]] that contains this term.'),
(1664, 1, 14, 'inLanguage', 'inLanguage', 'The language of the content or performance or used in an action. Please use one of the language codes from the [IETF BCP 47 standard](http://tools.ietf.org/html/bcp47). See also [[availableLanguage]].'),
(1665, 1, 14, 'incentiveCompensation', 'incentiveCompensation', 'Description of bonus and commission compensation aspects of the job.'),
(1666, 1, 14, 'interactionStatistic', 'interactionStatistic', 'The number of interactions for the CreativeWork using the WebSite or SoftwareApplication. The most specific child type of InteractionCounter should be used.'),
(1667, 1, 14, 'isAccessibleForFree', 'isAccessibleForFree', 'A flag to signal that the item, event, or place is accessible for free.'),
(1668, 1, 14, 'isBasedOn', 'isBasedOn', 'A resource from which this work is derived or from which it is a modification or adaption.'),
(1669, 1, 14, 'isVariantOf', 'isVariantOf', 'Indicates the kind of product that this is a variant of. In the case of [[ProductModel]], this is a pointer (from a ProductModel) to a base product from which this product is a variant. It is safe to infer that the variant inherits all product features from the base model, unless defined locally. This is not transitive. In the case of a [[ProductGroup]], the group description also serves as a template, representing a set of Products that vary on explicitly defined, specific dimensions only (so it defines both a set of variants, as well as which values distinguish amongst those variants). When used with [[ProductGroup]], this property can apply to any [[Product]] included in the group.'),
(1670, 1, 14, 'itemOffered', 'itemOffered', 'An item being offered (or demanded). The transactional nature of the offer or demand is documented using [[businessFunction]], e.g. sell, lease etc. While several common expected types are listed explicitly in this definition, others can be used. Using a second type, such as Product or a subtype of Product, can clarify the nature of the offer.'),
(1671, 1, 14, 'jobBenefits', 'jobBenefits', 'Description of benefits associated with the job.'),
(1672, 1, 14, 'jurisdiction', 'jurisdiction', 'Indicates a legal jurisdiction, e.g. of some legislation, or where some government service is based.'),
(1673, 1, 14, 'legislationApplies', 'legislationApplies', 'Indicates that this legislation (or part of a legislation) somehow transfers another legislation in a different legislative context. This is an informative link, and it has no legal value. For legally-binding links of transposition, use the <a href=\"/legislationTransposes\">legislationTransposes</a> property. For example an informative consolidated law of a European Union\'s member state \"applies\" the consolidated version of the European Directive implemented in it.'),
(1674, 1, 14, 'mainContentOfPage', 'mainContentOfPage', 'Indicates if this web page element is the main subject of the page.'),
(1675, 1, 14, 'mainEntity', 'mainEntity', 'Indicates the primary entity described in some page or other CreativeWork.'),
(1676, 1, 14, 'mainEntityOfPage', 'mainEntityOfPage', 'Indicates a page (or other CreativeWork) for which this thing is the main entity being described. See [background notes](/docs/datamodel.html#mainEntityBackground) for details.'),
(1677, 1, 14, 'makesOffer', 'makesOffer', 'A pointer to products or services offered by the organization or person.'),
(1678, 1, 14, 'offeredBy', 'offeredBy', 'A pointer to the organization or person making the offer.'),
(1679, 1, 14, 'offers', 'offers', 'An offer to provide this item&#x2014;for example, an offer to sell a product, rent the DVD of a movie, perform a service, or give away tickets to an event. Use [[businessFunction]] to indicate the kind of transaction offered, i.e. sell, lease, etc. This property can also be used to describe a [[Demand]]. While this property is listed as expected on a number of common types, it can be used in others. In that case, using a second type, such as Product or a subtype of Product, can clarify the nature of the offer.\n      '),
(1680, 1, 14, 'parent', 'parent', 'A parent of this person.'),
(1681, 1, 14, 'partOfSeries', 'partOfSeries', 'The series to which this episode or season belongs.'),
(1682, 1, 14, 'partOfTrip', 'partOfTrip', 'Identifies that this [[Trip]] is a subTrip of another Trip.  For example Day 1, Day 2, etc. of a multi-day trip.'),
(1683, 1, 14, 'paymentDueDate', 'paymentDueDate', 'The date that payment is due.'),
(1684, 1, 14, 'performTime', 'performTime', 'The length of time it takes to perform instructions or a direction (not including time to prepare the supplies), in [ISO 8601 duration format](http://en.wikipedia.org/wiki/ISO_8601).'),
(1685, 1, 14, 'performer', 'performer', 'A performer at the event&#x2014;for example, a presenter, musician, musical group or actor.'),
(1686, 1, 14, 'photo', 'photo', 'A photograph of this place.'),
(1687, 1, 14, 'provider', 'provider', 'The service provider, service operator, or service performer; the goods producer. Another party (a seller) may offer those services or goods on behalf of the provider. A provider may also serve as the seller.'),
(1688, 1, 14, 'providesBroadcastService', 'providesBroadcastService', 'The BroadcastService offered on this channel.'),
(1689, 1, 14, 'recipeIngredient', 'recipeIngredient', 'A single ingredient used in the recipe, e.g. sugar, flour or garlic.'),
(1690, 1, 14, 'recordedAs', 'recordedAs', 'An audio recording of the work.'),
(1691, 1, 14, 'recordedAt', 'recordedAt', 'The Event where the CreativeWork was recorded. The CreativeWork may capture all or part of the event.'),
(1692, 1, 14, 'recordedIn', 'recordedIn', 'The CreativeWork that captured all or part of this Event.'),
(1693, 1, 14, 'recordingOf', 'recordingOf', 'The composition this track is a recording of.'),
(1694, 1, 14, 'releaseOf', 'releaseOf', 'The album this is a release of.'),
(1695, 1, 14, 'review', 'review', 'A review of the item.'),
(1696, 1, 14, 'roleName', 'roleName', 'A role played, performed or filled by a person or organization. For example, the team of creators for a comic book might fill the roles named \'inker\', \'penciller\', and \'letterer\'; or an athlete in a SportsTeam might play in the position named \'Quarterback\'.'),
(1697, 1, 14, 'runtimePlatform', 'runtimePlatform', 'Runtime platform or script interpreter dependencies (Example - Java v1, Python2.3, .Net Framework 3.0).'),
(1698, 1, 14, 'season', 'season', 'A season in a media series.'),
(1699, 1, 14, 'serialNumber', 'serialNumber', 'The serial number or any alphanumeric identifier of a particular product. When attached to an offer, it is a shortcut for the serial number of the product included in the offer.'),
(1700, 1, 14, 'serviceArea', 'serviceArea', 'The geographic area where the service is provided.'),
(1701, 1, 14, 'serviceOutput', 'serviceOutput', 'The tangible thing generated by the service, e.g. a passport, permit, etc.'),
(1702, 1, 14, 'sibling', 'sibling', 'A sibling of the person.'),
(1703, 1, 14, 'significantLink', 'significantLink', 'One of the more significant URLs on the page. Typically, these are the non-navigation links that are clicked on the most.'),
(1704, 1, 14, 'softwareRequirements', 'softwareRequirements', 'Component dependency requirements for application. This includes runtime environments and shared libraries that are not included in the application distribution package, but required to run the application (Examples: DirectX, Java or .NET runtime).'),
(1705, 1, 14, 'sponsor', 'sponsor', 'A person or organization that supports a thing through a pledge, promise, or financial contribution. e.g. a sponsor of a Medical Study or a corporate sponsor of an event.'),
(1706, 1, 14, 'subOrganization', 'subOrganization', 'A relationship between two organizations where the first includes the second, e.g., as a subsidiary. See also: the more specific \'department\' property.'),
(1707, 1, 14, 'subTrip', 'subTrip', 'Identifies a [[Trip]] that is a subTrip of this Trip.  For example Day 1, Day 2, etc. of a multi-day trip.'),
(1708, 1, 14, 'subjectOf', 'subjectOf', 'A CreativeWork or Event about this Thing.'),
(1709, 1, 14, 'suggestedAnswer', 'suggestedAnswer', 'An answer (possibly one of several, possibly incorrect) to a Question, e.g. on a Question/Answer site.'),
(1710, 1, 14, 'superEvent', 'superEvent', 'An event that this event is a part of. For example, a collection of individual music performances might each have a music festival as their superEvent.'),
(1711, 1, 14, 'targetCollection', 'targetCollection', 'A sub property of object. The collection target of the action.'),
(1712, 1, 14, 'temporalCoverage', 'temporalCoverage', 'The temporalCoverage of a CreativeWork indicates the period that the content applies to, i.e. that it describes, either as a DateTime or as a textual string indicating a time period in [ISO 8601 time interval format](https://en.wikipedia.org/wiki/ISO_8601#Time_intervals). In\n      the case of a Dataset it will typically indicate the relevant time period in a precise notation (e.g. for a 2011 census dataset, the year 2011 would be written \"2011/2012\"). Other forms of content e.g. ScholarlyArticle, Book, TVSeries or TVEpisode may indicate their temporalCoverage in broader terms - textually or via well-known URL.\n      Written works such as books may sometimes have precise temporal coverage too, e.g. a work set in 1939 - 1945 can be indicated in ISO 8601 interval format format via \"1939/1945\".\n\nOpen-ended date ranges can be written with \"..\" in place of the end date. For example, \"2015-11/..\" indicates a range beginning in November 2015 and with no specified final date. This is tentative and might be updated in future when ISO 8601 is officially updated.'),
(1713, 1, 14, 'termCode', 'termCode', 'A code that identifies this [[DefinedTerm]] within a [[DefinedTermSet]]'),
(1714, 1, 14, 'track', 'track', 'A music recording (track)&#x2014;usually a single song. If an ItemList is given, the list should contain items of type MusicRecording.'),
(1715, 1, 14, 'translationOfWork', 'translationOfWork', 'The work that this work has been translated from. e.g. 物种起源 is a translationOf “On the Origin of Species”'),
(1716, 1, 14, 'usageInfo', 'usageInfo', 'The schema.org [[usageInfo]] property indicates further information about a [[CreativeWork]]. This property is applicable both to works that are freely available and to those that require payment or other transactions. It can reference additional information e.g. community expectations on preferred linking and citation conventions, as well as purchasing details. For something that can be commercially licensed, usageInfo can provide detailed, resource-specific information about licensing options.\n\nThis property can be used alongside the license property which indicates license(s) applicable to some piece of content. The usageInfo property can provide information about other licensing options, e.g. acquiring commercial usage rights for an image that is also available under non-commercial creative commons licenses.'),
(1717, 1, 14, 'warranty', 'warranty', 'The warranty promise(s) included in the offer.'),
(1718, 1, 14, 'workTranslation', 'workTranslation', 'A work that is a translation of the content of this work. e.g. 西遊記 has an English workTranslation “Journey to the West”,a German workTranslation “Monkeys Pilgerfahrt” and a Vietnamese  translation Tây du ký bình khảo.'),
(1719, 1, 14, 'yield', 'yield', 'The quantity that results by performing instructions. For example, a paper airplane, 10 personalized candles.'),
(1720, 1, 14, 'about', 'about', 'The subject matter of the content.'),
(1721, 1, 14, 'actor', 'actor', 'An actor, e.g. in tv, radio, movie, video games etc., or in an event. Actors can be associated with individual items or with a series, episode, clip.'),
(1722, 1, 14, 'competitor', 'competitor', 'A competitor in a sports event.'),
(1723, 1, 14, 'containedInPlace', 'containedInPlace', 'The basic containment relation between a place and one that contains it.'),
(1724, 1, 14, 'encoding', 'encoding', 'A media object that encodes this CreativeWork. This property is a synonym for associatedMedia.'),
(1725, 1, 14, 'hasMap', 'hasMap', 'A URL to a map of the place.'),
(1726, 1, 14, 'material', 'material', 'A material that something is made from, e.g. leather, wool, cotton, paper.'),
(1727, 1, 14, 'memberOf', 'memberOf', 'An Organization (or ProgramMembership) to which this Person or Organization belongs.'),
(1728, 1, 14, 'parentOrganization', 'parentOrganization', 'The larger organization that this organization is a [[subOrganization]] of, if any.'),
(1729, 1, 14, 'result', 'result', 'The result produced in the action. e.g. John wrote *a book*.'),
(1730, 1, 14, 'seller', 'seller', 'An entity which offers (sells / leases / lends / loans) the services / goods.  A seller may also be a provider.'),
(1731, 1, 14, 'spatialCoverage', 'spatialCoverage', 'The spatialCoverage of a CreativeWork indicates the place(s) which are the focus of the content. It is a subproperty of\n      contentLocation intended primarily for more technical and detailed materials. For example with a Dataset, it indicates\n      areas that the dataset describes: a dataset of New York weather would have spatialCoverage which was the place: the state of New York.'),
(1732, 1, 14, 'step', 'step', 'A single step item (as HowToStep, text, document, video, etc.) or a HowToSection.'),
(1733, 1, 14, 'subEvent', 'subEvent', 'An Event that is part of this event. For example, a conference event includes many presentations, each of which is a subEvent of the conference.'),
(1734, 1, 14, 'supply', 'supply', 'A sub-property of instrument. A supply consumed when performing instructions or a direction.'),
(1735, 1, 14, 'workFeatured', 'workFeatured', 'A work featured in some event, e.g. exhibited in an ExhibitionEvent.\n       Specific subproperties are available for workPerformed (e.g. a play), or a workPresented (a Movie at a ScreeningEvent).'),
(1736, 1, 14, 'areaServed', 'areaServed', 'The geographic area where a service or offered item is provided.'),
(1737, 1, 14, 'image', 'image', 'An image of the item. This can be a [[URL]] or a fully described [[ImageObject]].'),
(1738, 1, 14, 'includedInDataCatalog', 'includedInDataCatalog', 'A data catalog which contains this dataset.'),
(1739, 1, 14, 'member', 'member', 'A member of an Organization or a ProgramMembership. Organizations can be members of organizations; ProgramMembership is typically for individuals.'),
(1740, 1, 14, 'recipient', 'recipient', 'A sub property of participant. The participant who is at the receiving end of the action.'),
(1741, 1, 14, 'workExample', 'workExample', 'Example/instance/realization/derivation of the concept of this creative work. eg. The paperback edition, first edition, or eBook.'),
(1742, 1, 14, 'gtin', 'gtin', 'A Global Trade Item Number ([GTIN](https://www.gs1.org/standards/id-keys/gtin)). GTINs identify trade items, including products and services, using numeric identification codes. The [[gtin]] property generalizes the earlier [[gtin8]], [[gtin12]], [[gtin13]], and [[gtin14]] properties. The GS1 [digital link specifications](https://www.gs1.org/standards/Digital-Link/) express GTINs as URLs. A correct [[gtin]] value should be a valid GTIN, which means that it should be an all-numeric string of either 8, 12, 13 or 14 digits, or a \"GS1 Digital Link\" URL based on such a string. The numeric component should also have a [valid GS1 check digit](https://www.gs1.org/services/check-digit-calculator) and meet the other rules for valid GTINs. See also [GS1\'s GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) and [Wikipedia](https://en.wikipedia.org/wiki/Global_Trade_Item_Number) for more details. Left-padding of the gtin values is not required or encouraged.\n   '),
(1743, 1, 14, 'hasPart', 'hasPart', 'Indicates an item or CreativeWork that is part of this item, or CreativeWork (in some sense).'),
(1744, 1, 14, 'position', 'position', 'The position of an item in a series or sequence of items.'),
(1745, 1, 14, 'isPartOf', 'isPartOf', 'Indicates an item or CreativeWork that this item, or CreativeWork (in some sense), is part of.'),
(1746, 1, 14, 'instrument', 'instrument', 'The object that helped the agent perform the action. e.g. John wrote a book with *a pen*.'),
(1747, 1, 14, 'object', 'object', 'The object upon which the action is carried out, whose state is kept intact or changed. Also known as the semantic roles patient, affected or undergoer (which change their state) or theme (which doesn\'t). e.g. John read *a book*.'),
(1748, 1, 14, 'publishingPrinciples', 'publishingPrinciples', 'The publishingPrinciples property indicates (typically via [[URL]]) a document describing the editorial principles of an [[Organization]] (or individual e.g. a [[Person]] writing a blog) that relate to their activities as a publisher, e.g. ethics or diversity policies. When applied to a [[CreativeWork]] (e.g. [[NewsArticle]]) the principles are those of the party primarily responsible for the creation of the [[CreativeWork]].\n\nWhile such policies are most typically expressed in natural language, sometimes related information (e.g. indicating a [[funder]]) can be expressed using schema.org terminology.\n'),
(1749, 1, 14, 'location', 'location', 'The location of, for example, where an event is happening, where an organization is located, or where an action takes place.'),
(1750, 1, 14, 'participant', 'participant', 'Other co-agents that participated in the action indirectly. e.g. John wrote a book with *Steve*.'),
(1751, 1, 14, 'identifier', 'identifier', 'The identifier property represents any kind of identifier for any kind of [[Thing]], such as ISBNs, GTIN codes, UUIDs etc. Schema.org provides dedicated properties for representing many of these, either as textual strings or as URL (URI) links. See [background notes](/docs/datamodel.html#identifierBg) for more details.\n        '),
