(1756, 1, 15, 'altLabel', 'alternative label', 'The range of skos:altLabel is the class of RDF plain literals.'),
(1757, 1, 15, 'hiddenLabel', 'hidden label', 'The range of skos:hiddenLabel is the class of RDF plain literals.'),
