(1764, 1, 15, 'historyNote', 'history note', NULL),
(1765, 1, 15, 'scopeNote', 'scope note', NULL),
(1766, 1, 15, 'semanticRelation', 'is in semantic relation with', NULL),
(1767, 1, 15, 'broader', 'has broader', 'Broader concepts are typically rendered as parents in a concept hierarchy (tree).'),
(1768, 1, 15, 'narrower', 'has narrower', 'Narrower concepts are typically rendered as children in a concept hierarchy (tree).'),
(1769, 1, 15, 'related', 'has related', 'skos:related is disjoint with skos:broaderTransitive'),
(1770, 1, 15, 'broaderTransitive', 'has broader transitive', NULL),
(1771, 1, 15, 'narrowerTransitive', 'has narrower transitive', NULL),
(1772, 1, 15, 'member', 'has member', NULL),
(1773, 1, 15, 'memberList', 'has member list', 'For any resource, every item in the list given as the value of the\n      skos:memberList property is also a value of the skos:member property.'),
(1774, 1, 15, 'mappingRelation', 'is in mapping relation with', 'These concept mapping relations mirror semantic relations, and the data model defined below is similar (with the exception of skos:exactMatch) to the data model defined for semantic relations. A distinct vocabulary is provided for concept mapping relations, to provide a convenient way to differentiate links within a concept scheme from links between concept schemes. However, this pattern of usage is not a formal requirement of the SKOS data model, and relies on informal definitions of best practice.'),
(1775, 1, 15, 'broadMatch', 'has broader match', NULL),
(1776, 1, 15, 'narrowMatch', 'has narrower match', NULL),
(1777, 1, 15, 'relatedMatch', 'has related match', NULL),
(1778, 1, 15, 'exactMatch', 'has exact match', 'skos:exactMatch is disjoint with each of the properties skos:broadMatch and skos:relatedMatch.'),
(1779, 1, 15, 'closeMatch', 'has close match', NULL),
(1798, 5, 17, 'boundary', 'boundary', 'Connect a polygon to a ring describing its boundary.'),
(1799, 5, 17, 'centroid', 'centroid', 'Centroid of a geometry'),
(1800, 5, 17, 'crs', 'coordinate reference system', 'Coordinate system associated with a geometric primitive.'),
(1801, 5, 17, 'envelope', 'envelope', 'Minimal enclosing rectangle of a geometry'),
(1802, 5, 17, 'exterior', 'exterior', 'Connect a polygon to a ring describing the outer contour of its surface.'),
(1803, 5, 17, 'firstAndLast', 'first and last', 'Désigne le point servant de point initial et de point final à une liste circulaire de points.'),
(1804, 5, 17, 'geometry', 'a pour géométrie', 'Geometric primitive associated with an object to represent its location and possibly its shape.'),
(1805, 5, 17, 'interior', 'interior', 'Connect a polygon to a ring describing a hole in its surface.'),
(1806, 5, 17, 'lineStringMember', 'line string member', 'Links a MultiLineString geometry to the linestrings that compose it.'),
(1807, 5, 17, 'lowerCorner', 'coin inférieur', 'Coin d\'une enveloppe correspondant aux valeurs de X et Y les moins élevées.'),
(1808, 5, 17, 'pointMember', 'point member', 'Connect a MultiPoint geometry to the points that compose it.'),
(1809, 5, 17, 'points', 'points', 'La liste ordonnée des points consitutant une géométrie de type Curve.'),
(1810, 5, 17, 'polygonMember', 'polygon member', 'Connects a MultiPolygon geometry to the polygons that compose it.'),
(1811, 5, 17, 'upperCorner', 'coin supérieur', 'Coin d\'une enveloppe correspondant aux valeurs de X et Y les plus élevées.'),
(1812, 5, 17, 'coordM', 'm', 'L\'interprétation des coordonnées d\'un point dépend du système de coordonnées de référence associé à ce point. La coordonnées M d\'un point représente une mesure.'),
(1813, 5, 17, 'coordX', 'x', 'L\'interprétation des coordonnées d\'un point dépend du système de coordonnées de référence associé à ce point. La propriété coordX désigne la coordonnée définie par rapport au premier axe du système de coordonnées.'),
(1814, 5, 17, 'coordY', 'y', 'L\'interprétation des coordonnées d\'un point dépend du système de coordonnées de référence associé à ce point. La propriété coordY désigne la coordonnée définie par rapport au deuxième axe du système de coordonnées.'),
(1815, 5, 17, 'coordZ', 'z', 'L\'interprétation des coordonnées d\'un point dépend du système de coordonnées de référence associé à ce point. La propriété coordZ désigne la coordonnée définie par rapport au troisième axe du système de coordonnées. La coordonnées Z d\'un point représente typiquement, mais pas nécessairement, l\'altitude ou la hauteur de ce point.'),
