(1819, 5, 18, 'substanceHolonym', 'substance holonym', 'Indicates what this is composed of'),
(1820, 5, 18, 'holonymTerm', 'holonym term', 'Indicates that the referenced element is a part of this object'),
(1821, 5, 18, 'negative', 'negative', 'denotes the negation or the absence'),
(1822, 5, 18, 'gloss', 'gloss', 'In TEI: A phrase or word used to provide a gloss or definition for some other word or phrase.\nIn 1951: Any editorial comment.'),
(1823, 5, 18, 'finiteness', 'finiteness', 'Property referring to finite and non-finite status of a verbal form.'),
(1824, 5, 18, 'quasiEquivalent', 'quasi equivalent', NULL),
(1825, 5, 18, 'homograph', 'homograph', 'A word that is spelled like another, but that has a different pronunciation, meaning, and/or origin. // Word that is written like another, but that has a different pronunciation, meaning, and/or origin.'),
(1826, 5, 18, 'copulativeArg', 'copulative arg', 'Used with copula constructions. This represents the subject/object in a copula construction. As such constructions are reversible this property is used instead of the usual verb subject/object. E,g.,\n\nBarack Obama is the president/The president is Barack Obama'),
(1827, 5, 18, 'possessiveAdjunct', 'possessive adjunct', NULL),
(1828, 5, 18, 'gerundClause', 'gerund clause', NULL),
(1829, 5, 18, 'clausalArg', 'clausal arg', NULL),
(1830, 5, 18, 'aspect', 'aspect', 'Category associated to verbs and referring to the way the grammar marks the duration or type of temporal activity.'),
(1831, 5, 18, 'dualNumberForm', 'dual number form', NULL),
(1832, 5, 18, 'formNumberVariant', 'form number variant', NULL),
(1833, 5, 18, 'prepositionalGerundClause', 'prepositional gerund clause', NULL),
(1834, 5, 18, 'dating', 'dating', 'Indication specifying whether the usage is old or modern.'),
(1835, 5, 18, 'directObject', 'direct object', 'relation between a phrase and a verb, in which the relation is central to the verb'),
(1836, 5, 18, 'imperfectTenseForm', 'imperfect tense form', NULL),
(1837, 5, 18, 'termType', 'term type', 'An attribute assigned to a lexeme or a term.'),
(1838, 5, 18, 'causallyRelatedConcept', 'causally related concept', 'A concept that is related to another concept by virtue of the fact that it plays a causative role with respect to that concept.'),
(1839, 5, 18, 'fullFormFor', 'full form for', 'A linking element used to identify a relation between any full form of a term or lexical unit and its abbreviated form.'),
(1840, 5, 18, 'predicativeAdverb', 'predicative adverb', NULL),
(1841, 5, 18, 'superlativeAdjunct', 'superlative adjunct', NULL),
(1842, 5, 18, 'copulativeSubject', 'copulative subject', 'Indicates the subject of a copula construction. It is assumed that by using this the copula construction is not reversible e.g.,\n\nHe is happy/*happy is him'),
(1843, 5, 18, 'head', 'head', NULL),
(1844, 5, 18, 'frequency', 'frequency', 'The relative commonness with which a term occurs.'),
(1845, 5, 18, 'modificationType', 'modification type', 'Refers to the prenominal or postnominal positions of determiners which distinguish different forms.'),
(1846, 5, 18, 'genitiveCaseForm', 'genitive case form', NULL),
(1847, 5, 18, 'formCaseVariant', 'form case variant', NULL),
(1848, 5, 18, 'subject', 'subject', 'relation between a phrase and a verb, that represents the person or thing that performs the action or about which something is stated'),
