(1856, 5, 18, 'homonym', 'homonym', 'A word that is pronounced like another word and that can be spelled the same way (homograph) or can merely sound the same (homophone). // Word that sounds the same and is written the same as another word but is different in meaning.'),
(1857, 5, 18, 'reflexiveObject', 'reflexive object', NULL),
