(1869, 5, 18, 'possessiveInfinitiveClause', 'possessive infinitive clause', NULL),
(1870, 5, 18, 'usageNote', 'usage note', 'A note containing information on the usage of the associated word or term.'),
(1871, 5, 18, 'verbFormMood', 'verb form mood', 'One of a set of distinctive forms that are used to signal modality. Modality is a facet of illocutionary point or general intent of a speaker, or a speaker\'s degree of commitment to the expressed proposition\'s believability, obligatoriness, desirability or reality.'),
(1872, 5, 18, 'cliticness', 'cliticness', 'Categorization of the different types of clitics'),
