(142, 1, 12, 'Annotation', 'Annotation', 'The class for Web Annotations.'),
(143, 1, 12, 'Choice', 'Choice', 'A subClass of  as:OrderedCollection  that conveys to a consuming application that it should select one of the resources in the  as:items  list to use, rather than all of them.  This is typically used to provide a choice of resources to render to the user, based on further supplied properties.  If the consuming application cannot determine the user\'s preference, then it should use the first in the list.'),
(144, 1, 12, 'CssSelector', 'CssSelector', 'A CssSelector describes a Segment of interest in a representation that conforms to the Document Object Model through the use of the CSS selector specification.'),
(145, 1, 12, 'CssStyle', 'CssStyle', 'A resource which describes styles for resources participating in the Annotation using CSS.'),
(146, 1, 12, 'DataPositionSelector', 'DataPositionSelector', 'DataPositionSelector describes a range of data by recording the start and end positions of the selection in the stream. Position 0 would be immediately before the first byte, position 1 would be immediately before the second byte, and so on. The start byte is thus included in the list, but the end byte is not.'),
(147, 1, 12, 'Direction', 'Direction', 'A class to encapsulate the different text directions that a textual resource might take.  It is not used directly in the Annotation Model, only its three instances.'),
(148, 1, 12, 'FragmentSelector', 'FragmentSelector', 'The FragmentSelector class is used to record the segment of a representation using the IRI fragment specification defined by the representation\'s media type.'),
(149, 1, 12, 'HttpRequestState', 'HttpRequestState', 'The HttpRequestState class is used to record the HTTP request headers that a client SHOULD use to request the correct representation from the resource. '),
(150, 1, 12, 'Motivation', 'Motivation', 'The Motivation class is used to record the user\'s intent or motivation for the creation of the Annotation, or the inclusion of the body or target, that it is associated with.'),
(151, 1, 12, 'RangeSelector', 'RangeSelector', 'A Range Selector can be used to identify the beginning and the end of the selection by using other Selectors. The selection consists of everything from the beginning of the starting selector through to the beginning of the ending selector, but not including it.'),
(152, 1, 12, 'ResourceSelection', 'ResourceSelection', 'Instances of the ResourceSelection class identify part (described by an oa:Selector) of another resource (referenced with oa:hasSource), possibly from a particular representation of a resource (described by an oa:State). Please note that ResourceSelection is not used directly in the Web Annotation model, but is provided as a separate class for further application profiles to use, separate from oa:SpecificResource which has many Annotation specific features.'),
(153, 1, 12, 'Selector', 'Selector', 'A resource which describes the segment of interest in a representation of a Source resource, indicated with oa:hasSelector from the Specific Resource. This class is not used directly in the Annotation model, only its subclasses.'),
(154, 1, 12, 'SpecificResource', 'SpecificResource', 'Instances of the SpecificResource class identify part of another resource (referenced with oa:hasSource), a particular representation of a resource, a resource with styling hints for renders, or any combination of these, as used within an Annotation.'),
(155, 1, 12, 'State', 'State', 'A State describes the intended state of a resource as applied to the particular Annotation, and thus provides the information needed to retrieve the correct representation of that resource.'),
(156, 1, 12, 'Style', 'Style', 'A Style describes the intended styling of a resource as applied to the particular Annotation, and thus provides the information to ensure that rendering is consistent across implementations.'),
(157, 1, 12, 'SvgSelector', 'SvgSelector', 'An SvgSelector defines an area through the use of the Scalable Vector Graphics [SVG] standard. This allows the user to select a non-rectangular area of the content, such as a circle or polygon by describing the region using SVG. The SVG may be either embedded within the Annotation or referenced as an External Resource.'),
(158, 1, 12, 'TextPositionSelector', 'TextPositionSelector', 'The TextPositionSelector describes a range of text by recording the start and end positions of the selection in the stream. Position 0 would be immediately before the first character, position 1 would be immediately before the second character, and so on.'),
(159, 1, 12, 'TextQuoteSelector', 'TextQuoteSelector', 'The TextQuoteSelector describes a range of text by copying it, and including some of the text immediately before (a prefix) and after (a suffix) it to distinguish between multiple copies of the same sequence of characters.'),
(160, 1, 12, 'TextualBody', 'TextualBody', ''),
(161, 1, 12, 'TimeState', 'TimeState', 'A TimeState records the time at which the resource\'s state is appropriate for the Annotation, typically the time that the Annotation was created and/or a link to a persistent copy of the current version.'),
(162, 1, 12, 'XPathSelector', 'XPathSelector', ' An XPathSelector is used to select elements and content within a resource that supports the Document Object Model via a specified XPath value.'),
(163, 1, 13, 'Property', 'Property', 'The class of RDF properties.'),
(164, 1, 13, 'Statement', 'Statement', 'The class of RDF statements.'),
(165, 1, 13, 'Bag', 'Bag', 'The class of unordered containers.'),
(166, 1, 13, 'Seq', 'Seq', 'The class of ordered containers.'),
(167, 1, 13, 'Alt', 'Alt', 'The class of containers of alternatives.'),
(168, 1, 13, 'List', 'List', 'The class of RDF Lists.'),
(169, 1, 14, '3DModel', '3DModel', 'A 3D model represents some kind of 3D content, which may have [[encoding]]s in one or more [[MediaObject]]s. Many 3D formats are available (e.g. see [Wikipedia](https://en.wikipedia.org/wiki/Category:3D_graphics_file_formats)); specific encoding formats can be represented using the [[encodingFormat]] property applied to the relevant [[MediaObject]]. For the\ncase of a single file published after Zip compression, the convention of appending \'+zip\' to the [[encodingFormat]] can be used. Geospatial, AR/VR, artistic/animation, gaming, engineering and scientific content can all be represented using [[3DModel]].'),
(170, 1, 14, 'AMRadioChannel', 'AMRadioChannel', 'A radio channel that uses AM.'),
(171, 1, 14, 'APIReference', 'APIReference', 'Reference documentation for application programming interfaces (APIs).'),
(172, 1, 14, 'AboutPage', 'AboutPage', 'Web page type: About page.'),
(173, 1, 14, 'AcceptAction', 'AcceptAction', 'The act of committing to/adopting an object.\\\n\\\nRelated actions:\\\n\\\n* [[RejectAction]]: The antonym of AcceptAction.'),
(174, 1, 14, 'Accommodation', 'Accommodation', 'An accommodation is a place that can accommodate human beings, e.g. a hotel room, a camping pitch, or a meeting room. Many accommodations are for overnight stays, but this is not a mandatory requirement.\nFor more specific types of accommodations not defined in schema.org, one can use additionalType with external vocabularies.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(175, 1, 14, 'AccountingService', 'AccountingService', 'Accountancy business.\\\n\\\nAs a [[LocalBusiness]] it can be described as a [[provider]] of one or more [[Service]]\\\\(s).\n      '),
(176, 1, 14, 'AchieveAction', 'AchieveAction', 'The act of accomplishing something via previous efforts. It is an instantaneous action rather than an ongoing process.'),
(177, 1, 14, 'Action', 'Action', 'An action performed by a direct agent and indirect participants upon a direct object. Optionally happens at a location with the help of an inanimate instrument. The execution of the action may produce a result. Specific action sub-type documentation specifies the exact expectation of each argument/role.\\\n\\\nSee also [blog post](http://blog.schema.org/2014/04/announcing-schemaorg-actions.html) and [Actions overview document](http://schema.org/docs/actions.html).'),
(178, 1, 14, 'ActionAccessSpecification', 'ActionAccessSpecification', 'A set of requirements that a must be fulfilled in order to perform an Action.'),
(179, 1, 14, 'ActionStatusType', 'ActionStatusType', 'The status of an Action.'),
(180, 1, 14, 'ActivateAction', 'ActivateAction', 'The act of starting or activating a device or application (e.g. starting a timer or turning on a flashlight).'),
(181, 1, 14, 'AddAction', 'AddAction', 'The act of editing by adding an object to a collection.'),
(182, 1, 14, 'AdministrativeArea', 'AdministrativeArea', 'A geographical region, typically under the jurisdiction of a particular government.'),
(183, 1, 14, 'AdultEntertainment', 'AdultEntertainment', 'An adult entertainment establishment.'),
(184, 1, 14, 'AdvertiserContentArticle', 'AdvertiserContentArticle', 'An [[Article]] that an external entity has paid to place or to produce to its specifications. Includes [advertorials](https://en.wikipedia.org/wiki/Advertorial), sponsored content, native advertising and other paid content.'),
(185, 1, 14, 'AggregateOffer', 'AggregateOffer', 'When a single product is associated with multiple offers (for example, the same pair of shoes is offered by different merchants), then AggregateOffer can be used.\\\n\\\nNote: AggregateOffers are normally expected to associate multiple offers that all share the same defined [[businessFunction]] value, or default to http://purl.org/goodrelations/v1#Sell if businessFunction is not explicitly defined.'),
(186, 1, 14, 'AggregateRating', 'AggregateRating', 'The average rating based on multiple ratings or reviews.'),
(187, 1, 14, 'AgreeAction', 'AgreeAction', 'The act of expressing a consistency of opinion with the object. An agent agrees to/about an object (a proposition, topic or theme) with participants.'),
(188, 1, 14, 'Airline', 'Airline', 'An organization that provides flights for passengers.'),
(189, 1, 14, 'Airport', 'Airport', 'An airport.'),
(190, 1, 14, 'AlignmentObject', 'AlignmentObject', 'An intangible item that describes an alignment between a learning resource and a node in an educational framework.\n\nShould not be used where the nature of the alignment can be described using a simple property, for example to express that a resource [[teaches]] or [[assesses]] a competency.'),
(191, 1, 14, 'AllocateAction', 'AllocateAction', 'The act of organizing tasks/objects/events by associating resources to it.'),
(192, 1, 14, 'AmpStory', 'AmpStory', 'A creative work with a visual storytelling format intended to be viewed online, particularly on mobile devices.'),
(193, 1, 14, 'AmusementPark', 'AmusementPark', 'An amusement park.'),
(194, 1, 14, 'AnalysisNewsArticle', 'AnalysisNewsArticle', 'An AnalysisNewsArticle is a [[NewsArticle]] that, while based on factual reporting, incorporates the expertise of the author/producer, offering interpretations and conclusions.'),
(195, 1, 14, 'AnatomicalStructure', 'AnatomicalStructure', 'Any part of the human body, typically a component of an anatomical system. Organs, tissues, and cells are all anatomical structures.'),
(196, 1, 14, 'AnatomicalSystem', 'AnatomicalSystem', 'An anatomical system is a group of anatomical structures that work together to perform a certain task. Anatomical systems, such as organ systems, are one organizing principle of anatomy, and can includes circulatory, digestive, endocrine, integumentary, immune, lymphatic, muscular, nervous, reproductive, respiratory, skeletal, urinary, vestibular, and other systems.'),
(197, 1, 14, 'AnimalShelter', 'AnimalShelter', 'Animal shelter.'),
(198, 1, 14, 'Answer', 'Answer', 'An answer offered to a question; perhaps correct, perhaps opinionated or wrong.'),
(199, 1, 14, 'Apartment', 'Apartment', 'An apartment (in American English) or flat (in British English) is a self-contained housing unit (a type of residential real estate) that occupies only part of a building (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Apartment\">http://en.wikipedia.org/wiki/Apartment</a>).'),
(200, 1, 14, 'ApartmentComplex', 'ApartmentComplex', 'Residence type: Apartment complex.'),
(201, 1, 14, 'AppendAction', 'AppendAction', 'The act of inserting at the end if an ordered collection.'),
(202, 1, 14, 'ApplyAction', 'ApplyAction', 'The act of registering to an organization/service without the guarantee to receive it.\\\n\\\nRelated actions:\\\n\\\n* [[RegisterAction]]: Unlike RegisterAction, ApplyAction has no guarantees that the application will be accepted.'),
(203, 1, 14, 'ApprovedIndication', 'ApprovedIndication', 'An indication for a medical therapy that has been formally specified or approved by a regulatory body that regulates use of the therapy; for example, the US FDA approves indications for most drugs in the US.'),
(204, 1, 14, 'Aquarium', 'Aquarium', 'Aquarium.'),
(205, 1, 14, 'ArchiveComponent', 'ArchiveComponent', 'An intangible type to be applied to any archive content, carrying with it a set of properties required to describe archival items and collections.'),
(206, 1, 14, 'ArchiveOrganization', 'ArchiveOrganization', 'An organization with archival holdings. An organization which keeps and preserves archival material and typically makes it accessible to the public.'),
(207, 1, 14, 'ArriveAction', 'ArriveAction', 'The act of arriving at a place. An agent arrives at a destination from a fromLocation, optionally with participants.'),
(208, 1, 14, 'ArtGallery', 'ArtGallery', 'An art gallery.'),
(209, 1, 14, 'Artery', 'Artery', 'A type of blood vessel that specifically carries blood away from the heart.'),
(210, 1, 14, 'Article', 'Article', 'An article, such as a news article or piece of investigative report. Newspapers and magazines have articles of many different types and this is intended to cover them all.\\\n\\\nSee also [blog post](http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html).'),
(211, 1, 14, 'AskAction', 'AskAction', 'The act of posing a question / favor to someone.\\\n\\\nRelated actions:\\\n\\\n* [[ReplyAction]]: Appears generally as a response to AskAction.'),
(212, 1, 14, 'AskPublicNewsArticle', 'AskPublicNewsArticle', 'A [[NewsArticle]] expressing an open call by a [[NewsMediaOrganization]] asking the public for input, insights, clarifications, anecdotes, documentation, etc., on an issue, for reporting purposes.'),
(213, 1, 14, 'AssessAction', 'AssessAction', 'The act of forming one\'s opinion, reaction or sentiment.'),
(214, 1, 14, 'AssignAction', 'AssignAction', 'The act of allocating an action/event/task to some destination (someone or something).'),
(215, 1, 14, 'Atlas', 'Atlas', 'A collection or bound volume of maps, charts, plates or tables, physical or in media form illustrating any subject.'),
(216, 1, 14, 'Attorney', 'Attorney', 'Professional service: Attorney. \\\n\\\nThis type is deprecated - [[LegalService]] is more inclusive and less ambiguous.'),
(217, 1, 14, 'Audience', 'Audience', 'Intended audience for an item, i.e. the group for whom the item was created.'),
(218, 1, 14, 'AudioObject', 'AudioObject', 'An audio file.'),
(219, 1, 14, 'Audiobook', 'Audiobook', 'An audiobook.'),
(220, 1, 14, 'AuthorizeAction', 'AuthorizeAction', 'The act of granting permission to an object.'),
(221, 1, 14, 'AutoBodyShop', 'AutoBodyShop', 'Auto body shop.'),
(222, 1, 14, 'AutoDealer', 'AutoDealer', 'An car dealership.'),
(223, 1, 14, 'AutoPartsStore', 'AutoPartsStore', 'An auto parts store.'),
(224, 1, 14, 'AutoRental', 'AutoRental', 'A car rental business.'),
(225, 1, 14, 'AutoRepair', 'AutoRepair', 'Car repair business.'),
(226, 1, 14, 'AutoWash', 'AutoWash', 'A car wash business.'),
(227, 1, 14, 'AutomatedTeller', 'AutomatedTeller', 'ATM/cash machine.'),
(228, 1, 14, 'AutomotiveBusiness', 'AutomotiveBusiness', 'Car repair, sales, or parts.'),
(229, 1, 14, 'BackgroundNewsArticle', 'BackgroundNewsArticle', 'A [[NewsArticle]] providing historical context, definition and detail on a specific topic (aka \"explainer\" or \"backgrounder\"). For example, an in-depth article or frequently-asked-questions ([FAQ](https://en.wikipedia.org/wiki/FAQ)) document on topics such as Climate Change or the European Union. Other kinds of background material from a non-news setting are often described using [[Book]] or [[Article]], in particular [[ScholarlyArticle]]. See also [[NewsArticle]] for related vocabulary from a learning/education perspective.'),
(230, 1, 14, 'Bakery', 'Bakery', 'A bakery.'),
(231, 1, 14, 'BankAccount', 'BankAccount', 'A product or service offered by a bank whereby one may deposit, withdraw or transfer money and in some cases be paid interest.'),
(232, 1, 14, 'BankOrCreditUnion', 'BankOrCreditUnion', 'Bank or credit union.'),
(233, 1, 14, 'BarOrPub', 'BarOrPub', 'A bar or pub.'),
(234, 1, 14, 'Barcode', 'Barcode', 'An image of a visual machine-readable code such as a barcode or QR code.'),
(235, 1, 14, 'Beach', 'Beach', 'Beach.'),
(236, 1, 14, 'BeautySalon', 'BeautySalon', 'Beauty salon.'),
(237, 1, 14, 'BedAndBreakfast', 'BedAndBreakfast', 'Bed and breakfast.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(238, 1, 14, 'BedDetails', 'BedDetails', 'An entity holding detailed information about the available bed types, e.g. the quantity of twin beds for a hotel room. For the single case of just one bed of a certain type, you can use bed directly with a text. See also [[BedType]] (under development).'),
(239, 1, 14, 'BedType', 'BedType', 'A type of bed. This is used for indicating the bed or beds available in an accommodation.'),
(240, 1, 14, 'BefriendAction', 'BefriendAction', 'The act of forming a personal connection with someone (object) mutually/bidirectionally/symmetrically.\\\n\\\nRelated actions:\\\n\\\n* [[FollowAction]]: Unlike FollowAction, BefriendAction implies that the connection is reciprocal.'),
(241, 1, 14, 'BikeStore', 'BikeStore', 'A bike store.'),
(242, 1, 14, 'Blog', 'Blog', 'A blog.'),
(243, 1, 14, 'BlogPosting', 'BlogPosting', 'A blog post.'),
(244, 1, 14, 'BloodTest', 'BloodTest', 'A medical test performed on a sample of a patient\'s blood.'),
(245, 1, 14, 'BoardingPolicyType', 'BoardingPolicyType', 'A type of boarding policy used by an airline.'),
(246, 1, 14, 'BoatReservation', 'BoatReservation', 'A reservation for boat travel.\n\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use [[Offer]].'),
(247, 1, 14, 'BoatTerminal', 'BoatTerminal', 'A terminal for boats, ships, and other water vessels.'),
(248, 1, 14, 'BoatTrip', 'BoatTrip', 'A trip on a commercial ferry line.'),
(249, 1, 14, 'BodyOfWater', 'BodyOfWater', 'A body of water, such as a sea, ocean, or lake.'),
(250, 1, 14, 'Bone', 'Bone', 'Rigid connective tissue that comprises up the skeletal structure of the human body.'),
(251, 1, 14, 'Book', 'Book', 'A book.'),
(252, 1, 14, 'BookFormatType', 'BookFormatType', 'The publication format of the book.'),
(253, 1, 14, 'BookSeries', 'BookSeries', 'A series of books. Included books can be indicated with the hasPart property.'),
(254, 1, 14, 'BookStore', 'BookStore', 'A bookstore.'),
(255, 1, 14, 'BookmarkAction', 'BookmarkAction', 'An agent bookmarks/flags/labels/tags/marks an object.'),
(256, 1, 14, 'Boolean', 'Boolean', 'Boolean: True or False.'),
(257, 1, 14, 'BorrowAction', 'BorrowAction', 'The act of obtaining an object under an agreement to return it at a later date. Reciprocal of LendAction.\\\n\\\nRelated actions:\\\n\\\n* [[LendAction]]: Reciprocal of BorrowAction.'),
(258, 1, 14, 'BowlingAlley', 'BowlingAlley', 'A bowling alley.'),
(259, 1, 14, 'BrainStructure', 'BrainStructure', 'Any anatomical structure which pertains to the soft nervous tissue functioning as the coordinating center of sensation and intellectual and nervous activity.'),
(260, 1, 14, 'Brand', 'Brand', 'A brand is a name used by an organization or business person for labeling a product, product group, or similar.'),
(261, 1, 14, 'BreadcrumbList', 'BreadcrumbList', 'A BreadcrumbList is an ItemList consisting of a chain of linked Web pages, typically described using at least their URL and their name, and typically ending with the current page.\\\n\\\nThe [[position]] property is used to reconstruct the order of the items in a BreadcrumbList The convention is that a breadcrumb list has an [[itemListOrder]] of [[ItemListOrderAscending]] (lower values listed first), and that the first items in this list correspond to the \"top\" or beginning of the breadcrumb trail, e.g. with a site or section homepage. The specific values of \'position\' are not assigned meaning for a BreadcrumbList, but they should be integers, e.g. beginning with \'1\' for the first item in the list.\n      '),
(262, 1, 14, 'Brewery', 'Brewery', 'Brewery.'),
(263, 1, 14, 'Bridge', 'Bridge', 'A bridge.'),
(264, 1, 14, 'BroadcastChannel', 'BroadcastChannel', 'A unique instance of a BroadcastService on a CableOrSatelliteService lineup.'),
(265, 1, 14, 'BroadcastEvent', 'BroadcastEvent', 'An over the air or online broadcast event.'),
(266, 1, 14, 'BroadcastFrequencySpecification', 'BroadcastFrequencySpecification', 'The frequency in MHz and the modulation used for a particular BroadcastService.'),
(267, 1, 14, 'BroadcastService', 'BroadcastService', 'A delivery service through which content is provided via broadcast over the air or online.'),
(268, 1, 14, 'BrokerageAccount', 'BrokerageAccount', 'An account that allows an investor to deposit funds and place investment orders with a licensed broker or brokerage firm.'),
(269, 1, 14, 'BuddhistTemple', 'BuddhistTemple', 'A Buddhist temple.'),
(270, 1, 14, 'BusOrCoach', 'BusOrCoach', 'A bus (also omnibus or autobus) is a road vehicle designed to carry passengers. Coaches are luxury busses, usually in service for long distance travel.'),
(271, 1, 14, 'BusReservation', 'BusReservation', 'A reservation for bus travel. \\\n\\\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use [[Offer]].'),
(272, 1, 14, 'BusStation', 'BusStation', 'A bus station.'),
(273, 1, 14, 'BusStop', 'BusStop', 'A bus stop.'),
(274, 1, 14, 'BusTrip', 'BusTrip', 'A trip on a commercial bus line.'),
(275, 1, 14, 'BusinessAudience', 'BusinessAudience', 'A set of characteristics belonging to businesses, e.g. who compose an item\'s target audience.'),
(276, 1, 14, 'BusinessEntityType', 'BusinessEntityType', 'A business entity type is a conceptual entity representing the legal form, the size, the main line of business, the position in the value chain, or any combination thereof, of an organization or business person.\\\n\\\nCommonly used values:\\\n\\\n* http://purl.org/goodrelations/v1#Business\\\n* http://purl.org/goodrelations/v1#Enduser\\\n* http://purl.org/goodrelations/v1#PublicInstitution\\\n* http://purl.org/goodrelations/v1#Reseller\n	  '),
(277, 1, 14, 'BusinessEvent', 'BusinessEvent', 'Event type: Business event.'),
(278, 1, 14, 'BusinessFunction', 'BusinessFunction', 'The business function specifies the type of activity or access (i.e., the bundle of rights) offered by the organization or business person through the offer. Typical are sell, rental or lease, maintenance or repair, manufacture / produce, recycle / dispose, engineering / construction, or installation. Proprietary specifications of access rights are also instances of this class.\\\n\\\nCommonly used values:\\\n\\\n* http://purl.org/goodrelations/v1#ConstructionInstallation\\\n* http://purl.org/goodrelations/v1#Dispose\\\n* http://purl.org/goodrelations/v1#LeaseOut\\\n* http://purl.org/goodrelations/v1#Maintain\\\n* http://purl.org/goodrelations/v1#ProvideService\\\n* http://purl.org/goodrelations/v1#Repair\\\n* http://purl.org/goodrelations/v1#Sell\\\n* http://purl.org/goodrelations/v1#Buy\n        '),
(279, 1, 14, 'BuyAction', 'BuyAction', 'The act of giving money to a seller in exchange for goods or services rendered. An agent buys an object, product, or service from a seller for a price. Reciprocal of SellAction.'),
(280, 1, 14, 'CDCPMDRecord', 'CDCPMDRecord', 'A CDCPMDRecord is a data structure representing a record in a CDC tabular data format\n      used for hospital data reporting. See [documentation](/docs/cdc-covid.html) for details, and the linked CDC materials for authoritative\n      definitions used as the source here.\n      '),
(281, 1, 14, 'CableOrSatelliteService', 'CableOrSatelliteService', 'A service which provides access to media programming like TV or radio. Access may be via cable or satellite.'),
(282, 1, 14, 'CafeOrCoffeeShop', 'CafeOrCoffeeShop', 'A cafe or coffee shop.'),
(283, 1, 14, 'Campground', 'Campground', 'A camping site, campsite, or [[Campground]] is a place used for overnight stay in the outdoors, typically containing individual [[CampingPitch]] locations. \\\n\\\n\nIn British English a campsite is an area, usually divided into a number of pitches, where people can camp overnight using tents or camper vans or caravans; this British English use of the word is synonymous with the American English expression campground. In American English the term campsite generally means an area where an individual, family, group, or military unit can pitch a tent or park a camper; a campground may contain many campsites (Source: Wikipedia see [https://en.wikipedia.org/wiki/Campsite](https://en.wikipedia.org/wiki/Campsite)).\\\n\\\n\n\nSee also the dedicated [document on the use of schema.org for marking up hotels and other forms of accommodations](/docs/hotels.html).\n'),
(284, 1, 14, 'CampingPitch', 'CampingPitch', 'A [[CampingPitch]] is an individual place for overnight stay in the outdoors, typically being part of a larger camping site, or [[Campground]].\\\n\\\n\nIn British English a campsite, or campground, is an area, usually divided into a number of pitches, where people can camp overnight using tents or camper vans or caravans; this British English use of the word is synonymous with the American English expression campground. In American English the term campsite generally means an area where an individual, family, group, or military unit can pitch a tent or park a camper; a campground may contain many campsites.\n(Source: Wikipedia see [https://en.wikipedia.org/wiki/Campsite](https://en.wikipedia.org/wiki/Campsite)).\\\n\\\n\nSee also the dedicated [document on the use of schema.org for marking up hotels and other forms of accommodations](/docs/hotels.html).\n'),
(285, 1, 14, 'Canal', 'Canal', 'A canal, like the Panama Canal.'),
(286, 1, 14, 'CancelAction', 'CancelAction', 'The act of asserting that a future event/action is no longer going to happen.\\\n\\\nRelated actions:\\\n\\\n* [[ConfirmAction]]: The antonym of CancelAction.'),
(287, 1, 14, 'Car', 'Car', 'A car is a wheeled, self-powered motor vehicle used for transportation.'),
(288, 1, 14, 'CarUsageType', 'CarUsageType', 'A value indicating a special usage of a car, e.g. commercial rental, driving school, or as a taxi.'),
(289, 1, 14, 'Casino', 'Casino', 'A casino.'),
(290, 1, 14, 'CategoryCode', 'CategoryCode', 'A Category Code.'),
(291, 1, 14, 'CategoryCodeSet', 'CategoryCodeSet', 'A set of Category Code values.'),
(292, 1, 14, 'CatholicChurch', 'CatholicChurch', 'A Catholic church.'),
(293, 1, 14, 'Cemetery', 'Cemetery', 'A graveyard.'),
(294, 1, 14, 'Chapter', 'Chapter', 'One of the sections into which a book is divided. A chapter usually has a section number or a name.'),
(295, 1, 14, 'CheckAction', 'CheckAction', 'An agent inspects, determines, investigates, inquires, or examines an object\'s accuracy, quality, condition, or state.'),
(296, 1, 14, 'CheckInAction', 'CheckInAction', 'The act of an agent communicating (service provider, social media, etc) their arrival by registering/confirming for a previously reserved service (e.g. flight check in) or at a place (e.g. hotel), possibly resulting in a result (boarding pass, etc).\\\n\\\nRelated actions:\\\n\\\n* [[CheckOutAction]]: The antonym of CheckInAction.\\\n* [[ArriveAction]]: Unlike ArriveAction, CheckInAction implies that the agent is informing/confirming the start of a previously reserved service.\\\n* [[ConfirmAction]]: Unlike ConfirmAction, CheckInAction implies that the agent is informing/confirming the *start* of a previously reserved service rather than its validity/existence.'),
(297, 1, 14, 'CheckOutAction', 'CheckOutAction', 'The act of an agent communicating (service provider, social media, etc) their departure of a previously reserved service (e.g. flight check in) or place (e.g. hotel).\\\n\\\nRelated actions:\\\n\\\n* [[CheckInAction]]: The antonym of CheckOutAction.\\\n* [[DepartAction]]: Unlike DepartAction, CheckOutAction implies that the agent is informing/confirming the end of a previously reserved service.\\\n* [[CancelAction]]: Unlike CancelAction, CheckOutAction implies that the agent is informing/confirming the end of a previously reserved service.'),
(298, 1, 14, 'CheckoutPage', 'CheckoutPage', 'Web page type: Checkout page.'),
(299, 1, 14, 'ChildCare', 'ChildCare', 'A Childcare center.'),
(300, 1, 14, 'ChildrensEvent', 'ChildrensEvent', 'Event type: Children\'s event.');
INSERT INTO `resource_class` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(301, 1, 14, 'ChooseAction', 'ChooseAction', 'The act of expressing a preference from a set of options or a large or unbounded set of choices/options.'),
(302, 1, 14, 'Church', 'Church', 'A church.'),
(303, 1, 14, 'City', 'City', 'A city or town.'),
(304, 1, 14, 'CityHall', 'CityHall', 'A city hall.'),
(305, 1, 14, 'CivicStructure', 'CivicStructure', 'A public structure, such as a town hall or concert hall.'),
(306, 1, 14, 'Claim', 'Claim', 'A [[Claim]] in Schema.org represents a specific, factually-oriented claim that could be the [[itemReviewed]] in a [[ClaimReview]]. The content of a claim can be summarized with the [[text]] property. Variations on well known claims can have their common identity indicated via [[sameAs]] links, and summarized with a [[name]]. Ideally, a [[Claim]] description includes enough contextual information to minimize the risk of ambiguity or inclarity. In practice, many claims are better understood in the context in which they appear or the interpretations provided by claim reviews.\n\n  Beyond [[ClaimReview]], the Claim type can be associated with related creative works - for example a [[ScholaryArticle]] or [[Question]] might be [[about]] some [[Claim]].\n\n  At this time, Schema.org does not define any types of relationship between claims. This is a natural area for future exploration.\n  '),
(307, 1, 14, 'ClaimReview', 'ClaimReview', 'A fact-checking review of claims made (or reported) in some creative work (referenced via itemReviewed).'),
(308, 1, 14, 'Class', 'Class', 'A class, also often called a \'Type\'; equivalent to rdfs:Class.'),
(309, 1, 14, 'Clip', 'Clip', 'A short TV or radio program or a segment/part of a program.'),
(310, 1, 14, 'ClothingStore', 'ClothingStore', 'A clothing store.'),
(311, 1, 14, 'Code', 'Code', 'Computer programming source code. Example: Full (compile ready) solutions, code snippet samples, scripts, templates.'),
(312, 1, 14, 'Collection', 'Collection', 'A collection of items e.g. creative works or products.'),
(313, 1, 14, 'CollectionPage', 'CollectionPage', 'Web page type: Collection page.'),
(314, 1, 14, 'CollegeOrUniversity', 'CollegeOrUniversity', 'A college, university, or other third-level educational institution.'),
(315, 1, 14, 'ComedyClub', 'ComedyClub', 'A comedy club.'),
(316, 1, 14, 'ComedyEvent', 'ComedyEvent', 'Event type: Comedy event.'),
(317, 1, 14, 'ComicCoverArt', 'ComicCoverArt', 'The artwork on the cover of a comic.'),
(318, 1, 14, 'ComicIssue', 'ComicIssue', 'Individual comic issues are serially published as\n    	part of a larger series. For the sake of consistency, even one-shot issues\n    	belong to a series comprised of a single issue. All comic issues can be\n    	uniquely identified by: the combination of the name and volume number of the\n    	series to which the issue belongs; the issue number; and the variant\n    	description of the issue (if any).'),
(319, 1, 14, 'ComicSeries', 'ComicSeries', 'A sequential publication of comic stories under a\n    	unifying title, for example \"The Amazing Spider-Man\" or \"Groo the\n    	Wanderer\".'),
(320, 1, 14, 'ComicStory', 'ComicStory', 'The term \"story\" is any indivisible, re-printable\n    	unit of a comic, including the interior stories, covers, and backmatter. Most\n    	comics have at least two stories: a cover (ComicCoverArt) and an interior story.'),
(321, 1, 14, 'Comment', 'Comment', 'A comment on an item - for example, a comment on a blog post. The comment\'s content is expressed via the [[text]] property, and its topic via [[about]], properties shared with all CreativeWorks.'),
(322, 1, 14, 'CommentAction', 'CommentAction', 'The act of generating a comment about a subject.'),
(323, 1, 14, 'CommunicateAction', 'CommunicateAction', 'The act of conveying information to another person via a communication medium (instrument) such as speech, email, or telephone conversation.'),
(324, 1, 14, 'CompleteDataFeed', 'CompleteDataFeed', 'A [[CompleteDataFeed]] is a [[DataFeed]] whose standard representation includes content for every item currently in the feed.\n\nThis is the equivalent of Atom\'s element as defined in Feed Paging and Archiving [RFC 5005](https://tools.ietf.org/html/rfc5005), For example (and as defined for Atom), when using data from a feed that represents a collection of items that varies over time (e.g. \"Top Twenty Records\") there is no need to have newer entries mixed in alongside older, obsolete entries. By marking this feed as a CompleteDataFeed, old entries can be safely discarded when the feed is refreshed, since we can assume the feed has provided descriptions for all current items.'),
(325, 1, 14, 'CompoundPriceSpecification', 'CompoundPriceSpecification', 'A compound price specification is one that bundles multiple prices that all apply in combination for different dimensions of consumption. Use the name property of the attached unit price specification for indicating the dimension of a price component (e.g. \"electricity\" or \"final cleaning\").'),
(326, 1, 14, 'ComputerLanguage', 'ComputerLanguage', 'This type covers computer programming languages such as Scheme and Lisp, as well as other language-like computer representations. Natural languages are best represented with the [[Language]] type.'),
(327, 1, 14, 'ComputerStore', 'ComputerStore', 'A computer store.'),
(328, 1, 14, 'ConfirmAction', 'ConfirmAction', 'The act of notifying someone that a future event/action is going to happen as expected.\\\n\\\nRelated actions:\\\n\\\n* [[CancelAction]]: The antonym of ConfirmAction.'),
(329, 1, 14, 'Consortium', 'Consortium', 'A Consortium is a membership [[Organization]] whose members are typically Organizations.'),
(330, 1, 14, 'ConsumeAction', 'ConsumeAction', 'The act of ingesting information/resources/food.'),
(331, 1, 14, 'ContactPage', 'ContactPage', 'Web page type: Contact page.'),
(332, 1, 14, 'ContactPoint', 'ContactPoint', 'A contact point&#x2014;for example, a Customer Complaints department.'),
(333, 1, 14, 'ContactPointOption', 'ContactPointOption', 'Enumerated options related to a ContactPoint.'),
(334, 1, 14, 'Continent', 'Continent', 'One of the continents (for example, Europe or Africa).'),
(335, 1, 14, 'ControlAction', 'ControlAction', 'An agent controls a device or application.'),
(336, 1, 14, 'ConvenienceStore', 'ConvenienceStore', 'A convenience store.'),
(337, 1, 14, 'Conversation', 'Conversation', 'One or more messages between organizations or people on a particular topic. Individual messages can be linked to the conversation with isPartOf or hasPart properties.'),
(338, 1, 14, 'CookAction', 'CookAction', 'The act of producing/preparing food.'),
(339, 1, 14, 'Corporation', 'Corporation', 'Organization: A business corporation.'),
(340, 1, 14, 'CorrectionComment', 'CorrectionComment', 'A [[comment]] that corrects [[CreativeWork]].'),
(341, 1, 14, 'Country', 'Country', 'A country.'),
(342, 1, 14, 'Course', 'Course', 'A description of an educational course which may be offered as distinct instances at which take place at different times or take place at different locations, or be offered through different media or modes of study. An educational course is a sequence of one or more educational events and/or creative works which aims to build knowledge, competence or ability of learners.'),
(343, 1, 14, 'CourseInstance', 'CourseInstance', 'An instance of a [[Course]] which is distinct from other instances because it is offered at a different time or location or through different media or modes of study or to a specific section of students.'),
(344, 1, 14, 'Courthouse', 'Courthouse', 'A courthouse.'),
(345, 1, 14, 'CoverArt', 'CoverArt', 'The artwork on the outer surface of a CreativeWork.'),
(346, 1, 14, 'CovidTestingFacility', 'CovidTestingFacility', 'A CovidTestingFacility is a [[MedicalClinic]] where testing for the COVID-19 Coronavirus\n      disease is available. If the facility is being made available from an established [[Pharmacy]], [[Hotel]], or other\n      non-medical organization, multiple types can be listed. This makes it easier to re-use existing schema.org information\n      about that place e.g. contact info, address, opening hours. Note that in an emergency, such information may not always be reliable.\n      '),
(347, 1, 14, 'CreateAction', 'CreateAction', 'The act of deliberately creating/producing/generating/building a result out of the agent.'),
(348, 1, 14, 'CreativeWork', 'CreativeWork', 'The most generic kind of creative work, including books, movies, photographs, software programs, etc.'),
(349, 1, 14, 'CreativeWorkSeason', 'CreativeWorkSeason', 'A media season e.g. tv, radio, video game etc.'),
(350, 1, 14, 'CreativeWorkSeries', 'CreativeWorkSeries', 'A CreativeWorkSeries in schema.org is a group of related items, typically but not necessarily of the same kind. CreativeWorkSeries are usually organized into some order, often chronological. Unlike [[ItemList]] which is a general purpose data structure for lists of things, the emphasis with CreativeWorkSeries is on published materials (written e.g. books and periodicals, or media such as tv, radio and games).\\\n\\\nSpecific subtypes are available for describing [[TVSeries]], [[RadioSeries]], [[MovieSeries]], [[BookSeries]], [[Periodical]] and [[VideoGameSeries]]. In each case, the [[hasPart]] / [[isPartOf]] properties can be used to relate the CreativeWorkSeries to its parts. The general CreativeWorkSeries type serves largely just to organize these more specific and practical subtypes.\\\n\\\nIt is common for properties applicable to an item from the series to be usefully applied to the containing group. Schema.org attempts to anticipate some of these cases, but publishers should be free to apply properties of the series parts to the series as a whole wherever they seem appropriate.\n	  '),
(351, 1, 14, 'CreditCard', 'CreditCard', 'A card payment method of a particular brand or name.  Used to mark up a particular payment method and/or the financial product/service that supplies the card account.\\\n\\\nCommonly used values:\\\n\\\n* http://purl.org/goodrelations/v1#AmericanExpress\\\n* http://purl.org/goodrelations/v1#DinersClub\\\n* http://purl.org/goodrelations/v1#Discover\\\n* http://purl.org/goodrelations/v1#JCB\\\n* http://purl.org/goodrelations/v1#MasterCard\\\n* http://purl.org/goodrelations/v1#VISA\n       '),
(352, 1, 14, 'Crematorium', 'Crematorium', 'A crematorium.'),
(353, 1, 14, 'CriticReview', 'CriticReview', 'A [[CriticReview]] is a more specialized form of Review written or published by a source that is recognized for its reviewing activities. These can include online columns, travel and food guides, TV and radio shows, blogs and other independent Web sites. [[CriticReview]]s are typically more in-depth and professionally written. For simpler, casually written user/visitor/viewer/customer reviews, it is more appropriate to use the [[UserReview]] type. Review aggregator sites such as Metacritic already separate out the site\'s user reviews from selected critic reviews that originate from third-party sources.'),
(354, 1, 14, 'CssSelectorType', 'CssSelectorType', 'Text representing a CSS selector.'),
(355, 1, 14, 'CurrencyConversionService', 'CurrencyConversionService', 'A service to convert funds from one currency to another currency.'),
(356, 1, 14, 'DDxElement', 'DDxElement', 'An alternative, closely-related condition typically considered later in the differential diagnosis process along with the signs that are used to distinguish it.'),
(357, 1, 14, 'DanceEvent', 'DanceEvent', 'Event type: A social dance.'),
(358, 1, 14, 'DanceGroup', 'DanceGroup', 'A dance group&#x2014;for example, the Alvin Ailey Dance Theater or Riverdance.'),
(359, 1, 14, 'DataCatalog', 'DataCatalog', 'A collection of datasets.'),
(360, 1, 14, 'DataDownload', 'DataDownload', 'A dataset in downloadable form.'),
(361, 1, 14, 'DataFeed', 'DataFeed', 'A single feed providing structured information about one or more entities or topics.'),
(362, 1, 14, 'DataFeedItem', 'DataFeedItem', 'A single item within a larger data feed.'),
(363, 1, 14, 'DataType', 'DataType', 'The basic data types such as Integers, Strings, etc.'),
(364, 1, 14, 'Dataset', 'Dataset', 'A body of structured information describing some topic(s) of interest.'),
(365, 1, 14, 'Date', 'Date', 'A date value in [ISO 8601 date format](http://en.wikipedia.org/wiki/ISO_8601).'),
(366, 1, 14, 'DateTime', 'DateTime', 'A combination of date and time of day in the form [-]CCYY-MM-DDThh:mm:ss[Z|(+|-)hh:mm] (see Chapter 5.4 of ISO 8601).'),
(367, 1, 14, 'DatedMoneySpecification', 'DatedMoneySpecification', 'A DatedMoneySpecification represents monetary values with optional start and end dates. For example, this could represent an employee\'s salary over a specific period of time. __Note:__ This type has been superseded by [[MonetaryAmount]] use of that type is recommended'),
(368, 1, 14, 'DayOfWeek', 'DayOfWeek', 'The day of the week, e.g. used to specify to which day the opening hours of an OpeningHoursSpecification refer.\n\nOriginally, URLs from [GoodRelations](http://purl.org/goodrelations/v1) were used (for [[Monday]], [[Tuesday]], [[Wednesday]], [[Thursday]], [[Friday]], [[Saturday]], [[Sunday]] plus a special entry for [[PublicHolidays]]); these have now been integrated directly into schema.org.\n      '),
(369, 1, 14, 'DaySpa', 'DaySpa', 'A day spa.'),
(370, 1, 14, 'DeactivateAction', 'DeactivateAction', 'The act of stopping or deactivating a device or application (e.g. stopping a timer or turning off a flashlight).'),
(371, 1, 14, 'DefenceEstablishment', 'DefenceEstablishment', 'A defence establishment, such as an army or navy base.'),
(372, 1, 14, 'DefinedRegion', 'DefinedRegion', 'A DefinedRegion is a geographic area defined by potentially arbitrary (rather than political, administrative or natural geographical) criteria. Properties are provided for defining a region by reference to sets of postal codes.\n\nExamples: a delivery destination when shopping. Region where regional pricing is configured.\n\nRequirement 1:\nCountry: US\nStates: \"NY\", \"CA\"\n\nRequirement 2:\nCountry: US\nPostalCode Set: { [94000-94585], [97000, 97999], [13000, 13599]}\n{ [12345, 12345], [78945, 78945], }\nRegion = state, canton, prefecture, autonomous community...\n'),
(373, 1, 14, 'DefinedTerm', 'DefinedTerm', 'A word, name, acronym, phrase, etc. with a formal definition. Often used in the context of category or subject classification, glossaries or dictionaries, product or creative work types, etc. Use the name property for the term being defined, use termCode if the term has an alpha-numeric code allocated, use description to provide the definition of the term.'),
(374, 1, 14, 'DefinedTermSet', 'DefinedTermSet', 'A set of defined terms for example a set of categories or a classification scheme, a glossary, dictionary or enumeration.'),
(375, 1, 14, 'DeleteAction', 'DeleteAction', 'The act of editing a recipient by removing one of its objects.'),
(376, 1, 14, 'DeliveryChargeSpecification', 'DeliveryChargeSpecification', 'The price for the delivery of an offer using a particular delivery method.'),
(377, 1, 14, 'DeliveryEvent', 'DeliveryEvent', 'An event involving the delivery of an item.'),
(378, 1, 14, 'DeliveryMethod', 'DeliveryMethod', 'A delivery method is a standardized procedure for transferring the product or service to the destination of fulfillment chosen by the customer. Delivery methods are characterized by the means of transportation used, and by the organization or group that is the contracting party for the sending organization or person.\\\n\\\nCommonly used values:\\\n\\\n* http://purl.org/goodrelations/v1#DeliveryModeDirectDownload\\\n* http://purl.org/goodrelations/v1#DeliveryModeFreight\\\n* http://purl.org/goodrelations/v1#DeliveryModeMail\\\n* http://purl.org/goodrelations/v1#DeliveryModeOwnFleet\\\n* http://purl.org/goodrelations/v1#DeliveryModePickUp\\\n* http://purl.org/goodrelations/v1#DHL\\\n* http://purl.org/goodrelations/v1#FederalExpress\\\n* http://purl.org/goodrelations/v1#UPS\n        '),
(379, 1, 14, 'DeliveryTimeSettings', 'DeliveryTimeSettings', 'A DeliveryTimeSettings represents re-usable pieces of shipping information, relating to timing. It is designed for publication on an URL that may be referenced via the [[shippingSettingsLink]] property of a [[OfferShippingDetails]]. Several occurrences can be published, distinguished (and identified/referenced) by their different values for [[transitTimeLabel]].'),
(380, 1, 14, 'Demand', 'Demand', 'A demand entity represents the public, not necessarily binding, not necessarily exclusive, announcement by an organization or person to seek a certain type of goods or services. For describing demand using this type, the very same properties used for Offer apply.'),
(381, 1, 14, 'Dentist', 'Dentist', 'A dentist.'),
(382, 1, 14, 'DepartAction', 'DepartAction', 'The act of  departing from a place. An agent departs from an fromLocation for a destination, optionally with participants.'),
(383, 1, 14, 'DepartmentStore', 'DepartmentStore', 'A department store.'),
(384, 1, 14, 'DepositAccount', 'DepositAccount', 'A type of Bank Account with a main purpose of depositing funds to gain interest or other benefits.'),
(385, 1, 14, 'DiagnosticLab', 'DiagnosticLab', 'A medical laboratory that offers on-site or off-site diagnostic services.'),
(386, 1, 14, 'DiagnosticProcedure', 'DiagnosticProcedure', 'A medical procedure intended primarily for diagnostic, as opposed to therapeutic, purposes.'),
(387, 1, 14, 'Diet', 'Diet', 'A strategy of regulating the intake of food to achieve or maintain a specific health-related goal.'),
(388, 1, 14, 'DietarySupplement', 'DietarySupplement', 'A product taken by mouth that contains a dietary ingredient intended to supplement the diet. Dietary ingredients may include vitamins, minerals, herbs or other botanicals, amino acids, and substances such as enzymes, organ tissues, glandulars and metabolites.'),
(389, 1, 14, 'DigitalDocument', 'DigitalDocument', 'An electronic file or document.'),
(390, 1, 14, 'DigitalDocumentPermission', 'DigitalDocumentPermission', 'A permission for a particular person or group to access a particular file.'),
(391, 1, 14, 'DigitalDocumentPermissionType', 'DigitalDocumentPermissionType', 'A type of permission which can be granted for accessing a digital document.'),
(392, 1, 14, 'DisagreeAction', 'DisagreeAction', 'The act of expressing a difference of opinion with the object. An agent disagrees to/about an object (a proposition, topic or theme) with participants.'),
(393, 1, 14, 'DiscoverAction', 'DiscoverAction', 'The act of discovering/finding an object.'),
(394, 1, 14, 'DiscussionForumPosting', 'DiscussionForumPosting', 'A posting to a discussion forum.'),
(395, 1, 14, 'DislikeAction', 'DislikeAction', 'The act of expressing a negative sentiment about the object. An agent dislikes an object (a proposition, topic or theme) with participants.'),
(396, 1, 14, 'Distance', 'Distance', 'Properties that take Distances as values are of the form \'&lt;Number&gt; &lt;Length unit of measure&gt;\'. E.g., \'7 ft\'.'),
(397, 1, 14, 'Distillery', 'Distillery', 'A distillery.'),
(398, 1, 14, 'DonateAction', 'DonateAction', 'The act of providing goods, services, or money without compensation, often for philanthropic reasons.'),
(399, 1, 14, 'DoseSchedule', 'DoseSchedule', 'A specific dosing schedule for a drug or supplement.'),
(400, 1, 14, 'DownloadAction', 'DownloadAction', 'The act of downloading an object.'),
(401, 1, 14, 'DrawAction', 'DrawAction', 'The act of producing a visual/graphical representation of an object, typically with a pen/pencil and paper as instruments.'),
(402, 1, 14, 'Drawing', 'Drawing', 'A picture or diagram made with a pencil, pen, or crayon rather than paint.'),
(403, 1, 14, 'DrinkAction', 'DrinkAction', 'The act of swallowing liquids.'),
(404, 1, 14, 'DriveWheelConfigurationValue', 'DriveWheelConfigurationValue', 'A value indicating which roadwheels will receive torque.'),
(405, 1, 14, 'Drug', 'Drug', 'A chemical or biologic substance, used as a medical therapy, that has a physiological effect on an organism. Here the term drug is used interchangeably with the term medicine although clinical knowledge make a clear difference between them.'),
(406, 1, 14, 'DrugClass', 'DrugClass', 'A class of medical drugs, e.g., statins. Classes can represent general pharmacological class, common mechanisms of action, common physiological effects, etc.'),
(407, 1, 14, 'DrugCost', 'DrugCost', 'The cost per unit of a medical drug. Note that this type is not meant to represent the price in an offer of a drug for sale; see the Offer type for that. This type will typically be used to tag wholesale or average retail cost of a drug, or maximum reimbursable cost. Costs of medical drugs vary widely depending on how and where they are paid for, so while this type captures some of the variables, costs should be used with caution by consumers of this schema\'s markup.'),
(408, 1, 14, 'DrugCostCategory', 'DrugCostCategory', 'Enumerated categories of medical drug costs.'),
(409, 1, 14, 'DrugLegalStatus', 'DrugLegalStatus', 'The legal availability status of a medical drug.'),
(410, 1, 14, 'DrugPregnancyCategory', 'DrugPregnancyCategory', 'Categories that represent an assessment of the risk of fetal injury due to a drug or pharmaceutical used as directed by the mother during pregnancy.'),
(411, 1, 14, 'DrugPrescriptionStatus', 'DrugPrescriptionStatus', 'Indicates whether this drug is available by prescription or over-the-counter.'),
(412, 1, 14, 'DrugStrength', 'DrugStrength', 'A specific strength in which a medical drug is available in a specific country.'),
(413, 1, 14, 'DryCleaningOrLaundry', 'DryCleaningOrLaundry', 'A dry-cleaning business.'),
(414, 1, 14, 'Duration', 'Duration', 'Quantity: Duration (use [ISO 8601 duration format](http://en.wikipedia.org/wiki/ISO_8601)).'),
(415, 1, 14, 'EUEnergyEfficiencyEnumeration', 'EUEnergyEfficiencyEnumeration', 'Enumerates the EU energy efficiency classes A-G as well as A+, A++, and A+++ as defined in EU directive 2017/1369'),
(416, 1, 14, 'EatAction', 'EatAction', 'The act of swallowing solid objects.'),
(417, 1, 14, 'EducationEvent', 'EducationEvent', 'Event type: Education event.'),
(418, 1, 14, 'EducationalAudience', 'EducationalAudience', 'An EducationalAudience.'),
(419, 1, 14, 'EducationalOccupationalCredential', 'EducationalOccupationalCredential', 'An educational or occupational credential. A diploma, academic degree, certification, qualification, badge, etc., that may be awarded to a person or other entity that meets the requirements defined by the credentialer.'),
(420, 1, 14, 'EducationalOccupationalProgram', 'EducationalOccupationalProgram', 'A program offered by an institution which determines the learning progress to achieve an outcome, usually a credential like a degree or certificate. This would define a discrete set of opportunities (e.g., job, courses) that together constitute a program with a clear start, end, set of requirements, and transition to a new occupational opportunity (e.g., a job), or sometimes a higher educational opportunity (e.g., an advanced degree).'),
(421, 1, 14, 'EducationalOrganization', 'EducationalOrganization', 'An educational organization.'),
(422, 1, 14, 'Electrician', 'Electrician', 'An electrician.'),
(423, 1, 14, 'ElectronicsStore', 'ElectronicsStore', 'An electronics store.'),
(424, 1, 14, 'ElementarySchool', 'ElementarySchool', 'An elementary school.'),
(425, 1, 14, 'EmailMessage', 'EmailMessage', 'An email message.'),
(426, 1, 14, 'Embassy', 'Embassy', 'An embassy.'),
(427, 1, 14, 'EmergencyService', 'EmergencyService', 'An emergency service, such as a fire station or ER.'),
(428, 1, 14, 'EmployeeRole', 'EmployeeRole', 'A subclass of OrganizationRole used to describe employee relationships.'),
(429, 1, 14, 'EmployerAggregateRating', 'EmployerAggregateRating', 'An aggregate rating of an Organization related to its role as an employer.'),
(430, 1, 14, 'EmployerReview', 'EmployerReview', 'An [[EmployerReview]] is a review of an [[Organization]] regarding its role as an employer, written by a current or former employee of that organization.'),
(431, 1, 14, 'EmploymentAgency', 'EmploymentAgency', 'An employment agency.'),
(432, 1, 14, 'EndorseAction', 'EndorseAction', 'An agent approves/certifies/likes/supports/sanction an object.'),
(433, 1, 14, 'EndorsementRating', 'EndorsementRating', 'An EndorsementRating is a rating that expresses some level of endorsement, for example inclusion in a \"critic\'s pick\" blog, a\n\"Like\" or \"+1\" on a social network. It can be considered the [[result]] of an [[EndorseAction]] in which the [[object]] of the action is rated positively by\nsome [[agent]]. As is common elsewhere in schema.org, it is sometimes more useful to describe the results of such an action without explicitly describing the [[Action]].\n\nAn [[EndorsementRating]] may be part of a numeric scale or organized system, but this is not required: having an explicit type for indicating a positive,\nendorsement rating is particularly useful in the absence of numeric scales as it helps consumers understand that the rating is broadly positive.\n'),
(434, 1, 14, 'Energy', 'Energy', 'Properties that take Energy as values are of the form \'&lt;Number&gt; &lt;Energy unit of measure&gt;\'.'),
(435, 1, 14, 'EnergyConsumptionDetails', 'EnergyConsumptionDetails', 'EnergyConsumptionDetails represents information related to the energy efficiency of a product that consumes energy. The information that can be provided is based on international regulations such as for example [EU directive 2017/1369](https://eur-lex.europa.eu/eli/reg/2017/1369/oj) for energy labeling and the [Energy labeling rule](https://www.ftc.gov/enforcement/rules/rulemaking-regulatory-reform-proceedings/energy-water-use-labeling-consumer) under the Energy Policy and Conservation Act (EPCA) in the US'),
(436, 1, 14, 'EnergyEfficiencyEnumeration', 'EnergyEfficiencyEnumeration', 'Enumerates energy efficiency levels (also known as \"classes\" or \"ratings\") and certifications that are part of several international energy efficiency standards.'),
(437, 1, 14, 'EnergyStarEnergyEfficiencyEnumeration', 'EnergyStarEnergyEfficiencyEnumeration', 'Used to indicate whether a product is EnergyStar certified'),
(438, 1, 14, 'EngineSpecification', 'EngineSpecification', 'Information about the engine of the vehicle. A vehicle can have multiple engines represented by multiple engine specification entities.'),
(439, 1, 14, 'EntertainmentBusiness', 'EntertainmentBusiness', 'A business providing entertainment.'),
(440, 1, 14, 'EntryPoint', 'EntryPoint', 'An entry point, within some Web-based protocol.'),
(441, 1, 14, 'Enumeration', 'Enumeration', 'Lists or enumerations—for example, a list of cuisines or music genres, etc.'),
(442, 1, 14, 'Episode', 'Episode', 'A media episode (e.g. TV, radio, video game) which can be part of a series or season.'),
(443, 1, 14, 'Event', 'Event', 'An event happening at a certain time and location, such as a concert, lecture, or festival. Ticketing information may be added via the [[offers]] property. Repeated events may be structured as separate Event objects.'),
(444, 1, 14, 'EventAttendanceModeEnumeration', 'EventAttendanceModeEnumeration', 'An EventAttendanceModeEnumeration value is one of potentially several modes of organising an event, relating to whether it is online or offline.'),
(445, 1, 14, 'EventReservation', 'EventReservation', 'A reservation for an event like a concert, sporting event, or lecture.\\\n\\\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use [[Offer]].'),
(446, 1, 14, 'EventSeries', 'EventSeries', 'A series of [[Event]]s. Included events can relate with the series using the [[superEvent]] property.\n\nAn EventSeries is a collection of events that share some unifying characteristic. For example, \"The Olympic Games\" is a series, which\nis repeated regularly. The \"2012 London Olympics\" can be presented both as an [[Event]] in the series \"Olympic Games\", and as an\n[[EventSeries]] that included a number of sporting competitions as Events.\n\nThe nature of the association between the events in an [[EventSeries]] can vary, but typical examples could\ninclude a thematic event series (e.g. topical meetups or classes), or a series of regular events that share a location, attendee group and/or organizers.\n\nEventSeries has been defined as a kind of Event to make it easy for publishers to use it in an Event context without\nworrying about which kinds of series are really event-like enough to call an Event. In general an EventSeries\nmay seem more Event-like when the period of time is compact and when aspects such as location are fixed, but\nit may also sometimes prove useful to describe a longer-term series as an Event.\n   '),
(447, 1, 14, 'EventStatusType', 'EventStatusType', 'EventStatusType is an enumeration type whose instances represent several states that an Event may be in.'),
(448, 1, 14, 'EventVenue', 'EventVenue', 'An event venue.'),
(449, 1, 14, 'ExchangeRateSpecification', 'ExchangeRateSpecification', 'A structured value representing exchange rate.'),
(450, 1, 14, 'ExerciseAction', 'ExerciseAction', 'The act of participating in exertive activity for the purposes of improving health and fitness.'),
(451, 1, 14, 'ExerciseGym', 'ExerciseGym', 'A gym.'),
(452, 1, 14, 'ExercisePlan', 'ExercisePlan', 'Fitness-related activity designed for a specific health-related purpose, including defined exercise routines as well as activity prescribed by a clinician.'),
(453, 1, 14, 'ExhibitionEvent', 'ExhibitionEvent', 'Event type: Exhibition event, e.g. at a museum, library, archive, tradeshow, ...'),
(454, 1, 14, 'FAQPage', 'FAQPage', 'A [[FAQPage]] is a [[WebPage]] presenting one or more \"[Frequently asked questions](https://en.wikipedia.org/wiki/FAQ)\" (see also [[QAPage]]).'),
(455, 1, 14, 'FMRadioChannel', 'FMRadioChannel', 'A radio channel that uses FM.'),
(456, 1, 14, 'FastFoodRestaurant', 'FastFoodRestaurant', 'A fast-food restaurant.'),
(457, 1, 14, 'Festival', 'Festival', 'Event type: Festival.'),
(458, 1, 14, 'FilmAction', 'FilmAction', 'The act of capturing sound and moving images on film, video, or digitally.'),
(459, 1, 14, 'FinancialProduct', 'FinancialProduct', 'A product provided to consumers and businesses by financial institutions such as banks, insurance companies, brokerage firms, consumer finance companies, and investment companies which comprise the financial services industry.'),
(460, 1, 14, 'FinancialService', 'FinancialService', 'Financial services business.'),
(461, 1, 14, 'FindAction', 'FindAction', 'The act of finding an object.\\\n\\\nRelated actions:\\\n\\\n* [[SearchAction]]: FindAction is generally lead by a SearchAction, but not necessarily.'),
(462, 1, 14, 'FireStation', 'FireStation', 'A fire station. With firemen.'),
(463, 1, 14, 'Flight', 'Flight', 'An airline flight.'),
(464, 1, 14, 'FlightReservation', 'FlightReservation', 'A reservation for air travel.\\\n\\\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, use [[Offer]].'),
(465, 1, 14, 'Float', 'Float', 'Data type: Floating number.'),
(466, 1, 14, 'FloorPlan', 'FloorPlan', 'A FloorPlan is an explicit representation of a collection of similar accommodations, allowing the provision of common information (room counts, sizes, layout diagrams) and offers for rental or sale. In typical use, some [[ApartmentComplex]] has an [[accommodationFloorPlan]] which is a [[FloorPlan]].  A FloorPlan is always in the context of a particular place, either a larger [[ApartmentComplex]] or a single [[Apartment]]. The visual/spatial aspects of a floor plan (i.e. room layout, [see wikipedia](https://en.wikipedia.org/wiki/Floor_plan)) can be indicated using [[image]]. '),
(467, 1, 14, 'Florist', 'Florist', 'A florist.'),
(468, 1, 14, 'FollowAction', 'FollowAction', 'The act of forming a personal connection with someone/something (object) unidirectionally/asymmetrically to get updates polled from.\\\n\\\nRelated actions:\\\n\\\n* [[BefriendAction]]: Unlike BefriendAction, FollowAction implies that the connection is *not* necessarily reciprocal.\\\n* [[SubscribeAction]]: Unlike SubscribeAction, FollowAction implies that the follower acts as an active agent constantly/actively polling for updates.\\\n* [[RegisterAction]]: Unlike RegisterAction, FollowAction implies that the agent is interested in continuing receiving updates from the object.\\\n* [[JoinAction]]: Unlike JoinAction, FollowAction implies that the agent is interested in getting updates from the object.\\\n* [[TrackAction]]: Unlike TrackAction, FollowAction refers to the polling of updates of all aspects of animate objects rather than the location of inanimate objects (e.g. you track a package, but you don\'t follow it).'),
(469, 1, 14, 'FoodEstablishment', 'FoodEstablishment', 'A food-related business.'),
(470, 1, 14, 'FoodEstablishmentReservation', 'FoodEstablishmentReservation', 'A reservation to dine at a food-related business.\\\n\\\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),
(471, 1, 14, 'FoodEvent', 'FoodEvent', 'Event type: Food event.'),
(472, 1, 14, 'FoodService', 'FoodService', 'A food service, like breakfast, lunch, or dinner.'),
(473, 1, 14, 'FundingAgency', 'FundingAgency', 'A FundingAgency is an organization that implements one or more [[FundingScheme]]s and manages\n    the granting process (via [[Grant]]s, typically [[MonetaryGrant]]s).\n    A funding agency is not always required for grant funding, e.g. philanthropic giving, corporate sponsorship etc.\n    \nExamples of funding agencies include ERC, REA, NIH, Bill and Melinda Gates Foundation...\n    '),
(474, 1, 14, 'FundingScheme', 'FundingScheme', 'A FundingScheme combines organizational, project and policy aspects of grant-based funding\n    that sets guidelines, principles and mechanisms to support other kinds of projects and activities.\n    Funding is typically organized via [[Grant]] funding. Examples of funding schemes: Swiss Priority Programmes (SPPs); EU Framework 7 (FP7); Horizon 2020; the NIH-R01 Grant Program; Wellcome institutional strategic support fund. For large scale public sector funding, the management and administration of grant awards is often handled by other, dedicated, organizations - [[FundingAgency]]s such as ERC, REA, ...'),
(475, 1, 14, 'FurnitureStore', 'FurnitureStore', 'A furniture store.'),
(476, 1, 14, 'Game', 'Game', 'The Game type represents things which are games. These are typically rule-governed recreational activities, e.g. role-playing games in which players assume the role of characters in a fictional setting.'),
(477, 1, 14, 'GamePlayMode', 'GamePlayMode', 'Indicates whether this game is multi-player, co-op or single-player.'),
(478, 1, 14, 'GameServer', 'GameServer', 'Server that provides game interaction in a multiplayer game.'),
(479, 1, 14, 'GameServerStatus', 'GameServerStatus', 'Status of a game server.'),
(480, 1, 14, 'GardenStore', 'GardenStore', 'A garden store.'),
(481, 1, 14, 'GasStation', 'GasStation', 'A gas station.'),
(482, 1, 14, 'GatedResidenceCommunity', 'GatedResidenceCommunity', 'Residence type: Gated community.'),
(483, 1, 14, 'GenderType', 'GenderType', 'An enumeration of genders.'),
(484, 1, 14, 'GeneralContractor', 'GeneralContractor', 'A general contractor.'),
(485, 1, 14, 'GeoCircle', 'GeoCircle', 'A GeoCircle is a GeoShape representing a circular geographic area. As it is a GeoShape\n          it provides the simple textual property \'circle\', but also allows the combination of postalCode alongside geoRadius.\n          The center of the circle can be indicated via the \'geoMidpoint\' property, or more approximately using \'address\', \'postalCode\'.\n       '),
(486, 1, 14, 'GeoCoordinates', 'GeoCoordinates', 'The geographic coordinates of a place or event.'),
(487, 1, 14, 'GeoShape', 'GeoShape', 'The geographic shape of a place. A GeoShape can be described using several properties whose values are based on latitude/longitude pairs. Either whitespace or commas can be used to separate latitude and longitude; whitespace should be used when writing a list of several such points.'),
(488, 1, 14, 'GeospatialGeometry', 'GeospatialGeometry', '(Eventually to be defined as) a supertype of GeoShape designed to accommodate definitions from Geo-Spatial best practices.'),
(489, 1, 14, 'GiveAction', 'GiveAction', 'The act of transferring ownership of an object to a destination. Reciprocal of TakeAction.\\\n\\\nRelated actions:\\\n\\\n* [[TakeAction]]: Reciprocal of GiveAction.\\\n* [[SendAction]]: Unlike SendAction, GiveAction implies that ownership is being transferred (e.g. I may send my laptop to you, but that doesn\'t mean I\'m giving it to you).'),
(490, 1, 14, 'GolfCourse', 'GolfCourse', 'A golf course.'),
(491, 1, 14, 'GovernmentBenefitsType', 'GovernmentBenefitsType', 'GovernmentBenefitsType enumerates several kinds of government benefits to support the COVID-19 situation. Note that this structure may not capture all benefits offered.'),
(492, 1, 14, 'GovernmentBuilding', 'GovernmentBuilding', 'A government building.'),
(493, 1, 14, 'GovernmentOffice', 'GovernmentOffice', 'A government office&#x2014;for example, an IRS or DMV office.'),
(494, 1, 14, 'GovernmentOrganization', 'GovernmentOrganization', 'A governmental organization or agency.'),
(495, 1, 14, 'GovernmentPermit', 'GovernmentPermit', 'A permit issued by a government agency.'),
(496, 1, 14, 'GovernmentService', 'GovernmentService', 'A service provided by a government organization, e.g. food stamps, veterans benefits, etc.'),
(497, 1, 14, 'Grant', 'Grant', 'A grant, typically financial or otherwise quantifiable, of resources. Typically a [[funder]] sponsors some [[MonetaryAmount]] to an [[Organization]] or [[Person]],\n    sometimes not necessarily via a dedicated or long-lived [[Project]], resulting in one or more outputs, or [[fundedItem]]s. For financial sponsorship, indicate the [[funder]] of a [[MonetaryGrant]]. For non-financial support, indicate [[sponsor]] of [[Grant]]s of resources (e.g. office space).\n\nGrants support  activities directed towards some agreed collective goals, often but not always organized as [[Project]]s. Long-lived projects are sometimes sponsored by a variety of grants over time, but it is also common for a project to be associated with a single grant.\n\nThe amount of a [[Grant]] is represented using [[amount]] as a [[MonetaryAmount]].\n    '),
(498, 1, 14, 'GroceryStore', 'GroceryStore', 'A grocery store.'),
(499, 1, 14, 'Guide', 'Guide', '[[Guide]] is a page or article that recommend specific products or services, or aspects of a thing for a user to consider. A [[Guide]] may represent a Buying Guide and detail aspects of products or services for a user to consider. A [[Guide]] may represent a Product Guide and recommend specific products or services. A [[Guide]] may represent a Ranked List and recommend specific products or services with ranking.'),
(500, 1, 14, 'HVACBusiness', 'HVACBusiness', 'A business that provide Heating, Ventilation and Air Conditioning services.'),
(501, 1, 14, 'Hackathon', 'Hackathon', 'A [hackathon](https://en.wikipedia.org/wiki/Hackathon) event.'),
(502, 1, 14, 'HairSalon', 'HairSalon', 'A hair salon.'),
(503, 1, 14, 'HardwareStore', 'HardwareStore', 'A hardware store.'),
(504, 1, 14, 'HealthAndBeautyBusiness', 'HealthAndBeautyBusiness', 'Health and beauty.'),
(505, 1, 14, 'HealthAspectEnumeration', 'HealthAspectEnumeration', 'HealthAspectEnumeration enumerates several aspects of health content online, each of which might be described using [[hasHealthAspect]] and [[HealthTopicContent]].'),
(506, 1, 14, 'HealthClub', 'HealthClub', 'A health club.'),
(507, 1, 14, 'HealthInsurancePlan', 'HealthInsurancePlan', 'A US-style health insurance plan, including PPOs, EPOs, and HMOs. '),
(508, 1, 14, 'HealthPlanCostSharingSpecification', 'HealthPlanCostSharingSpecification', 'A description of costs to the patient under a given network or formulary.'),
(509, 1, 14, 'HealthPlanFormulary', 'HealthPlanFormulary', 'For a given health insurance plan, the specification for costs and coverage of prescription drugs. '),
(510, 1, 14, 'HealthPlanNetwork', 'HealthPlanNetwork', 'A US-style health insurance plan network. '),
(511, 1, 14, 'HealthTopicContent', 'HealthTopicContent', '[[HealthTopicContent]] is [[WebContent]] that is about some aspect of a health topic, e.g. a condition, its symptoms or treatments. Such content may be comprised of several parts or sections and use different types of media. Multiple instances of [[WebContent]] (and hence [[HealthTopicContent]]) can be related using [[hasPart]] / [[isPartOf]] where there is some kind of content hierarchy, and their content described with [[about]] and [[mentions]] e.g. building upon the existing [[MedicalCondition]] vocabulary.\n  '),
(512, 1, 14, 'HighSchool', 'HighSchool', 'A high school.'),
(513, 1, 14, 'HinduTemple', 'HinduTemple', 'A Hindu temple.'),
(514, 1, 14, 'HobbyShop', 'HobbyShop', 'A store that sells materials useful or necessary for various hobbies.'),
(515, 1, 14, 'HomeAndConstructionBusiness', 'HomeAndConstructionBusiness', 'A construction business.\\\n\\\nA HomeAndConstructionBusiness is a [[LocalBusiness]] that provides services around homes and buildings.\\\n\\\nAs a [[LocalBusiness]] it can be described as a [[provider]] of one or more [[Service]]\\\\(s).'),
(516, 1, 14, 'HomeGoodsStore', 'HomeGoodsStore', 'A home goods store.'),
(517, 1, 14, 'Hospital', 'Hospital', 'A hospital.'),
(518, 1, 14, 'Hostel', 'Hostel', 'A hostel - cheap accommodation, often in shared dormitories.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(519, 1, 14, 'Hotel', 'Hotel', 'A hotel is an establishment that provides lodging paid on a short-term basis (Source: Wikipedia, the free encyclopedia, see http://en.wikipedia.org/wiki/Hotel).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(520, 1, 14, 'HotelRoom', 'HotelRoom', 'A hotel room is a single room in a hotel.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(521, 1, 14, 'House', 'House', 'A house is a building or structure that has the ability to be occupied for habitation by humans or other creatures (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/House\">http://en.wikipedia.org/wiki/House</a>).'),
(522, 1, 14, 'HousePainter', 'HousePainter', 'A house painting service.'),
(523, 1, 14, 'HowTo', 'HowTo', 'Instructions that explain how to achieve a result by performing a sequence of steps.'),
(524, 1, 14, 'HowToDirection', 'HowToDirection', 'A direction indicating a single action to do in the instructions for how to achieve a result.'),
(525, 1, 14, 'HowToItem', 'HowToItem', 'An item used as either a tool or supply when performing the instructions for how to to achieve a result.'),
(526, 1, 14, 'HowToSection', 'HowToSection', 'A sub-grouping of steps in the instructions for how to achieve a result (e.g. steps for making a pie crust within a pie recipe).'),
(527, 1, 14, 'HowToStep', 'HowToStep', 'A step in the instructions for how to achieve a result. It is an ordered list with HowToDirection and/or HowToTip items.'),
(528, 1, 14, 'HowToSupply', 'HowToSupply', 'A supply consumed when performing the instructions for how to achieve a result.'),
(529, 1, 14, 'HowToTip', 'HowToTip', 'An explanation in the instructions for how to achieve a result. It provides supplementary information about a technique, supply, author\'s preference, etc. It can explain what could be done, or what should not be done, but doesn\'t specify what should be done (see HowToDirection).'),
(530, 1, 14, 'HowToTool', 'HowToTool', 'A tool used (but not consumed) when performing instructions for how to achieve a result.'),
(531, 1, 14, 'HyperToc', 'HyperToc', 'A HyperToc represents a hypertext table of contents for complex media objects, such as [[VideoObject]], [[AudioObject]]. Items in the table of contents are indicated using the [[tocEntry]] property, and typed [[HyperTocEntry]]. For cases where the same larger work is split into multiple files, [[associatedMedia]] can be used on individual [[HyperTocEntry]] items.'),
(532, 1, 14, 'HyperTocEntry', 'HyperTocEntry', 'A HyperToEntry is an item within a [[HyperToc]], which represents a hypertext table of contents for complex media objects, such as [[VideoObject]], [[AudioObject]]. The media object itself is indicated using [[associatedMedia]]. Each section of interest within that content can be described with a [[HyperTocEntry]], with associated [[startOffset]] and [[endOffset]]. When several entries are all from the same file, [[associatedMedia]] is used on the overarching [[HyperTocEntry]]; if the content has been split into multiple files, they can be referenced using [[associatedMedia]] on each [[HyperTocEntry]].'),
(533, 1, 14, 'IceCreamShop', 'IceCreamShop', 'An ice cream shop.'),
(534, 1, 14, 'IgnoreAction', 'IgnoreAction', 'The act of intentionally disregarding the object. An agent ignores an object.'),
(535, 1, 14, 'ImageGallery', 'ImageGallery', 'Web page type: Image gallery page.'),
(536, 1, 14, 'ImageObject', 'ImageObject', 'An image file.'),
(537, 1, 14, 'ImagingTest', 'ImagingTest', 'Any medical imaging modality typically used for diagnostic purposes.'),
(538, 1, 14, 'IndividualProduct', 'IndividualProduct', 'A single, identifiable product instance (e.g. a laptop with a particular serial number).'),
(539, 1, 14, 'InfectiousAgentClass', 'InfectiousAgentClass', 'Classes of agents or pathogens that transmit infectious diseases. Enumerated type.'),
(540, 1, 14, 'InfectiousDisease', 'InfectiousDisease', 'An infectious disease is a clinically evident human disease resulting from the presence of pathogenic microbial agents, like pathogenic viruses, pathogenic bacteria, fungi, protozoa, multicellular parasites, and prions. To be considered an infectious disease, such pathogens are known to be able to cause this disease.'),
(541, 1, 14, 'InformAction', 'InformAction', 'The act of notifying someone of information pertinent to them, with no expectation of a response.'),
(542, 1, 14, 'InsertAction', 'InsertAction', 'The act of adding at a specific location in an ordered collection.'),
(543, 1, 14, 'InstallAction', 'InstallAction', 'The act of installing an application.'),
(544, 1, 14, 'InsuranceAgency', 'InsuranceAgency', 'An Insurance agency.'),
(545, 1, 14, 'Intangible', 'Intangible', 'A utility class that serves as the umbrella for a number of \'intangible\' things such as quantities, structured values, etc.'),
(546, 1, 14, 'Integer', 'Integer', 'Data type: Integer.'),
(547, 1, 14, 'InteractAction', 'InteractAction', 'The act of interacting with another person or organization.'),
(548, 1, 14, 'InteractionCounter', 'InteractionCounter', 'A summary of how users have interacted with this CreativeWork. In most cases, authors will use a subtype to specify the specific type of interaction.'),
(549, 1, 14, 'InternetCafe', 'InternetCafe', 'An internet cafe.'),
(550, 1, 14, 'InvestmentFund', 'InvestmentFund', 'A company or fund that gathers capital from a number of investors to create a pool of money that is then re-invested into stocks, bonds and other assets.'),
(551, 1, 14, 'InvestmentOrDeposit', 'InvestmentOrDeposit', 'A type of financial product that typically requires the client to transfer funds to a financial service in return for potential beneficial financial return.'),
(552, 1, 14, 'InviteAction', 'InviteAction', 'The act of asking someone to attend an event. Reciprocal of RsvpAction.'),
(553, 1, 14, 'Invoice', 'Invoice', 'A statement of the money due for goods or services; a bill.'),
(554, 1, 14, 'ItemAvailability', 'ItemAvailability', 'A list of possible product availability options.'),
(555, 1, 14, 'ItemList', 'ItemList', 'A list of items of any sort&#x2014;for example, Top 10 Movies About Weathermen, or Top 100 Party Songs. Not to be confused with HTML lists, which are often used only for formatting.'),
(556, 1, 14, 'ItemListOrderType', 'ItemListOrderType', 'Enumerated for values for itemListOrder for indicating how an ordered ItemList is organized.'),
(557, 1, 14, 'ItemPage', 'ItemPage', 'A page devoted to a single item, such as a particular product or hotel.'),
(558, 1, 14, 'JewelryStore', 'JewelryStore', 'A jewelry store.'),
(559, 1, 14, 'JobPosting', 'JobPosting', 'A listing that describes a job opening in a certain organization.'),
(560, 1, 14, 'JoinAction', 'JoinAction', 'An agent joins an event/group with participants/friends at a location.\\\n\\\nRelated actions:\\\n\\\n* [[RegisterAction]]: Unlike RegisterAction, JoinAction refers to joining a group/team of people.\\\n* [[SubscribeAction]]: Unlike SubscribeAction, JoinAction does not imply that you\'ll be receiving updates.\\\n* [[FollowAction]]: Unlike FollowAction, JoinAction does not imply that you\'ll be polling for updates.'),
(561, 1, 14, 'Joint', 'Joint', 'The anatomical location at which two or more bones make contact.'),
(562, 1, 14, 'LakeBodyOfWater', 'LakeBodyOfWater', 'A lake (for example, Lake Pontrachain).'),
(563, 1, 14, 'Landform', 'Landform', 'A landform or physical feature.  Landform elements include mountains, plains, lakes, rivers, seascape and oceanic waterbody interface features such as bays, peninsulas, seas and so forth, including sub-aqueous terrain features such as submersed mountain ranges, volcanoes, and the great ocean basins.'),
(564, 1, 14, 'LandmarksOrHistoricalBuildings', 'LandmarksOrHistoricalBuildings', 'An historical landmark or building.');
INSERT INTO `resource_class` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(565, 1, 14, 'Language', 'Language', 'Natural languages such as Spanish, Tamil, Hindi, English, etc. Formal language code tags expressed in [BCP 47](https://en.wikipedia.org/wiki/IETF_language_tag) can be used via the [[alternateName]] property. The Language type previously also covered programming languages such as Scheme and Lisp, which are now best represented using [[ComputerLanguage]].'),
(566, 1, 14, 'LearningResource', 'LearningResource', 'The LearningResource type can be used to indicate [[CreativeWork]]s (whether physical or digital) that have a particular and explicit orientation towards learning, education, skill acquisition, and other educational purposes.\n\n[[LearningResource]] is expected to be used as an addition to a primary type such as [[Book]], [[Video]], [[Product]] etc.\n\n[[EducationEvent]] serves a similar purpose for event-like things (e.g. a [[Trip]]). A [[LearningResource]] may be created as a result of an [[EducationEvent]], for example by recording one.'),
(567, 1, 14, 'LeaveAction', 'LeaveAction', 'An agent leaves an event / group with participants/friends at a location.\\\n\\\nRelated actions:\\\n\\\n* [[JoinAction]]: The antonym of LeaveAction.\\\n* [[UnRegisterAction]]: Unlike UnRegisterAction, LeaveAction implies leaving a group/team of people rather than a service.'),
(568, 1, 14, 'LegalForceStatus', 'LegalForceStatus', 'A list of possible statuses for the legal force of a legislation.'),
(569, 1, 14, 'LegalService', 'LegalService', 'A LegalService is a business that provides legally-oriented services, advice and representation, e.g. law firms.\\\n\\\nAs a [[LocalBusiness]] it can be described as a [[provider]] of one or more [[Service]]\\\\(s).'),
(570, 1, 14, 'LegalValueLevel', 'LegalValueLevel', 'A list of possible levels for the legal validity of a legislation.'),
(571, 1, 14, 'Legislation', 'Legislation', 'A legal document such as an act, decree, bill, etc. (enforceable or not) or a component of a legal act (like an article).'),
(572, 1, 14, 'LegislationObject', 'LegislationObject', 'A specific object or file containing a Legislation. Note that the same Legislation can be published in multiple files. For example, a digitally signed PDF, a plain PDF and an HTML version.'),
(573, 1, 14, 'LegislativeBuilding', 'LegislativeBuilding', 'A legislative building&#x2014;for example, the state capitol.'),
(574, 1, 14, 'LendAction', 'LendAction', 'The act of providing an object under an agreement that it will be returned at a later date. Reciprocal of BorrowAction.\\\n\\\nRelated actions:\\\n\\\n* [[BorrowAction]]: Reciprocal of LendAction.'),
(575, 1, 14, 'Library', 'Library', 'A library.'),
(576, 1, 14, 'LibrarySystem', 'LibrarySystem', 'A [[LibrarySystem]] is a collaborative system amongst several libraries.'),
(577, 1, 14, 'LifestyleModification', 'LifestyleModification', 'A process of care involving exercise, changes to diet, fitness routines, and other lifestyle changes aimed at improving a health condition.'),
(578, 1, 14, 'Ligament', 'Ligament', 'A short band of tough, flexible, fibrous connective tissue that functions to connect multiple bones, cartilages, and structurally support joints.'),
(579, 1, 14, 'LikeAction', 'LikeAction', 'The act of expressing a positive sentiment about the object. An agent likes an object (a proposition, topic or theme) with participants.'),
(580, 1, 14, 'LinkRole', 'LinkRole', 'A Role that represents a Web link e.g. as expressed via the \'url\' property. Its linkRelationship property can indicate URL-based and plain textual link types e.g. those in IANA link registry or others such as \'amphtml\'. This structure provides a placeholder where details from HTML\'s link element can be represented outside of HTML, e.g. in JSON-LD feeds.'),
(581, 1, 14, 'LiquorStore', 'LiquorStore', 'A shop that sells alcoholic drinks such as wine, beer, whisky and other spirits.'),
(582, 1, 14, 'ListItem', 'ListItem', 'An list item, e.g. a step in a checklist or how-to description.'),
(583, 1, 14, 'ListenAction', 'ListenAction', 'The act of consuming audio content.'),
(584, 1, 14, 'LiteraryEvent', 'LiteraryEvent', 'Event type: Literary event.'),
(585, 1, 14, 'LiveBlogPosting', 'LiveBlogPosting', 'A blog post intended to provide a rolling textual coverage of an ongoing event through continuous updates.'),
(586, 1, 14, 'LoanOrCredit', 'LoanOrCredit', 'A financial product for the loaning of an amount of money, or line of credit, under agreed terms and charges.'),
(587, 1, 14, 'LocalBusiness', 'LocalBusiness', 'A particular physical business or branch of an organization. Examples of LocalBusiness include a restaurant, a particular branch of a restaurant chain, a branch of a bank, a medical practice, a club, a bowling alley, etc.'),
(588, 1, 14, 'LocationFeatureSpecification', 'LocationFeatureSpecification', 'Specifies a location feature by providing a structured value representing a feature of an accommodation as a property-value pair of varying degrees of formality.'),
(589, 1, 14, 'Locksmith', 'Locksmith', 'A locksmith.'),
(590, 1, 14, 'LodgingBusiness', 'LodgingBusiness', 'A lodging business, such as a motel, hotel, or inn.'),
(591, 1, 14, 'LodgingReservation', 'LodgingReservation', 'A reservation for lodging at a hotel, motel, inn, etc.\\\n\\\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),
(592, 1, 14, 'LoseAction', 'LoseAction', 'The act of being defeated in a competitive activity.'),
(593, 1, 14, 'LymphaticVessel', 'LymphaticVessel', 'A type of blood vessel that specifically carries lymph fluid unidirectionally toward the heart.'),
(594, 1, 14, 'Manuscript', 'Manuscript', 'A book, document, or piece of music written by hand rather than typed or printed.'),
(595, 1, 14, 'Map', 'Map', 'A map.'),
(596, 1, 14, 'MapCategoryType', 'MapCategoryType', 'An enumeration of several kinds of Map.'),
(597, 1, 14, 'MarryAction', 'MarryAction', 'The act of marrying a person.'),
(598, 1, 14, 'Mass', 'Mass', 'Properties that take Mass as values are of the form \'&lt;Number&gt; &lt;Mass unit of measure&gt;\'. E.g., \'7 kg\'.'),
(599, 1, 14, 'MathSolver', 'MathSolver', 'A math solver which is capable of solving a subset of mathematical problems.'),
(600, 1, 14, 'MaximumDoseSchedule', 'MaximumDoseSchedule', 'The maximum dosing schedule considered safe for a drug or supplement as recommended by an authority or by the drug/supplement\'s manufacturer. Capture the recommending authority in the recognizingAuthority property of MedicalEntity.'),
(601, 1, 14, 'MediaGallery', 'MediaGallery', 'Web page type: Media gallery page. A mixed-media page that can contains media such as images, videos, and other multimedia.'),
(602, 1, 14, 'MediaManipulationRatingEnumeration', 'MediaManipulationRatingEnumeration', '(editorial work in progress, this definition is incomplete and unreviewed) MediaManipulationRatingEnumeration classifies a number of ways in which a media item (video, image, audio) can be manipulated, taking into account the context within which they are published or presented.'),
(603, 1, 14, 'MediaObject', 'MediaObject', 'A media object, such as an image, video, or audio object embedded in a web page or a downloadable dataset i.e. DataDownload. Note that a creative work may have many media objects associated with it on the same web page. For example, a page about a single song (MusicRecording) may have a music video (VideoObject), and a high and low bandwidth audio stream (2 AudioObject\'s).'),
(604, 1, 14, 'MediaReview', 'MediaReview', '(editorial work in progress, this definition is incomplete and unreviewed)\n    A [[MediaReview]] is a more specialized form of Review dedicated to the evaluation of media content online, typically in the context of fact-checking and misinformation.\n    For more general reviews of media in the broader sense, use [[UserReview]], [[CriticReview]] or other [[Review]] types.'),
(605, 1, 14, 'MediaSubscription', 'MediaSubscription', 'A subscription which allows a user to access media including audio, video, books, etc.'),
(606, 1, 14, 'MedicalAudience', 'MedicalAudience', 'Target audiences for medical web pages.'),
(607, 1, 14, 'MedicalAudienceType', 'MedicalAudienceType', 'Target audiences types for medical web pages. Enumerated type.'),
(608, 1, 14, 'MedicalBusiness', 'MedicalBusiness', 'A particular physical or virtual business of an organization for medical purposes. Examples of MedicalBusiness include differents business run by health professionals.'),
(609, 1, 14, 'MedicalCause', 'MedicalCause', 'The causative agent(s) that are responsible for the pathophysiologic process that eventually results in a medical condition, symptom or sign. In this schema, unless otherwise specified this is meant to be the proximate cause of the medical condition, symptom or sign. The proximate cause is defined as the causative agent that most directly results in the medical condition, symptom or sign. For example, the HIV virus could be considered a cause of AIDS. Or in a diagnostic context, if a patient fell and sustained a hip fracture and two days later sustained a pulmonary embolism which eventuated in a cardiac arrest, the cause of the cardiac arrest (the proximate cause) would be the pulmonary embolism and not the fall. Medical causes can include cardiovascular, chemical, dermatologic, endocrine, environmental, gastroenterologic, genetic, hematologic, gynecologic, iatrogenic, infectious, musculoskeletal, neurologic, nutritional, obstetric, oncologic, otolaryngologic, pharmacologic, psychiatric, pulmonary, renal, rheumatologic, toxic, traumatic, or urologic causes; medical conditions can be causes as well.'),
(610, 1, 14, 'MedicalClinic', 'MedicalClinic', 'A facility, often associated with a hospital or medical school, that is devoted to the specific diagnosis and/or healthcare. Previously limited to outpatients but with evolution it may be open to inpatients as well.'),
(611, 1, 14, 'MedicalCode', 'MedicalCode', 'A code for a medical entity.'),
(612, 1, 14, 'MedicalCondition', 'MedicalCondition', 'Any condition of the human body that affects the normal functioning of a person, whether physically or mentally. Includes diseases, injuries, disabilities, disorders, syndromes, etc.'),
(613, 1, 14, 'MedicalConditionStage', 'MedicalConditionStage', 'A stage of a medical condition, such as \'Stage IIIa\'.'),
(614, 1, 14, 'MedicalContraindication', 'MedicalContraindication', 'A condition or factor that serves as a reason to withhold a certain medical therapy. Contraindications can be absolute (there are no reasonable circumstances for undertaking a course of action) or relative (the patient is at higher risk of complications, but that these risks may be outweighed by other considerations or mitigated by other measures).'),
(615, 1, 14, 'MedicalDevice', 'MedicalDevice', 'Any object used in a medical capacity, such as to diagnose or treat a patient.'),
(616, 1, 14, 'MedicalDevicePurpose', 'MedicalDevicePurpose', 'Categories of medical devices, organized by the purpose or intended use of the device.'),
(617, 1, 14, 'MedicalEntity', 'MedicalEntity', 'The most generic type of entity related to health and the practice of medicine.'),
(618, 1, 14, 'MedicalEnumeration', 'MedicalEnumeration', 'Enumerations related to health and the practice of medicine: A concept that is used to attribute a quality to another concept, as a qualifier, a collection of items or a listing of all of the elements of a set in medicine practice.'),
(619, 1, 14, 'MedicalEvidenceLevel', 'MedicalEvidenceLevel', 'Level of evidence for a medical guideline. Enumerated type.'),
(620, 1, 14, 'MedicalGuideline', 'MedicalGuideline', 'Any recommendation made by a standard society (e.g. ACC/AHA) or consensus statement that denotes how to diagnose and treat a particular condition. Note: this type should be used to tag the actual guideline recommendation; if the guideline recommendation occurs in a larger scholarly article, use MedicalScholarlyArticle to tag the overall article, not this type. Note also: the organization making the recommendation should be captured in the recognizingAuthority base property of MedicalEntity.'),
(621, 1, 14, 'MedicalGuidelineContraindication', 'MedicalGuidelineContraindication', 'A guideline contraindication that designates a process as harmful and where quality of the data supporting the contraindication is sound.'),
(622, 1, 14, 'MedicalGuidelineRecommendation', 'MedicalGuidelineRecommendation', 'A guideline recommendation that is regarded as efficacious and where quality of the data supporting the recommendation is sound.'),
(623, 1, 14, 'MedicalImagingTechnique', 'MedicalImagingTechnique', 'Any medical imaging modality typically used for diagnostic purposes. Enumerated type.'),
(624, 1, 14, 'MedicalIndication', 'MedicalIndication', 'A condition or factor that indicates use of a medical therapy, including signs, symptoms, risk factors, anatomical states, etc.'),
(625, 1, 14, 'MedicalIntangible', 'MedicalIntangible', 'A utility class that serves as the umbrella for a number of \'intangible\' things in the medical space.'),
(626, 1, 14, 'MedicalObservationalStudy', 'MedicalObservationalStudy', 'An observational study is a type of medical study that attempts to infer the possible effect of a treatment through observation of a cohort of subjects over a period of time. In an observational study, the assignment of subjects into treatment groups versus control groups is outside the control of the investigator. This is in contrast with controlled studies, such as the randomized controlled trials represented by MedicalTrial, where each subject is randomly assigned to a treatment group or a control group before the start of the treatment.'),
(627, 1, 14, 'MedicalObservationalStudyDesign', 'MedicalObservationalStudyDesign', 'Design models for observational medical studies. Enumerated type.'),
(628, 1, 14, 'MedicalOrganization', 'MedicalOrganization', 'A medical organization (physical or not), such as hospital, institution or clinic.'),
(629, 1, 14, 'MedicalProcedure', 'MedicalProcedure', 'A process of care used in either a diagnostic, therapeutic, preventive or palliative capacity that relies on invasive (surgical), non-invasive, or other techniques.'),
(630, 1, 14, 'MedicalProcedureType', 'MedicalProcedureType', 'An enumeration that describes different types of medical procedures.'),
(631, 1, 14, 'MedicalRiskCalculator', 'MedicalRiskCalculator', 'A complex mathematical calculation requiring an online calculator, used to assess prognosis. Note: use the url property of Thing to record any URLs for online calculators.'),
(632, 1, 14, 'MedicalRiskEstimator', 'MedicalRiskEstimator', 'Any rule set or interactive tool for estimating the risk of developing a complication or condition.'),
(633, 1, 14, 'MedicalRiskFactor', 'MedicalRiskFactor', 'A risk factor is anything that increases a person\'s likelihood of developing or contracting a disease, medical condition, or complication.'),
(634, 1, 14, 'MedicalRiskScore', 'MedicalRiskScore', 'A simple system that adds up the number of risk factors to yield a score that is associated with prognosis, e.g. CHAD score, TIMI risk score.'),
(635, 1, 14, 'MedicalScholarlyArticle', 'MedicalScholarlyArticle', 'A scholarly article in the medical domain.'),
(636, 1, 14, 'MedicalSign', 'MedicalSign', 'Any physical manifestation of a person\'s medical condition discoverable by objective diagnostic tests or physical examination.'),
(637, 1, 14, 'MedicalSignOrSymptom', 'MedicalSignOrSymptom', 'Any feature associated or not with a medical condition. In medicine a symptom is generally subjective while a sign is objective.'),
(638, 1, 14, 'MedicalSpecialty', 'MedicalSpecialty', 'Any specific branch of medical science or practice. Medical specialities include clinical specialties that pertain to particular organ systems and their respective disease states, as well as allied health specialties. Enumerated type.'),
(639, 1, 14, 'MedicalStudy', 'MedicalStudy', 'A medical study is an umbrella type covering all kinds of research studies relating to human medicine or health, including observational studies and interventional trials and registries, randomized, controlled or not. When the specific type of study is known, use one of the extensions of this type, such as MedicalTrial or MedicalObservationalStudy. Also, note that this type should be used to mark up data that describes the study itself; to tag an article that publishes the results of a study, use MedicalScholarlyArticle. Note: use the code property of MedicalEntity to store study IDs, e.g. clinicaltrials.gov ID.'),
(640, 1, 14, 'MedicalStudyStatus', 'MedicalStudyStatus', 'The status of a medical study. Enumerated type.'),
(641, 1, 14, 'MedicalSymptom', 'MedicalSymptom', 'Any complaint sensed and expressed by the patient (therefore defined as subjective)  like stomachache, lower-back pain, or fatigue.'),
(642, 1, 14, 'MedicalTest', 'MedicalTest', 'Any medical test, typically performed for diagnostic purposes.'),
(643, 1, 14, 'MedicalTestPanel', 'MedicalTestPanel', 'Any collection of tests commonly ordered together.'),
(644, 1, 14, 'MedicalTherapy', 'MedicalTherapy', 'Any medical intervention designed to prevent, treat, and cure human diseases and medical conditions, including both curative and palliative therapies. Medical therapies are typically processes of care relying upon pharmacotherapy, behavioral therapy, supportive therapy (with fluid or nutrition for example), or detoxification (e.g. hemodialysis) aimed at improving or preventing a health condition.'),
(645, 1, 14, 'MedicalTrial', 'MedicalTrial', 'A medical trial is a type of medical study that uses scientific process used to compare the safety and efficacy of medical therapies or medical procedures. In general, medical trials are controlled and subjects are allocated at random to the different treatment and/or control groups.'),
(646, 1, 14, 'MedicalTrialDesign', 'MedicalTrialDesign', 'Design models for medical trials. Enumerated type.'),
(647, 1, 14, 'MedicalWebPage', 'MedicalWebPage', 'A web page that provides medical information.'),
(648, 1, 14, 'MedicineSystem', 'MedicineSystem', 'Systems of medical practice.'),
(649, 1, 14, 'MeetingRoom', 'MeetingRoom', 'A meeting room, conference room, or conference hall is a room provided for singular events such as business conferences and meetings (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Conference_hall\">http://en.wikipedia.org/wiki/Conference_hall</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(650, 1, 14, 'MensClothingStore', 'MensClothingStore', 'A men\'s clothing store.'),
(651, 1, 14, 'Menu', 'Menu', 'A structured representation of food or drink items available from a FoodEstablishment.'),
(652, 1, 14, 'MenuItem', 'MenuItem', 'A food or drink item listed in a menu or menu section.'),
(653, 1, 14, 'MenuSection', 'MenuSection', 'A sub-grouping of food or drink items in a menu. E.g. courses (such as \'Dinner\', \'Breakfast\', etc.), specific type of dishes (such as \'Meat\', \'Vegan\', \'Drinks\', etc.), or some other classification made by the menu provider.'),
(654, 1, 14, 'MerchantReturnEnumeration', 'MerchantReturnEnumeration', 'MerchantReturnEnumeration enumerates several kinds of product return policy. Note that this structure may not capture all aspects of the policy.'),
(655, 1, 14, 'MerchantReturnPolicy', 'MerchantReturnPolicy', 'A MerchantReturnPolicy provides information about product return policies associated with an [[Organization]] or [[Product]].'),
(656, 1, 14, 'Message', 'Message', 'A single message from a sender to one or more organizations or people.'),
(657, 1, 14, 'MiddleSchool', 'MiddleSchool', 'A middle school (typically for children aged around 11-14, although this varies somewhat).'),
(658, 1, 14, 'MobileApplication', 'MobileApplication', 'A software application designed specifically to work well on a mobile device such as a telephone.'),
(659, 1, 14, 'MobilePhoneStore', 'MobilePhoneStore', 'A store that sells mobile phones and related accessories.'),
(660, 1, 14, 'MonetaryAmount', 'MonetaryAmount', 'A monetary value or range. This type can be used to describe an amount of money such as $50 USD, or a range as in describing a bank account being suitable for a balance between £1,000 and £1,000,000 GBP, or the value of a salary, etc. It is recommended to use [[PriceSpecification]] Types to describe the price of an Offer, Invoice, etc.'),
(661, 1, 14, 'MonetaryAmountDistribution', 'MonetaryAmountDistribution', 'A statistical distribution of monetary amounts.'),
(662, 1, 14, 'MonetaryGrant', 'MonetaryGrant', 'A monetary grant.'),
(663, 1, 14, 'MoneyTransfer', 'MoneyTransfer', 'The act of transferring money from one place to another place. This may occur electronically or physically.'),
(664, 1, 14, 'MortgageLoan', 'MortgageLoan', 'A loan in which property or real estate is used as collateral. (A loan securitized against some real estate.)'),
(665, 1, 14, 'Mosque', 'Mosque', 'A mosque.'),
(666, 1, 14, 'Motel', 'Motel', 'A motel.\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(667, 1, 14, 'Motorcycle', 'Motorcycle', 'A motorcycle or motorbike is a single-track, two-wheeled motor vehicle.'),
(668, 1, 14, 'MotorcycleDealer', 'MotorcycleDealer', 'A motorcycle dealer.'),
(669, 1, 14, 'MotorcycleRepair', 'MotorcycleRepair', 'A motorcycle repair shop.'),
(670, 1, 14, 'MotorizedBicycle', 'MotorizedBicycle', 'A motorized bicycle is a bicycle with an attached motor used to power the vehicle, or to assist with pedaling.'),
(671, 1, 14, 'Mountain', 'Mountain', 'A mountain, like Mount Whitney or Mount Everest.'),
(672, 1, 14, 'MoveAction', 'MoveAction', 'The act of an agent relocating to a place.\\\n\\\nRelated actions:\\\n\\\n* [[TransferAction]]: Unlike TransferAction, the subject of the move is a living Person or Organization rather than an inanimate object.'),
(673, 1, 14, 'Movie', 'Movie', 'A movie.'),
(674, 1, 14, 'MovieClip', 'MovieClip', 'A short segment/part of a movie.'),
(675, 1, 14, 'MovieRentalStore', 'MovieRentalStore', 'A movie rental store.'),
(676, 1, 14, 'MovieSeries', 'MovieSeries', 'A series of movies. Included movies can be indicated with the hasPart property.'),
(677, 1, 14, 'MovieTheater', 'MovieTheater', 'A movie theater.'),
(678, 1, 14, 'MovingCompany', 'MovingCompany', 'A moving company.'),
(679, 1, 14, 'Muscle', 'Muscle', 'A muscle is an anatomical structure consisting of a contractile form of tissue that animals use to effect movement.'),
(680, 1, 14, 'Museum', 'Museum', 'A museum.'),
(681, 1, 14, 'MusicAlbum', 'MusicAlbum', 'A collection of music tracks.'),
(682, 1, 14, 'MusicAlbumProductionType', 'MusicAlbumProductionType', 'Classification of the album by it\'s type of content: soundtrack, live album, studio album, etc.'),
(683, 1, 14, 'MusicAlbumReleaseType', 'MusicAlbumReleaseType', 'The kind of release which this album is: single, EP or album.'),
(684, 1, 14, 'MusicComposition', 'MusicComposition', 'A musical composition.'),
(685, 1, 14, 'MusicEvent', 'MusicEvent', 'Event type: Music event.'),
(686, 1, 14, 'MusicGroup', 'MusicGroup', 'A musical group, such as a band, an orchestra, or a choir. Can also be a solo musician.'),
(687, 1, 14, 'MusicPlaylist', 'MusicPlaylist', 'A collection of music tracks in playlist form.'),
(688, 1, 14, 'MusicRecording', 'MusicRecording', 'A music recording (track), usually a single song.'),
(689, 1, 14, 'MusicRelease', 'MusicRelease', 'A MusicRelease is a specific release of a music album.'),
(690, 1, 14, 'MusicReleaseFormatType', 'MusicReleaseFormatType', 'Format of this release (the type of recording media used, ie. compact disc, digital media, LP, etc.).'),
(691, 1, 14, 'MusicStore', 'MusicStore', 'A music store.'),
(692, 1, 14, 'MusicVenue', 'MusicVenue', 'A music venue.'),
(693, 1, 14, 'MusicVideoObject', 'MusicVideoObject', 'A music video file.'),
(694, 1, 14, 'NGO', 'NGO', 'Organization: Non-governmental Organization.'),
(695, 1, 14, 'NLNonprofitType', 'NLNonprofitType', 'NLNonprofitType: Non-profit organization type originating from the Netherlands.'),
(696, 1, 14, 'NailSalon', 'NailSalon', 'A nail salon.'),
(697, 1, 14, 'Nerve', 'Nerve', 'A common pathway for the electrochemical nerve impulses that are transmitted along each of the axons.'),
(698, 1, 14, 'NewsArticle', 'NewsArticle', 'A NewsArticle is an article whose content reports news, or provides background context and supporting materials for understanding the news.\n\nA more detailed overview of [schema.org News markup](/docs/news.html) is also available.\n'),
(699, 1, 14, 'NewsMediaOrganization', 'NewsMediaOrganization', 'A News/Media organization such as a newspaper or TV station.'),
(700, 1, 14, 'Newspaper', 'Newspaper', 'A publication containing information about varied topics that are pertinent to general information, a geographic area, or a specific subject matter (i.e. business, culture, education). Often published daily.'),
(701, 1, 14, 'NightClub', 'NightClub', 'A nightclub or discotheque.'),
(702, 1, 14, 'NonprofitType', 'NonprofitType', 'NonprofitType enumerates several kinds of official non-profit types of which a non-profit organization can be.'),
(703, 1, 14, 'Notary', 'Notary', 'A notary.'),
(704, 1, 14, 'NoteDigitalDocument', 'NoteDigitalDocument', 'A file containing a note, primarily for the author.'),
(705, 1, 14, 'Number', 'Number', 'Data type: Number.\\\n\\\nUsage guidelines:\\\n\\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similiar Unicode symbols.\\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
(706, 1, 14, 'NutritionInformation', 'NutritionInformation', 'Nutritional information about the recipe.'),
(707, 1, 14, 'Observation', 'Observation', 'Instances of the class [[Observation]] are used to specify observations about an entity (which may or may not be an instance of a [[StatisticalPopulation]]), at a particular time. The principal properties of an [[Observation]] are [[observedNode]], [[measuredProperty]], [[measuredValue]] (or [[median]], etc.) and [[observationDate]] ([[measuredProperty]] properties can, but need not always, be W3C RDF Data Cube \"measure properties\", as in the [lifeExpectancy example](https://www.w3.org/TR/vocab-data-cube/#dsd-example)).\nSee also [[StatisticalPopulation]], and the [data and datasets](/docs/data-and-datasets.html) overview for more details.\n  '),
(708, 1, 14, 'Occupation', 'Occupation', 'A profession, may involve prolonged training and/or a formal qualification.'),
(709, 1, 14, 'OccupationalTherapy', 'OccupationalTherapy', 'A treatment of people with physical, emotional, or social problems, using purposeful activity to help them overcome or learn to deal with their problems.'),
(710, 1, 14, 'OceanBodyOfWater', 'OceanBodyOfWater', 'An ocean (for example, the Pacific).'),
(711, 1, 14, 'Offer', 'Offer', 'An offer to transfer some rights to an item or to provide a service — for example, an offer to sell tickets to an event, to rent the DVD of a movie, to stream a TV show over the internet, to repair a motorcycle, or to loan a book.\\\n\\\nNote: As the [[businessFunction]] property, which identifies the form of offer (e.g. sell, lease, repair, dispose), defaults to http://purl.org/goodrelations/v1#Sell; an Offer without a defined businessFunction value can be assumed to be an offer to sell.\\\n\\\nFor [GTIN](http://www.gs1.org/barcodes/technical/idkeys/gtin)-related fields, see [Check Digit calculator](http://www.gs1.org/barcodes/support/check_digit_calculator) and [validation guide](http://www.gs1us.org/resources/standards/gtin-validation-guide) from [GS1](http://www.gs1.org/).'),
(712, 1, 14, 'OfferCatalog', 'OfferCatalog', 'An OfferCatalog is an ItemList that contains related Offers and/or further OfferCatalogs that are offeredBy the same provider.'),
(713, 1, 14, 'OfferForLease', 'OfferForLease', 'An [[OfferForLease]] in Schema.org represents an [[Offer]] to lease out something, i.e. an [[Offer]] whose\n  [[businessFunction]] is [lease out](http://purl.org/goodrelations/v1#LeaseOut.). See [Good Relations](https://en.wikipedia.org/wiki/GoodRelations) for\n  background on the underlying concepts.\n  '),
(714, 1, 14, 'OfferForPurchase', 'OfferForPurchase', 'An [[OfferForPurchase]] in Schema.org represents an [[Offer]] to sell something, i.e. an [[Offer]] whose\n  [[businessFunction]] is [sell](http://purl.org/goodrelations/v1#Sell.). See [Good Relations](https://en.wikipedia.org/wiki/GoodRelations) for\n  background on the underlying concepts.\n  '),
(715, 1, 14, 'OfferItemCondition', 'OfferItemCondition', 'A list of possible conditions for the item.'),
(716, 1, 14, 'OfferShippingDetails', 'OfferShippingDetails', 'OfferShippingDetails represents information about shipping destinations.\n\nMultiple of these entities can be used to represent different shipping rates for different destinations:\n\nOne entity for Alaska/Hawaii. A different one for continental US.A different one for all France.\n\nMultiple of these entities can be used to represent different shipping costs and delivery times.\n\nTwo entities that are identical but differ in rate and time:\n\ne.g. Cheaper and slower: $5 in 5-7days\nor Fast and expensive: $15 in 1-2 days\n'),
(717, 1, 14, 'OfficeEquipmentStore', 'OfficeEquipmentStore', 'An office equipment store.'),
(718, 1, 14, 'OnDemandEvent', 'OnDemandEvent', 'A publication event e.g. catch-up TV or radio podcast, during which a program is available on-demand.'),
(719, 1, 14, 'OpeningHoursSpecification', 'OpeningHoursSpecification', 'A structured value providing information about the opening hours of a place or a certain service inside a place.\\\n\\\n\nThe place is __open__ if the [[opens]] property is specified, and __closed__ otherwise.\\\n\\\nIf the value for the [[closes]] property is less than the value for the [[opens]] property then the hour range is assumed to span over the next day.\n      '),
(720, 1, 14, 'OpinionNewsArticle', 'OpinionNewsArticle', 'An [[OpinionNewsArticle]] is a [[NewsArticle]] that primarily expresses opinions rather than journalistic reporting of news and events. For example, a [[NewsArticle]] consisting of a column or [[Blog]]/[[BlogPosting]] entry in the Opinions section of a news publication. '),
(721, 1, 14, 'Optician', 'Optician', 'A store that sells reading glasses and similar devices for improving vision.'),
(722, 1, 14, 'Order', 'Order', 'An order is a confirmation of a transaction (a receipt), which can contain multiple line items, each represented by an Offer that has been accepted by the customer.'),
(723, 1, 14, 'OrderAction', 'OrderAction', 'An agent orders an object/product/service to be delivered/sent.'),
(724, 1, 14, 'OrderItem', 'OrderItem', 'An order item is a line of an order. It includes the quantity and shipping details of a bought offer.'),
(725, 1, 14, 'OrderStatus', 'OrderStatus', 'Enumerated status values for Order.'),
(726, 1, 14, 'Organization', 'Organization', 'An organization such as a school, NGO, corporation, club, etc.'),
(727, 1, 14, 'OrganizationRole', 'OrganizationRole', 'A subclass of Role used to describe roles within organizations.'),
(728, 1, 14, 'OrganizeAction', 'OrganizeAction', 'The act of manipulating/administering/supervising/controlling one or more objects.'),
(729, 1, 14, 'OutletStore', 'OutletStore', 'An outlet store.'),
(730, 1, 14, 'OwnershipInfo', 'OwnershipInfo', 'A structured value providing information about when a certain organization or person owned a certain product.'),
(731, 1, 14, 'PaintAction', 'PaintAction', 'The act of producing a painting, typically with paint and canvas as instruments.'),
(732, 1, 14, 'Painting', 'Painting', 'A painting.'),
(733, 1, 14, 'PalliativeProcedure', 'PalliativeProcedure', 'A medical procedure intended primarily for palliative purposes, aimed at relieving the symptoms of an underlying health condition.'),
(734, 1, 14, 'ParcelDelivery', 'ParcelDelivery', 'The delivery of a parcel either via the postal service or a commercial service.'),
(735, 1, 14, 'ParentAudience', 'ParentAudience', 'A set of characteristics describing parents, who can be interested in viewing some content.'),
(736, 1, 14, 'Park', 'Park', 'A park.'),
(737, 1, 14, 'ParkingFacility', 'ParkingFacility', 'A parking lot or other parking facility.'),
(738, 1, 14, 'PathologyTest', 'PathologyTest', 'A medical test performed by a laboratory that typically involves examination of a tissue sample by a pathologist.'),
(739, 1, 14, 'Patient', 'Patient', 'A patient is any person recipient of health care services.'),
(740, 1, 14, 'PawnShop', 'PawnShop', 'A shop that will buy, or lend money against the security of, personal possessions.'),
(741, 1, 14, 'PayAction', 'PayAction', 'An agent pays a price to a participant.'),
(742, 1, 14, 'PaymentCard', 'PaymentCard', 'A payment method using a credit, debit, store or other card to associate the payment with an account.'),
(743, 1, 14, 'PaymentChargeSpecification', 'PaymentChargeSpecification', 'The costs of settling the payment using a particular payment method.'),
(744, 1, 14, 'PaymentMethod', 'PaymentMethod', 'A payment method is a standardized procedure for transferring the monetary amount for a purchase. Payment methods are characterized by the legal and technical structures used, and by the organization or group carrying out the transaction.\\\n\\\nCommonly used values:\\\n\\\n* http://purl.org/goodrelations/v1#ByBankTransferInAdvance\\\n* http://purl.org/goodrelations/v1#ByInvoice\\\n* http://purl.org/goodrelations/v1#Cash\\\n* http://purl.org/goodrelations/v1#CheckInAdvance\\\n* http://purl.org/goodrelations/v1#COD\\\n* http://purl.org/goodrelations/v1#DirectDebit\\\n* http://purl.org/goodrelations/v1#GoogleCheckout\\\n* http://purl.org/goodrelations/v1#PayPal\\\n* http://purl.org/goodrelations/v1#PaySwarm\n        '),
(745, 1, 14, 'PaymentService', 'PaymentService', 'A Service to transfer funds from a person or organization to a beneficiary person or organization.'),
(746, 1, 14, 'PaymentStatusType', 'PaymentStatusType', 'A specific payment status. For example, PaymentDue, PaymentComplete, etc.'),
(747, 1, 14, 'PeopleAudience', 'PeopleAudience', 'A set of characteristics belonging to people, e.g. who compose an item\'s target audience.'),
(748, 1, 14, 'PerformAction', 'PerformAction', 'The act of participating in performance arts.'),
(749, 1, 14, 'PerformanceRole', 'PerformanceRole', 'A PerformanceRole is a Role that some entity places with regard to a theatrical performance, e.g. in a Movie, TVSeries etc.'),
(750, 1, 14, 'PerformingArtsTheater', 'PerformingArtsTheater', 'A theater or other performing art center.'),
(751, 1, 14, 'PerformingGroup', 'PerformingGroup', 'A performance group, such as a band, an orchestra, or a circus.'),
(752, 1, 14, 'Periodical', 'Periodical', 'A publication in any medium issued in successive parts bearing numerical or chronological designations and intended, such as a magazine, scholarly journal, or newspaper to continue indefinitely.\\\n\\\nSee also [blog post](http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html).'),
(753, 1, 14, 'Permit', 'Permit', 'A permit issued by an organization, e.g. a parking pass.'),
(754, 1, 14, 'Person', 'Person', 'A person (alive, dead, undead, or fictional).'),
(755, 1, 14, 'PetStore', 'PetStore', 'A pet store.'),
(756, 1, 14, 'Pharmacy', 'Pharmacy', 'A pharmacy or drugstore.'),
(757, 1, 14, 'Photograph', 'Photograph', 'A photograph.'),
(758, 1, 14, 'PhotographAction', 'PhotographAction', 'The act of capturing still images of objects using a camera.'),
(759, 1, 14, 'PhysicalActivity', 'PhysicalActivity', 'Any bodily activity that enhances or maintains physical fitness and overall health and wellness. Includes activity that is part of daily living and routine, structured exercise, and exercise prescribed as part of a medical treatment or recovery plan.'),
(760, 1, 14, 'PhysicalActivityCategory', 'PhysicalActivityCategory', 'Categories of physical activity, organized by physiologic classification.'),
(761, 1, 14, 'PhysicalExam', 'PhysicalExam', 'A type of physical examination of a patient performed by a physician. '),
(762, 1, 14, 'PhysicalTherapy', 'PhysicalTherapy', 'A process of progressive physical care and rehabilitation aimed at improving a health condition.'),
(763, 1, 14, 'Physician', 'Physician', 'A doctor\'s office.'),
(764, 1, 14, 'Place', 'Place', 'Entities that have a somewhat fixed, physical extension.'),
(765, 1, 14, 'PlaceOfWorship', 'PlaceOfWorship', 'Place of worship, such as a church, synagogue, or mosque.'),
(766, 1, 14, 'PlanAction', 'PlanAction', 'The act of planning the execution of an event/task/action/reservation/plan to a future date.'),
(767, 1, 14, 'Play', 'Play', 'A play is a form of literature, usually consisting of dialogue between characters, intended for theatrical performance rather than just reading. Note the peformance of a Play would be a [[TheaterEvent]] - the *Play* being the [[workPerformed]].'),
(768, 1, 14, 'PlayAction', 'PlayAction', 'The act of playing/exercising/training/performing for enjoyment, leisure, recreation, Competition or exercise.\\\n\\\nRelated actions:\\\n\\\n* [[ListenAction]]: Unlike ListenAction (which is under ConsumeAction), PlayAction refers to performing for an audience or at an event, rather than consuming music.\\\n* [[WatchAction]]: Unlike WatchAction (which is under ConsumeAction), PlayAction refers to showing/displaying for an audience or at an event, rather than consuming visual content.'),
(769, 1, 14, 'Playground', 'Playground', 'A playground.'),
(770, 1, 14, 'Plumber', 'Plumber', 'A plumbing service.'),
(771, 1, 14, 'PodcastEpisode', 'PodcastEpisode', 'A single episode of a podcast series.'),
(772, 1, 14, 'PodcastSeason', 'PodcastSeason', 'A single season of a podcast. Many podcasts do not break down into separate seasons. In that case, PodcastSeries should be used.'),
(773, 1, 14, 'PodcastSeries', 'PodcastSeries', 'A podcast is an episodic series of digital audio or video files which a user can download and listen to.'),
(774, 1, 14, 'PoliceStation', 'PoliceStation', 'A police station.'),
(775, 1, 14, 'Pond', 'Pond', 'A pond.'),
(776, 1, 14, 'PostOffice', 'PostOffice', 'A post office.'),
(777, 1, 14, 'PostalAddress', 'PostalAddress', 'The mailing address.'),
(778, 1, 14, 'PostalCodeRangeSpecification', 'PostalCodeRangeSpecification', 'Indicates a range of postalcodes, usually defined as the set of valid codes between [[postalCodeBegin]] and [[postalCodeEnd]], inclusively.'),
(779, 1, 14, 'Poster', 'Poster', 'A large, usually printed placard, bill, or announcement, often illustrated, that is posted to advertise or publicize something.'),
(780, 1, 14, 'PreOrderAction', 'PreOrderAction', 'An agent orders a (not yet released) object/product/service to be delivered/sent.'),
(781, 1, 14, 'PrependAction', 'PrependAction', 'The act of inserting at the beginning if an ordered collection.'),
(782, 1, 14, 'Preschool', 'Preschool', 'A preschool.'),
(783, 1, 14, 'PresentationDigitalDocument', 'PresentationDigitalDocument', 'A file containing slides or used for a presentation.'),
(784, 1, 14, 'PreventionIndication', 'PreventionIndication', 'An indication for preventing an underlying condition, symptom, etc.'),
(785, 1, 14, 'PriceComponentTypeEnumeration', 'PriceComponentTypeEnumeration', 'Enumerates different price components that together make up the total price for an offered product.'),
(786, 1, 14, 'PriceSpecification', 'PriceSpecification', 'A structured value representing a price or price range. Typically, only the subclasses of this type are used for markup. It is recommended to use [[MonetaryAmount]] to describe independent amounts of money such as a salary, credit card limits, etc.'),
(787, 1, 14, 'PriceTypeEnumeration', 'PriceTypeEnumeration', 'Enumerates different price types, for example list price, invoice price, and sale price.'),
(788, 1, 14, 'Product', 'Product', 'Any offered product or service. For example: a pair of shoes; a concert ticket; the rental of a car; a haircut; or an episode of a TV show streamed online.'),
(789, 1, 14, 'ProductCollection', 'ProductCollection', 'A set of products (either [[ProductGroup]]s or specific variants) that are listed together e.g. in an [[Offer]].'),
(790, 1, 14, 'ProductGroup', 'ProductGroup', 'A ProductGroup represents a group of [[Product]]s that vary only in certain well-described ways, such as by [[size]], [[color]], [[material]] etc.\n\nWhile a ProductGroup itself is not directly offered for sale, the various varying products that it represents can be. The ProductGroup serves as a prototype or template, standing in for all of the products who have an [[isVariantOf]] relationship to it. As such, properties (including additional types) can be applied to the ProductGroup to represent characteristics shared by each of the (possibly very many) variants. Properties that reference a ProductGroup are not included in this mechanism; neither are the following specific properties [[variesBy]], [[hasVariant]], [[url]]. '),
(791, 1, 14, 'ProductModel', 'ProductModel', 'A datasheet or vendor specification of a product (in the sense of a prototypical description).'),
(792, 1, 14, 'ProfessionalService', 'ProfessionalService', 'Original definition: \"provider of professional services.\"\\\n\\\nThe general [[ProfessionalService]] type for local businesses was deprecated due to confusion with [[Service]]. For reference, the types that it included were: [[Dentist]],\n        [[AccountingService]], [[Attorney]], [[Notary]], as well as types for several kinds of [[HomeAndConstructionBusiness]]: [[Electrician]], [[GeneralContractor]],\n        [[HousePainter]], [[Locksmith]], [[Plumber]], [[RoofingContractor]]. [[LegalService]] was introduced as a more inclusive supertype of [[Attorney]].'),
(793, 1, 14, 'ProfilePage', 'ProfilePage', 'Web page type: Profile page.'),
(794, 1, 14, 'ProgramMembership', 'ProgramMembership', 'Used to describe membership in a loyalty programs (e.g. \"StarAliance\"), traveler clubs (e.g. \"AAA\"), purchase clubs (\"Safeway Club\"), etc.'),
(795, 1, 14, 'Project', 'Project', 'An enterprise (potentially individual but typically collaborative), planned to achieve a particular aim.\nUse properties from [[Organization]], [[subOrganization]]/[[parentOrganization]] to indicate project sub-structures. \n   '),
(796, 1, 14, 'PronounceableText', 'PronounceableText', 'Data type: PronounceableText.'),
(797, 1, 14, 'Property', 'Property', 'A property, used to indicate attributes and relationships of some Thing; equivalent to rdf:Property.'),
(798, 1, 14, 'PropertyValue', 'PropertyValue', 'A property-value pair, e.g. representing a feature of a product or place. Use the \'name\' property for the name of the property. If there is an additional human-readable version of the value, put that into the \'description\' property.\\\n\\\n Always use specific schema.org properties when a) they exist and b) you can populate them. Using PropertyValue as a substitute will typically not trigger the same effect as using the original, specific property.\n    '),
(799, 1, 14, 'PropertyValueSpecification', 'PropertyValueSpecification', 'A Property value specification.'),
(800, 1, 14, 'PsychologicalTreatment', 'PsychologicalTreatment', 'A process of care relying upon counseling, dialogue and communication  aimed at improving a mental health condition without use of drugs.'),
(801, 1, 14, 'PublicSwimmingPool', 'PublicSwimmingPool', 'A public swimming pool.'),
(802, 1, 14, 'PublicToilet', 'PublicToilet', 'A public toilet is a room or small building containing one or more toilets (and possibly also urinals) which is available for use by the general public, or by customers or employees of certain businesses.'),
(803, 1, 14, 'PublicationEvent', 'PublicationEvent', 'A PublicationEvent corresponds indifferently to the event of publication for a CreativeWork of any type e.g. a broadcast event, an on-demand event, a book/journal publication via a variety of delivery media.'),
(804, 1, 14, 'PublicationIssue', 'PublicationIssue', 'A part of a successively published publication such as a periodical or publication volume, often numbered, usually containing a grouping of works such as articles.\\\n\\\nSee also [blog post](http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html).'),
(805, 1, 14, 'PublicationVolume', 'PublicationVolume', 'A part of a successively published publication such as a periodical or multi-volume work, often numbered. It may represent a time span, such as a year.\\\n\\\nSee also [blog post](http://blog.schema.org/2014/09/schemaorg-support-for-bibliographic_2.html).'),
(806, 1, 14, 'QAPage', 'QAPage', 'A QAPage is a WebPage focussed on a specific Question and its Answer(s), e.g. in a question answering site or documenting Frequently Asked Questions (FAQs).'),
(807, 1, 14, 'QualitativeValue', 'QualitativeValue', 'A predefined value for a product characteristic, e.g. the power cord plug type \'US\' or the garment sizes \'S\', \'M\', \'L\', and \'XL\'.'),
(808, 1, 14, 'QuantitativeValue', 'QuantitativeValue', ' A point value or interval for product characteristics and other purposes.'),
(809, 1, 14, 'QuantitativeValueDistribution', 'QuantitativeValueDistribution', 'A statistical distribution of values.'),
(810, 1, 14, 'Quantity', 'Quantity', 'Quantities such as distance, time, mass, weight, etc. Particular instances of say Mass are entities like \'3 Kg\' or \'4 milligrams\'.'),
(811, 1, 14, 'Question', 'Question', 'A specific question - e.g. from a user seeking answers online, or collected in a Frequently Asked Questions (FAQ) document.'),
(812, 1, 14, 'Quiz', 'Quiz', 'Quiz: A test of knowledge, skills and abilities.'),
(813, 1, 14, 'Quotation', 'Quotation', 'A quotation. Often but not necessarily from some written work, attributable to a real world author and - if associated with a fictional character - to any fictional Person. Use [[isBasedOn]] to link to source/origin. The [[recordedIn]] property can be used to reference a Quotation from an [[Event]].'),
(814, 1, 14, 'QuoteAction', 'QuoteAction', 'An agent quotes/estimates/appraises an object/product/service with a price at a location/store.'),
(815, 1, 14, 'RVPark', 'RVPark', 'A place offering space for \"Recreational Vehicles\", Caravans, mobile homes and the like.'),
(816, 1, 14, 'RadiationTherapy', 'RadiationTherapy', 'A process of care using radiation aimed at improving a health condition.'),
(817, 1, 14, 'RadioBroadcastService', 'RadioBroadcastService', 'A delivery service through which radio content is provided via broadcast over the air or online.'),
(818, 1, 14, 'RadioChannel', 'RadioChannel', 'A unique instance of a radio BroadcastService on a CableOrSatelliteService lineup.'),
(819, 1, 14, 'RadioClip', 'RadioClip', 'A short radio program or a segment/part of a radio program.'),
(820, 1, 14, 'RadioEpisode', 'RadioEpisode', 'A radio episode which can be part of a series or season.'),
(821, 1, 14, 'RadioSeason', 'RadioSeason', 'Season dedicated to radio broadcast and associated online delivery.'),
(822, 1, 14, 'RadioSeries', 'RadioSeries', 'CreativeWorkSeries dedicated to radio broadcast and associated online delivery.'),
(823, 1, 14, 'RadioStation', 'RadioStation', 'A radio station.'),
(824, 1, 14, 'Rating', 'Rating', 'A rating is an evaluation on a numeric scale, such as 1 to 5 stars.'),
(825, 1, 14, 'ReactAction', 'ReactAction', 'The act of responding instinctively and emotionally to an object, expressing a sentiment.'),
(826, 1, 14, 'ReadAction', 'ReadAction', 'The act of consuming written content.'),
(827, 1, 14, 'RealEstateAgent', 'RealEstateAgent', 'A real-estate agent.'),
(828, 1, 14, 'RealEstateListing', 'RealEstateListing', 'A [[RealEstateListing]] is a listing that describes one or more real-estate [[Offer]]s (whose [[businessFunction]] is typically to lease out, or to sell).\n  The [[RealEstateListing]] type itself represents the overall listing, as manifested in some [[WebPage]].\n  '),
(829, 1, 14, 'ReceiveAction', 'ReceiveAction', 'The act of physically/electronically taking delivery of an object that has been transferred from an origin to a destination. Reciprocal of SendAction.\\\n\\\nRelated actions:\\\n\\\n* [[SendAction]]: The reciprocal of ReceiveAction.\\\n* [[TakeAction]]: Unlike TakeAction, ReceiveAction does not imply that the ownership has been transfered (e.g. I can receive a package, but it does not mean the package is now mine).'),
(830, 1, 14, 'Recipe', 'Recipe', 'A recipe. For dietary restrictions covered by the recipe, a few common restrictions are enumerated via [[suitableForDiet]]. The [[keywords]] property can also be used to add more detail.'),
(831, 1, 14, 'Recommendation', 'Recommendation', '[[Recommendation]] is a type of [[Review]] that suggests or proposes something as the best option or best course of action. Recommendations may be for products or services, or other concrete things, as in the case of a ranked list or product guide. A [[Guide]] may list multiple recommendations for different categories. For example, in a [[Guide]] about which TVs to buy, the author may have several [[Recommendation]]s.'),
(832, 1, 14, 'RecommendedDoseSchedule', 'RecommendedDoseSchedule', 'A recommended dosing schedule for a drug or supplement as prescribed or recommended by an authority or by the drug/supplement\'s manufacturer. Capture the recommending authority in the recognizingAuthority property of MedicalEntity.'),
(833, 1, 14, 'RecyclingCenter', 'RecyclingCenter', 'A recycling center.'),
(834, 1, 14, 'RefundTypeEnumeration', 'RefundTypeEnumeration', 'RefundTypeEnumeration enumerates several kinds of product return refund types.');
INSERT INTO `resource_class` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
(835, 1, 14, 'RegisterAction', 'RegisterAction', 'The act of registering to be a user of a service, product or web page.\\\n\\\nRelated actions:\\\n\\\n* [[JoinAction]]: Unlike JoinAction, RegisterAction implies you are registering to be a user of a service, *not* a group/team of people.\\\n* [FollowAction]]: Unlike FollowAction, RegisterAction doesn\'t imply that the agent is expecting to poll for updates from the object.\\\n* [[SubscribeAction]]: Unlike SubscribeAction, RegisterAction doesn\'t imply that the agent is expecting updates from the object.'),
(836, 1, 14, 'RejectAction', 'RejectAction', 'The act of rejecting to/adopting an object.\\\n\\\nRelated actions:\\\n\\\n* [[AcceptAction]]: The antonym of RejectAction.'),
(837, 1, 14, 'RentAction', 'RentAction', 'The act of giving money in return for temporary use, but not ownership, of an object such as a vehicle or property. For example, an agent rents a property from a landlord in exchange for a periodic payment.'),
(838, 1, 14, 'RentalCarReservation', 'RentalCarReservation', 'A reservation for a rental car.\\\n\\\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations.'),
(839, 1, 14, 'RepaymentSpecification', 'RepaymentSpecification', 'A structured value representing repayment.'),
(840, 1, 14, 'ReplaceAction', 'ReplaceAction', 'The act of editing a recipient by replacing an old object with a new object.'),
(841, 1, 14, 'ReplyAction', 'ReplyAction', 'The act of responding to a question/message asked/sent by the object. Related to [[AskAction]]\\\n\\\nRelated actions:\\\n\\\n* [[AskAction]]: Appears generally as an origin of a ReplyAction.'),
(842, 1, 14, 'Report', 'Report', 'A Report generated by governmental or non-governmental organization.'),
(843, 1, 14, 'ReportageNewsArticle', 'ReportageNewsArticle', 'The [[ReportageNewsArticle]] type is a subtype of [[NewsArticle]] representing\n news articles which are the result of journalistic news reporting conventions.\n\nIn practice many news publishers produce a wide variety of article types, many of which might be considered a [[NewsArticle]] but not a [[ReportageNewsArticle]]. For example, opinion pieces, reviews, analysis, sponsored or satirical articles, or articles that combine several of these elements.\n\nThe [[ReportageNewsArticle]] type is based on a stricter ideal for \"news\" as a work of journalism, with articles based on factual information either observed or verified by the author, or reported and verified from knowledgeable sources.  This often includes perspectives from multiple viewpoints on a particular issue (distinguishing news reports from public relations or propaganda).  News reports in the [[ReportageNewsArticle]] sense de-emphasize the opinion of the author, with commentary and value judgements typically expressed elsewhere.\n\nA [[ReportageNewsArticle]] which goes deeper into analysis can also be marked with an additional type of [[AnalysisNewsArticle]].\n'),
(844, 1, 14, 'ReportedDoseSchedule', 'ReportedDoseSchedule', 'A patient-reported or observed dosing schedule for a drug or supplement.'),
(845, 1, 14, 'ResearchProject', 'ResearchProject', 'A Research project.'),
(846, 1, 14, 'Researcher', 'Researcher', 'Researchers.'),
(847, 1, 14, 'Reservation', 'Reservation', 'Describes a reservation for travel, dining or an event. Some reservations require tickets. \\\n\\\nNote: This type is for information about actual reservations, e.g. in confirmation emails or HTML pages with individual confirmations of reservations. For offers of tickets, restaurant reservations, flights, or rental cars, use [[Offer]].'),
(848, 1, 14, 'ReservationPackage', 'ReservationPackage', 'A group of multiple reservations with common values for all sub-reservations.'),
(849, 1, 14, 'ReservationStatusType', 'ReservationStatusType', 'Enumerated status values for Reservation.'),
(850, 1, 14, 'ReserveAction', 'ReserveAction', 'Reserving a concrete object.\\\n\\\nRelated actions:\\\n\\\n* [[ScheduleAction]]</a>: Unlike ScheduleAction, ReserveAction reserves concrete objects (e.g. a table, a hotel) towards a time slot / spatial allocation.'),
(851, 1, 14, 'Reservoir', 'Reservoir', 'A reservoir of water, typically an artificially created lake, like the Lake Kariba reservoir.'),
(852, 1, 14, 'Residence', 'Residence', 'The place where a person lives.'),
(853, 1, 14, 'Resort', 'Resort', 'A resort is a place used for relaxation or recreation, attracting visitors for holidays or vacations. Resorts are places, towns or sometimes commercial establishment operated by a single company (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Resort\">http://en.wikipedia.org/wiki/Resort</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n    '),
(854, 1, 14, 'Restaurant', 'Restaurant', 'A restaurant.'),
(855, 1, 14, 'RestrictedDiet', 'RestrictedDiet', 'A diet restricted to certain foods or preparations for cultural, religious, health or lifestyle reasons. '),
(856, 1, 14, 'ResumeAction', 'ResumeAction', 'The act of resuming a device or application which was formerly paused (e.g. resume music playback or resume a timer).'),
(857, 1, 14, 'ReturnAction', 'ReturnAction', 'The act of returning to the origin that which was previously received (concrete objects) or taken (ownership).'),
(858, 1, 14, 'ReturnFeesEnumeration', 'ReturnFeesEnumeration', 'ReturnFeesEnumeration expresses policies for return fees.'),
(859, 1, 14, 'Review', 'Review', 'A review of an item - for example, of a restaurant, movie, or store.'),
(860, 1, 14, 'ReviewAction', 'ReviewAction', 'The act of producing a balanced opinion about the object for an audience. An agent reviews an object with participants resulting in a review.'),
(861, 1, 14, 'ReviewNewsArticle', 'ReviewNewsArticle', 'A [[NewsArticle]] and [[CriticReview]] providing a professional critic\'s assessment of a service, product, performance, or artistic or literary work.'),
(862, 1, 14, 'RiverBodyOfWater', 'RiverBodyOfWater', 'A river (for example, the broad majestic Shannon).'),
(863, 1, 14, 'Role', 'Role', 'Represents additional information about a relationship or property. For example a Role can be used to say that a \'member\' role linking some SportsTeam to a player occurred during a particular time period. Or that a Person\'s \'actor\' role in a Movie was for some particular characterName. Such properties can be attached to a Role entity, which is then associated with the main entities using ordinary properties like \'member\' or \'actor\'.\\\n\\\nSee also [blog post](http://blog.schema.org/2014/06/introducing-role.html).'),
(864, 1, 14, 'RoofingContractor', 'RoofingContractor', 'A roofing contractor.'),
(865, 1, 14, 'Room', 'Room', 'A room is a distinguishable space within a structure, usually separated from other spaces by interior walls. (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Room\">http://en.wikipedia.org/wiki/Room</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(866, 1, 14, 'RsvpAction', 'RsvpAction', 'The act of notifying an event organizer as to whether you expect to attend the event.'),
(867, 1, 14, 'RsvpResponseType', 'RsvpResponseType', 'RsvpResponseType is an enumeration type whose instances represent responding to an RSVP request.'),
(868, 1, 14, 'SaleEvent', 'SaleEvent', 'Event type: Sales event.'),
(869, 1, 14, 'SatiricalArticle', 'SatiricalArticle', 'An [[Article]] whose content is primarily [[satirical]](https://en.wikipedia.org/wiki/Satire) in nature, i.e. unlikely to be literally true. A satirical article is sometimes but not necessarily also a [[NewsArticle]]. [[ScholarlyArticle]]s are also sometimes satirized.'),
(870, 1, 14, 'Schedule', 'Schedule', 'A schedule defines a repeating time period used to describe a regularly occurring [[Event]]. At a minimum a schedule will specify [[repeatFrequency]] which describes the interval between occurences of the event. Additional information can be provided to specify the schedule more precisely.\n      This includes identifying the day(s) of the week or month when the recurring event will take place, in addition to its start and end time. Schedules may also\n      have start and end dates to indicate when they are active, e.g. to define a limited calendar of events.'),
(871, 1, 14, 'ScheduleAction', 'ScheduleAction', 'Scheduling future actions, events, or tasks.\\\n\\\nRelated actions:\\\n\\\n* [[ReserveAction]]: Unlike ReserveAction, ScheduleAction allocates future actions (e.g. an event, a task, etc) towards a time slot / spatial allocation.'),
(872, 1, 14, 'ScholarlyArticle', 'ScholarlyArticle', 'A scholarly article.'),
(873, 1, 14, 'School', 'School', 'A school.'),
(874, 1, 14, 'SchoolDistrict', 'SchoolDistrict', 'A School District is an administrative area for the administration of schools.'),
(875, 1, 14, 'ScreeningEvent', 'ScreeningEvent', 'A screening of a movie or other video.'),
(876, 1, 14, 'Sculpture', 'Sculpture', 'A piece of sculpture.'),
(877, 1, 14, 'SeaBodyOfWater', 'SeaBodyOfWater', 'A sea (for example, the Caspian sea).'),
(878, 1, 14, 'SearchAction', 'SearchAction', 'The act of searching for an object.\\\n\\\nRelated actions:\\\n\\\n* [[FindAction]]: SearchAction generally leads to a FindAction, but not necessarily.'),
(879, 1, 14, 'SearchResultsPage', 'SearchResultsPage', 'Web page type: Search results page.'),
(880, 1, 14, 'Season', 'Season', 'A media season e.g. tv, radio, video game etc.'),
(881, 1, 14, 'Seat', 'Seat', 'Used to describe a seat, such as a reserved seat in an event reservation.'),
(882, 1, 14, 'SeekToAction', 'SeekToAction', 'This is the [[Action]] of navigating to a specific [[startOffset]] timestamp within a [[VideoObject]], typically represented with a URL template structure.'),
(883, 1, 14, 'SelfStorage', 'SelfStorage', 'A self-storage facility.'),
(884, 1, 14, 'SellAction', 'SellAction', 'The act of taking money from a buyer in exchange for goods or services rendered. An agent sells an object, product, or service to a buyer for a price. Reciprocal of BuyAction.'),
(885, 1, 14, 'SendAction', 'SendAction', 'The act of physically/electronically dispatching an object for transfer from an origin to a destination.Related actions:\\\n\\\n* [[ReceiveAction]]: The reciprocal of SendAction.\\\n* [[GiveAction]]: Unlike GiveAction, SendAction does not imply the transfer of ownership (e.g. I can send you my laptop, but I\'m not necessarily giving it to you).'),
(886, 1, 14, 'Series', 'Series', '\n          A Series in schema.org is a group of related items, typically but not necessarily of the same kind. See also [[CreativeWorkSeries]], [[EventSeries]].'),
(887, 1, 14, 'Service', 'Service', 'A service provided by an organization, e.g. delivery service, print services, etc.'),
(888, 1, 14, 'ServiceChannel', 'ServiceChannel', 'A means for accessing a service, e.g. a government office location, web site, or phone number.'),
(889, 1, 14, 'ShareAction', 'ShareAction', 'The act of distributing content to people for their amusement or edification.'),
(890, 1, 14, 'SheetMusic', 'SheetMusic', 'Printed music, as opposed to performed or recorded music.'),
(891, 1, 14, 'ShippingDeliveryTime', 'ShippingDeliveryTime', 'ShippingDeliveryTime provides various pieces of information about delivery times for shipping.'),
(892, 1, 14, 'ShippingRateSettings', 'ShippingRateSettings', 'A ShippingRateSettings represents re-usable pieces of shipping information. It is designed for publication on an URL that may be referenced via the [[shippingSettingsLink]] property of an [[OfferShippingDetails]]. Several occurrences can be published, distinguished and matched (i.e. identified/referenced) by their different values for [[shippingLabel]].'),
(893, 1, 14, 'ShoeStore', 'ShoeStore', 'A shoe store.'),
(894, 1, 14, 'ShoppingCenter', 'ShoppingCenter', 'A shopping center or mall.'),
(895, 1, 14, 'ShortStory', 'ShortStory', 'Short story or tale. A brief work of literature, usually written in narrative prose.'),
(896, 1, 14, 'SingleFamilyResidence', 'SingleFamilyResidence', 'Residence type: Single-family home.'),
(897, 1, 14, 'SiteNavigationElement', 'SiteNavigationElement', 'A navigation element of the page.'),
(898, 1, 14, 'SkiResort', 'SkiResort', 'A ski resort.'),
(899, 1, 14, 'SocialEvent', 'SocialEvent', 'Event type: Social event.'),
(900, 1, 14, 'SocialMediaPosting', 'SocialMediaPosting', 'A post to a social media platform, including blog posts, tweets, Facebook posts, etc.'),
(901, 1, 14, 'SoftwareApplication', 'SoftwareApplication', 'A software application.'),
(902, 1, 14, 'SoftwareSourceCode', 'SoftwareSourceCode', 'Computer programming source code. Example: Full (compile ready) solutions, code snippet samples, scripts, templates.'),
(903, 1, 14, 'SolveMathAction', 'SolveMathAction', 'The action that takes in a math expression and directs users to a page potentially capable of solving/simplifying that expression.'),
(904, 1, 14, 'SomeProducts', 'SomeProducts', 'A placeholder for multiple similar products of the same kind.'),
(905, 1, 14, 'SpeakableSpecification', 'SpeakableSpecification', 'A SpeakableSpecification indicates (typically via [[xpath]] or [[cssSelector]]) sections of a document that are highlighted as particularly [[speakable]]. Instances of this type are expected to be used primarily as values of the [[speakable]] property.'),
(906, 1, 14, 'SpecialAnnouncement', 'SpecialAnnouncement', 'A SpecialAnnouncement combines a simple date-stamped textual information update\n      with contextualized Web links and other structured data.  It represents an information update made by a\n      locally-oriented organization, for example schools, pharmacies, healthcare providers,  community groups, police,\n      local government.\n\nFor work in progress guidelines on Coronavirus-related markup see [this doc](https://docs.google.com/document/d/14ikaGCKxo50rRM7nvKSlbUpjyIk2WMQd3IkB1lItlrM/edit#).\n\nThe motivating scenario for SpecialAnnouncement is the [Coronavirus pandemic](https://en.wikipedia.org/wiki/2019%E2%80%9320_coronavirus_pandemic), and the initial vocabulary is oriented to this urgent situation. Schema.org\nexpect to improve the markup iteratively as it is deployed and as feedback emerges from use. In addition to our\nusual [Github entry](https://github.com/schemaorg/schemaorg/issues/2490), feedback comments can also be provided in [this document](https://docs.google.com/document/d/1fpdFFxk8s87CWwACs53SGkYv3aafSxz_DTtOQxMrBJQ/edit#).\n\n\nWhile this schema is designed to communicate urgent crisis-related information, it is not the same as an emergency warning technology like [CAP](https://en.wikipedia.org/wiki/Common_Alerting_Protocol), although there may be overlaps. The intent is to cover\nthe kinds of everyday practical information being posted to existing websites during an emergency situation.\n\nSeveral kinds of information can be provided:\n\nWe encourage the provision of \"name\", \"text\", \"datePosted\", \"expires\" (if appropriate), \"category\" and\n\"url\" as a simple baseline. It is important to provide a value for \"category\" where possible, most ideally as a well known\nURL from Wikipedia or Wikidata. In the case of the 2019-2020 Coronavirus pandemic, this should be \"https://en.wikipedia.org/w/index.php?title=2019-20\\\\_coronavirus\\\\_pandemic\" or \"https://www.wikidata.org/wiki/Q81068910\".\n\nFor many of the possible properties, values can either be simple links or an inline description, depending on whether a summary is available. For a link, provide just the URL of the appropriate page as the property\'s value. For an inline description, use a [[WebContent]] type, and provide the url as a property of that, alongside at least a simple \"[[text]]\" summary of the page. It is\nunlikely that a single SpecialAnnouncement will need all of the possible properties simultaneously.\n\nWe expect that in many cases the page referenced might contain more specialized structured data, e.g. contact info, [[openingHours]], [[Event]], [[FAQPage]] etc. By linking to those pages from a [[SpecialAnnouncement]] you can help make it clearer that the events are related to the situation (e.g. Coronavirus) indicated by the [[category]] property of the [[SpecialAnnouncement]].\n\nMany [[SpecialAnnouncement]]s will relate to particular regions and to identifiable local organizations. Use [[spatialCoverage]] for the region, and [[announcementLocation]] to indicate specific [[LocalBusiness]]es and [[CivicStructures]]. If the announcement affects both a particular region and a specific location (for example, a library closure that serves an entire region), use both [[spatialCoverage]] and [[announcementLocation]].\n\nThe [[about]] property can be used to indicate entities that are the focus of the announcement. We now recommend using [[about]] only\nfor representing non-location entities (e.g. a [[Course]] or a [[RadioStation]]). For places, use [[announcementLocation]] and [[spatialCoverage]]. Consumers of this markup should be aware that the initial design encouraged the use of /about for locations too.\n\nThe basic content of [[SpecialAnnouncement]] is similar to that of an [RSS](https://en.wikipedia.org/wiki/RSS) or [Atom](https://en.wikipedia.org/wiki/Atom_(Web_standard)) feed. For publishers without such feeds, basic feed-like information can be shared by posting\n[[SpecialAnnouncement]] updates in a page, e.g. using JSON-LD. For sites with Atom/RSS functionality, you can point to a feed\nwith the [[webFeed]] property. This can be a simple URL, or an inline [[DataFeed]] object, with [[encodingFormat]] providing\nmedia type information e.g. \"application/rss+xml\" or \"application/atom+xml\".\n'),
(907, 1, 14, 'Specialty', 'Specialty', 'Any branch of a field in which people typically develop specific expertise, usually after significant study, time, and effort.'),
(908, 1, 14, 'SportingGoodsStore', 'SportingGoodsStore', 'A sporting goods store.'),
(909, 1, 14, 'SportsActivityLocation', 'SportsActivityLocation', 'A sports location, such as a playing field.'),
(910, 1, 14, 'SportsClub', 'SportsClub', 'A sports club.'),
(911, 1, 14, 'SportsEvent', 'SportsEvent', 'Event type: Sports event.'),
(912, 1, 14, 'SportsOrganization', 'SportsOrganization', 'Represents the collection of all sports organizations, including sports teams, governing bodies, and sports associations.'),
(913, 1, 14, 'SportsTeam', 'SportsTeam', 'Organization: Sports team.'),
(914, 1, 14, 'SpreadsheetDigitalDocument', 'SpreadsheetDigitalDocument', 'A spreadsheet file.'),
(915, 1, 14, 'StadiumOrArena', 'StadiumOrArena', 'A stadium.'),
(916, 1, 14, 'State', 'State', 'A state or province of a country.'),
(917, 1, 14, 'StatisticalPopulation', 'StatisticalPopulation', 'A StatisticalPopulation is a set of instances of a certain given type that satisfy some set of constraints. The property [[populationType]] is used to specify the type. Any property that can be used on instances of that type can appear on the statistical population. For example, a [[StatisticalPopulation]] representing all [[Person]]s with a [[homeLocation]] of East Podunk California, would be described by applying the appropriate [[homeLocation]] and [[populationType]] properties to a [[StatisticalPopulation]] item that stands for that set of people.\nThe properties [[numConstraints]] and [[constrainingProperties]] are used to specify which of the populations properties are used to specify the population. Note that the sense of \"population\" used here is the general sense of a statistical\npopulation, and does not imply that the population consists of people. For example, a [[populationType]] of [[Event]] or [[NewsArticle]] could be used. See also [[Observation]], and the [data and datasets](/docs/data-and-datasets.html) overview for more details.\n  '),
(918, 1, 14, 'StatusEnumeration', 'StatusEnumeration', 'Lists or enumerations dealing with status types.'),
(919, 1, 14, 'SteeringPositionValue', 'SteeringPositionValue', 'A value indicating a steering position.'),
(920, 1, 14, 'Store', 'Store', 'A retail good store.'),
(921, 1, 14, 'StructuredValue', 'StructuredValue', 'Structured values are used when the value of a property has a more complex structure than simply being a textual value or a reference to another thing.'),
(922, 1, 14, 'SubscribeAction', 'SubscribeAction', 'The act of forming a personal connection with someone/something (object) unidirectionally/asymmetrically to get updates pushed to.\\\n\\\nRelated actions:\\\n\\\n* [[FollowAction]]: Unlike FollowAction, SubscribeAction implies that the subscriber acts as a passive agent being constantly/actively pushed for updates.\\\n* [[RegisterAction]]: Unlike RegisterAction, SubscribeAction implies that the agent is interested in continuing receiving updates from the object.\\\n* [[JoinAction]]: Unlike JoinAction, SubscribeAction implies that the agent is interested in continuing receiving updates from the object.'),
(923, 1, 14, 'Substance', 'Substance', 'Any matter of defined composition that has discrete existence, whose origin may be biological, mineral or chemical.'),
(924, 1, 14, 'SubwayStation', 'SubwayStation', 'A subway station.'),
(925, 1, 14, 'Suite', 'Suite', 'A suite in a hotel or other public accommodation, denotes a class of luxury accommodations, the key feature of which is multiple rooms (Source: Wikipedia, the free encyclopedia, see <a href=\"http://en.wikipedia.org/wiki/Suite_(hotel)\">http://en.wikipedia.org/wiki/Suite_(hotel)</a>).\n<br /><br />\nSee also the <a href=\"/docs/hotels.html\">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\n'),
(926, 1, 14, 'SuperficialAnatomy', 'SuperficialAnatomy', 'Anatomical features that can be observed by sight (without dissection), including the form and proportions of the human body as well as surface landmarks that correspond to deeper subcutaneous structures. Superficial anatomy plays an important role in sports medicine, phlebotomy, and other medical specialties as underlying anatomical structures can be identified through surface palpation. For example, during back surgery, superficial anatomy can be used to palpate and count vertebrae to find the site of incision. Or in phlebotomy, superficial anatomy can be used to locate an underlying vein; for example, the median cubital vein can be located by palpating the borders of the cubital fossa (such as the epicondyles of the humerus) and then looking for the superficial signs of the vein, such as size, prominence, ability to refill after depression, and feel of surrounding tissue support. As another example, in a subluxation (dislocation) of the glenohumeral joint, the bony structure becomes pronounced with the deltoid muscle failing to cover the glenohumeral joint allowing the edges of the scapula to be superficially visible. Here, the superficial anatomy is the visible edges of the scapula, implying the underlying dislocation of the joint (the related anatomical structure).'),
(927, 1, 14, 'SurgicalProcedure', 'SurgicalProcedure', 'A medical procedure involving an incision with instruments; performed for diagnose, or therapeutic purposes.'),
(928, 1, 14, 'SuspendAction', 'SuspendAction', 'The act of momentarily pausing a device or application (e.g. pause music playback or pause a timer).'),
(929, 1, 14, 'Synagogue', 'Synagogue', 'A synagogue.'),
(930, 1, 14, 'TVClip', 'TVClip', 'A short TV program or a segment/part of a TV program.'),
(931, 1, 14, 'TVEpisode', 'TVEpisode', 'A TV episode which can be part of a series or season.'),
(932, 1, 14, 'TVSeason', 'TVSeason', 'Season dedicated to TV broadcast and associated online delivery.'),
(933, 1, 14, 'TVSeries', 'TVSeries', 'CreativeWorkSeries dedicated to TV broadcast and associated online delivery.'),
