(976, 1, 14, 'UnRegisterAction', 'UnRegisterAction', 'The act of un-registering from a service.\\\n\\\nRelated actions:\\\n\\\n* [[RegisterAction]]: antonym of UnRegisterAction.\\\n* [[LeaveAction]]: Unlike LeaveAction, UnRegisterAction implies that you are unregistering from a service you werer previously registered, rather than leaving a team/group of people.'),
