(1017, 1, 14, 'WebAPI', 'WebAPI', 'An application programming interface accessible over Web/Internet technologies.'),
(1018, 1, 14, 'WebApplication', 'WebApplication', 'Web applications.'),
(1019, 1, 14, 'WebContent', 'WebContent', 'WebContent is a type representing all [[WebPage]], [[WebSite]] and [[WebPageElement]] content. It is sometimes the case that detailed distinctions between Web pages, sites and their parts is not always important or obvious. The  [[WebContent]] type makes it easier to describe Web-addressable content without requiring such distinctions to always be stated. (The intent is that the existing types [[WebPage]], [[WebSite]] and [[WebPageElement]] will eventually be declared as subtypes of [[WebContent]].)\n  '),
(1020, 1, 14, 'WebPage', 'WebPage', 'A web page. Every web page is implicitly assumed to be declared to be of type WebPage, so the various properties about that webpage, such as <code>breadcrumb</code> may be used. We recommend explicit declaration if these properties are specified, but if they are found outside of an itemscope, they will be assumed to be about the page.'),
(1021, 1, 14, 'WebPageElement', 'WebPageElement', 'A web page element, like a table or an image.'),
(1022, 1, 14, 'WebSite', 'WebSite', 'A WebSite is a set of related web pages and other items typically served from a single web domain and accessible via URLs.'),
(1023, 1, 14, 'WholesaleStore', 'WholesaleStore', 'A wholesale store.'),
(1024, 1, 14, 'WinAction', 'WinAction', 'The act of achieving victory in a competitive activity.'),
(1025, 1, 14, 'Winery', 'Winery', 'A winery.'),
(1026, 1, 14, 'WorkBasedProgram', 'WorkBasedProgram', 'A program with both an educational and employment component. Typically based at a workplace and structured around work-based learning, with the aim of instilling competencies related to an occupation. WorkBasedProgram is used to distinguish programs such as apprenticeships from school, college or other classroom based educational programs.'),
(1027, 1, 14, 'WorkersUnion', 'WorkersUnion', 'A Workers Union (also known as a Labor Union, Labour Union, or Trade Union) is an organization that promotes the interests of its worker members by collectively bargaining with management, organizing, and political lobbying.'),
