(1051, 5, 17, 'Curve', 'Courbe', 'Geometric primitive representing a curve. It is not instantiable. It\'s specializations are instantiated as an ordered list of points associated with an interpolation function.'),
(1052, 5, 17, 'Envelope', 'Envelope', 'Geometric primitive representing the minimal envelope of a geometry. An envelope is represented by two points: its maximum coordinate corner and its minimal coordinate corner.'),
(1053, 5, 17, 'Geometry', 'Geometry', 'Non-instantiable geometric primitive, root of the ontology of geometric primitives. Geometry is associated with a coordinate system and only one.'),
(1054, 5, 17, 'GeometryCollection', 'Collection de géométries', 'Collection comprenant un ou plusieurs objets géométriques, sans structure interne. Tous les éléments d\'une collection de géométries sont définis dans le même système de coordonnées.'),
(1055, 5, 17, 'Line', 'Ligne', 'Geometric primitive specializing the primitive Polyline and consisting of only two points.'),
(1056, 5, 17, 'LineString', 'Line string', 'Geometric primitive specializing the abstract primitive curve. Its points are linked by a linear interpolation function. Each pair of successive points therefore constitutes a straight line segment.'),
(1057, 5, 17, 'LinearRing', 'Anneau', 'Geometric primitive specializing the primitive Polyline. It is a simple, closed curve.'),
(1058, 5, 17, 'MultiCurve', 'Multi curve', 'Collection d\'objets géométriques de type Courbe. Cette primitive n\'est pas instanciable: elle définit des propriétés pour ses sous-classes.'),
(1059, 5, 17, 'MultiLineString', 'Multi line string', 'Collection d\'objets géométriques de type Polyligne. C\'est une MultiCourbe dont tous les éléments sont des Polylignes.'),
(1060, 5, 17, 'MultiPoint', 'Multi point', 'Collection d\'objets géométriques de type Point, non connectés et non ordonnés. Un multipoint est dit simple si tous ses points sont différents (i.e. ont des coordonnées différentes).'),
(1061, 5, 17, 'MultiPolygon', 'Multi polygon', 'Collection d\'objets géométriques de type Polygone. C\'est une MultiSurface dont tous les éléments sont des Polygones.'),
(1062, 5, 17, 'MultiSurface', 'Multi surface', 'Collection d\'objets géométriques de type Surface. Cette primitive n\'est pas instanciable: elle définit des propriétés pour ses sous classes.'),
(1063, 5, 17, 'Point', 'Point', 'Geometric primitive to represent a geographical position. This position is represented via X and Y coordinates expressed in a given coordinate system. If the coordinate system associated with the point allows it, the point may also have Z and M coordinates.'),
(1064, 5, 17, 'PointsList', 'List of points', 'List of points'),
(1065, 5, 17, 'Polygon', 'Polygon', 'Geometric primitive specializing Surface primitive. It is a flat surface defined by an outer boundary and zero or more interior boundaries. Each inner boundary defines a hole in the polygon.'),
(1066, 5, 17, 'Surface', 'Surface', 'Geometric primitive locally representing a continuous image of a region of a plane. It is not instantiable. The outline of a surface is a set of closed curves corresponding to its boundaries.'),
